(6, 'Dip Hem Chiffon Patterned Top', '10-B3-VNECKBLOTS-Cream/Blue-UK 10 - EU 38', 0, 0, 'Dip hem chiffon patterned top. Look pretty this season in this dip hem chiffon patterned top. Key details include a chiffon material, sleeveless, dip hem style with a cream and blue leopard print design finished with a low v-neck back.', '2023-12-08 11:03:40', '2023-12-08 11:03:40'),
