(15, 'Cut Out Leggings', '12-A2-BF93325-Grey-One Size - UK (8-14)', 0, 0, 'Cut Out Leggings. Rip it up with these leggings, starting from the thigh going all the way down to your ankles. Match it up with a printed top and a leather jacket to show your rage.', '2023-12-08 11:04:02', '2023-12-08 11:04:02'),
