(20, 'High Waisted Footless Tights', '12-A4-BF93336-Grey-One Size - UK (8-14)', 0, 0, 'High Waisted Footless Tights. Brighten up your day with these colourful footless tights! Perfect with your summer dresses to welcome the new season in style. Key features include an elasticated waist, stomach support and a super soft material inside!', '2023-12-08 11:04:12', '2023-12-08 11:04:12'),
