(22, 'Blue Lace Front Leggings', 'R-BOX2-901-132-Blue Lace-One Size - UK (8-14)', 0, 0, 'Blue Lace Front Leggings. Be brave and bold with a pair of these delightful leggings. The front section has a very intricate blue lace design. Ankle length and snug fit all make up what leggings should be.', '2023-12-08 11:04:16', '2023-12-08 11:04:16'),
