(25, 'Brown Slim Fit Maxi', '12-B2-LTINFONE-Brown-One Size - UK 8-14', 0, 0, 'Brown Slim Fit Maxi. It is no secret that maxi dresses have been around for a couple of years and plan to stay as one of our wardrobes summer favourite. This maxi is plain with a racer back but should not be underestimated. With some chunky jewellery and a lightweight blazer it will look like you&#39;ve dressed up to the 9&#39;s.', '2023-12-08 11:04:22', '2023-12-08 11:04:22'),
