(42, 'Beaded Halterneck Dress', '14-B4-MI810-Beige-M/L - UK (12-14)', 0, 0, 'Beaded Halterneck Dress. Look pretty in this beaded halterneck dress, available in beige and pink. Key details include an elasticated bust, beaded halterneck, completed with a suede finish.', '2023-12-08 11:05:20', '2023-12-08 11:05:20'),
