(45, 'Pretty Floral Dress', 'TREASURE2-Ivory-Large - UK (12-14)', 0, 0, 'Pretty Floral Dress. Get ready for summer and look pretty in this floral dress. Key details include adjustable straps, elasticated waist with a floral design.', '2023-12-08 11:05:27', '2023-12-08 11:05:27'),
