(382, 'Bohemian Multi Print Summer Dress', 'T0-B3-JAL9218-Pink-Medium - UK (10-12)', 0, 0, 'Bohemian Multi Print Summer Dress. What&#39;s a better way to greet the Summer season than to treat yourself to a brand new summer dress- and this one is available in three different colours! Its material is fabulously lightweight, and it has thin adjustable shoulder straps, perfect for keeping cool and comfortable in the sun! There is a panel of elasticated fabric on the back, and two open front pockets. This dress has multiple print including stripes, dots and flowers, and the neckline has a crochet detail with pretty bead embellishment. Wear with sandals for the beach, or your wellys for the festivals!\nThis item is true to size.', '2023-12-08 11:21:21', '2023-12-08 11:21:21'),
