(566, 'Printed Straight Leg Trousers', '20-A5-9929-Black-Large - UK (12-14)', 0, 0, 'Printed Straight Leg Trousers. Dare to be bold in these stylish printed trousers. Nicely fitted with a side zip and button fastening.\nThese trousers are true to size', '2023-12-08 11:29:43', '2023-12-08 11:29:43'),
(567, 'Multi Print Summer Dress with Bead and Chain Detail', '20-A5-AT075-Grey-L/XL - UK (12-14)', 0, 0, 'Multi Print Summer Dress with Bead and Chain Detail. Stand out from the crowd in this fabulous summer dress, now available in three different colours! The dress features a combination of prints, including black and white flowers, leaves and abstract patterns. It has silk-feel wide straps, and the silk panel continues over the bust. The panel has a glitter threading throughout, and is embellished with metal chain and beads. There is a thin silky belt to tie around your waist and flatter your figure. This dress is guaranteed to put a smile on your face, and is perfect for the sunny summer days. \nThis item is true to size.', '2023-12-08 11:29:44', '2023-12-08 11:29:44'),
(568, 'Wild Girl Burgundy And Grey Top', '20-B2-B8991-Burgundy-Large - UK (12-14)', 0, 0, 'Wild Girl Burgundy And Grey Long Sleeve Top. This item is true to size.', '2023-12-08 11:29:46', '2023-12-08 11:29:46'),
