(571, 'Wet Look Leggings with Lace Detail', '20-B3-LM332-56-Black-S/M - UK (8-10)', 0, 0, 'Wet Look Leggings with Lace Detail. These stretchy leggings have a wet look to them, and three lace panels on the front. They are elasticated for ultimate comfort. This item is true to size.', '2023-12-08 11:29:50', '2023-12-08 11:29:50'),
(572, 'Light Wash Denim Shirt', '20-B4-ESIN-Denim Blue-UK 10 - EU 38', 0, 0, 'Light Wash Denim Shirt. No wardrobe is complete without a denim shirt, and this one is just right for the Summer season! It has a light denim wash colour with contrasting dark seams, and plaited fabric detail on the shoulders. It has popper fastening down the front and on the cuffs, and two pockets on the chest also with popper fastening. The poppers have a cute bronze and pearlescent effect, adding a touch of glamour to this casual shirt. \nThis item is true to size.', '2023-12-08 11:29:52', '2023-12-08 11:29:52'),
(573, 'Colour Block Oversized Box Cardigan', '21-A1-21126-Orange-One Size - UK (8-14)', 31, 1, 'Colour Block Oversized Box Cardigan. This item is true to size', '2023-12-08 11:29:53', '2023-12-08 11:29:53'),
(574, 'V-Neck Peplum Dress with Zip', '21-A2-F8171-Black-Large - UK (12-14)', 0, 0, 'V-Neck Peplum Dress with Zip. Turn heads in this classy peplum style dress, with short t-shirt sleeves. It has a pannelled look on the bust, and a silver coloured metal zip in the centre of the v-neck. The dress also has a long zip on the back for easy changing, and the material is lightweight- perfect for the Summer season. Just throw on a pair of high heels and you&#39;ll be ready to knock em&#39; dead! \nThis item is true to size.', '2023-12-08 11:29:54', '2023-12-08 11:29:54'),
(575, 'Black Denim Shirt with Diamante and Bead Shoulder Detail', '21-A2-LAURITA-Black-Large - UK (12-14)', 0, 0, 'Black Denim Shirt with Diamante and Bead Shoulder Detail. Every girl needs a denim shirt in her life! This 100% cotton black shirt is lightweight and soft to touch, perfect for the Summer season. The black diamante and bead detail on the shoulders adds a touch of glamour to a casual shirt, and the popper fastening down the front and on the cuffs of the sleeves have a cute and feminine pearlescent effect. \nThis item is true to size.', '2023-12-08 11:29:56', '2023-12-08 11:29:56'),
