(598, 'Cropped Harem Pants With Printed Scarf', '22-B2-6966-Blue-SM - UK (8-10)', 0, 0, 'Cropped Harem Pants With Printed Scarf. The ultimate answer to style and comfort, complimented by a printed scarf tied to the belt loop. Team it up with wedged hi-tops for a sports luxe look. This item is true to size', '2023-12-08 11:30:38', '2023-12-08 11:30:38'),
