(603, 'Roll Neck Bodycon Dress', '23-A1-EMELIJA-01-Wine-M/L - UK (12-14)', 0, 0, 'Roll Neck Bodycon Dress. This bodycon dress has long sleeves and a roll neck. The studded belt is included. The material is stretchy for a comfortable fit. This dress is a slim fit.\nBelt is included.', '2023-12-08 11:30:48', '2023-12-08 11:30:48'),
(604, 'Asymmetric 3/4 Sleeve Bodycon Dress', '23-A2-JC69205B-Wine-UK 10 - EU 38', 0, 0, 'Asymmetric 3/4 Sleeve Bodycon Dress. If you&#39;re a fan of simplicity, the asymmetric trend is right up your street. This bodycon dress has an asymmetric hem to flatter the legs. Available in three colours. This item is true to size. Ex-branded.', '2023-12-08 11:30:51', '2023-12-08 11:30:51'),
(605, 'Short Sleeve Maxi Dress', '23-A3-LUIS-Black-UK 10 - EU 38', 0, 0, 'Short Sleeve Maxi Dress. A staple item that will see you through all seasons and occasions. Wear with sandals during the day or opt for heels in the evening. This item is true to size.\nEx-Branded', '2023-12-08 11:30:54', '2023-12-08 11:30:54'),
(606, 'Textured Bodycon Dress', '23-A3-SONATA-Black-UK 10 - EU 38', 0, 0, 'Textured Bodycon Dress. Get ready to party in style with this scoop neck bodycon dress. Key features also include textured fabric and long sleeves. This item is true to size.\nEx-Branded', '2023-12-08 11:30:58', '2023-12-08 11:30:58'),
(607, 'Smart Slim Trousers With Silver Chain Detail', '23-A4-012-Beige-Large - UK (12-14)', 0, 0, 'Smart Slim Trousers With Silver Chain Detail. Stay comfortably stylish in these beautiful slim fit trousers. Key details include slightly gathered front side pockets, a pretty silver chain belt detail on the waist and smart stitched pockets on the rear. \nThese trousers are true to size', '2023-12-08 11:31:00', '2023-12-08 11:31:00'),
(608, 'Soft Jumper with Lace Shoulder Detail', '23-A4-9131-Burgundy-Large - UK (12-14)', 0, 0, 'Soft Jumper with Lace Shoulder Detail. This stylish lightweight jumper is perfect for the approaching Spring/Summer season! It is very soft, has a round neckline and has black lace detail on each shoulder for added style points! \nThis jumper is true to size.', '2023-12-08 11:31:03', '2023-12-08 11:31:03'),
(609, 'Tartan Print T-Shirt Dress', '23-B1-BELINDA-Green-S/M - UK (8-10)', 0, 0, 'Tartan print t-shirt dress. Be casual and chic in this lightweight t-shirt dress that is perfect for spring! With rolled t-shirt sleeves and gathering to emphasize the waist. This dress is true to size.', '2023-12-08 11:31:05', '2023-12-08 11:31:05'),
(610, 'Smart Black Skater Dress with Faux Leather Detail - PLUS SIZES AVAILABLE', '23-B1-M5012-Black-UK 10 - EU 38', 0, 0, 'Smart Black Skater Dress with Faux Leather Detail. A wardrobe essential for every girl, this little black dress has faux leather detail on the shoulder and around the neckline for extra style points! Wear with heels for an on-trend look this summer. \nThis dress is true to size.', '2023-12-08 11:31:06', '2023-12-08 11:31:06'),
(611, 'Hearts and Flowers Midi Pencil Skirt', '23-B3-BAILEY-Black and Red-M/L - UK (12-14)', 0, 0, 'Hearts and Flowers Midi Pencil Skirt. Spread the love in this fabulous midi pencil skirt, with a cute mixed print of red hearts and white flowers and flock pattern. Key details include an elasticated waist and soft material for ultimate comfort this summer.', '2023-12-08 11:31:09', '2023-12-08 11:31:09'),
(612, 'Wet Look Leggings', '22-B4-ITRM370-Brown-UK 10 - EU 38', 18, 1, 'Wet Look Leggings. These leggings are stretchy and have an on-trend wet look to them. The waistband is elasticated for a comfortable fit. Would look perfect teamed with heels, or dress down with sandals for a smart casual look.\nThis item is true to size.', '2023-12-08 11:31:10', '2023-12-08 11:31:10'),
(613, 'Smart Kaftan with Embellished Neck-Line', '23-B3-10188-Cream-M/L - UK (12-14)', 0, 0, 'Smart Kaftan with Embellished Neck-Line', '2023-12-08 11:31:12', '2023-12-08 11:31:12'),
(614, 'Elegant Embellished Halter Neck Top', '23-B3-8373-Black-M/L - UK (12-14)', 0, 0, 'Elegant Embellished Halter Neck Top. Perfect for the approaching summer evenings, stand out from the crowd in this chic halterneck top, with beautiful embellishment along the neckline to really make you sparkle!\nThis top is true to size.', '2023-12-08 11:31:14', '2023-12-08 11:31:14'),
(615, 'Chiffon Summer Playsuit', '23-B3-URBAN-Multicoloured-UK 10 - EU 38', 0, 0, 'Chiffon Summer Playsuit. Stay glamorous this summer in this beautiful lightweight playsuit, available in two different styles. With beautiful layered fabric detail on the bust, other key features include adjustable straps and elasticated waist line to compliment your figure. \nThis item is true to size.', '2023-12-08 11:31:16', '2023-12-08 11:31:16'),
(616, 'Blue Shift Dress with Pockets', '23-B3-ZOE-Blue-UK 10 - EU 38', 0, 0, 'Blue Shift Dress with Pockets. This bright little number is perfect for the approaching summer season! Key features include two pockets on the front, a round neckline, a zip on the back and decorative button detail on each shoulder panel.', '2023-12-08 11:31:19', '2023-12-08 11:31:19'),
(617, 'Bodycon Midi Skirt with Embellishment', '23-B4-9579-Black-M/L - UK (12-14)', 0, 0, 'Bodycon Midi Skirt with Embellishment. Stand out from the crowd in this quirky printed skirt! In an on-trend midi cut, and with a mixture of studs, pearls and diamantes laid over the subtle charcoal print. Other key details include a slit in the fabric on the back at the bottom and a zip on the waist. \nThis item is true to size.', '2023-12-08 11:31:20', '2023-12-08 11:31:20'),
(618, 'Army Print Shirt with Gold Stud Detail', '23-B4-9768-Army Green-S/M - UK (10-12)', 0, 0, 'Army Print Shirt with Gold Stud Detail. Be stylish AND comfortable in this 100% cotton shirt, available in 2 colours. It has a funky army print and gold buttons down the front. Other key features include two pockets on each breast, both with single gold button fastener, single gold button fasteners on each cuff, and a small panel of gold stud detail on each side of the collar. \nThis shirt is true to size.', '2023-12-08 11:31:22', '2023-12-08 11:31:22'),
(619, 'Tartan Bomber Jacket', '23-B4-HM1542-Black and White-Large - UK (12-14)', 0, 0, 'Tartan Bomber Jacket. This on-trend jacket is perfect for the Spring/Summer season, and is available in a choice of two colours! Key details include a round neck-line, a silver full-length zip, double-lining throughout and two front pockets. This jacket is true to size.', '2023-12-08 11:31:24', '2023-12-08 11:31:24'),
(620, 'Acid Wash Blue Cropped Jeans', '23-B5-SM0209-Denim Blue-UK 10 - EU 38', 0, 0, 'Acid Wash Blue Cropped Jeans. Key features include two front pockets, a cropped design with an acid wash finish.', '2023-12-08 11:31:26', '2023-12-08 11:31:26'),
(621, 'Skull Print Funky Leggings', '24-A1-K9010-Black/Skull-One Size - UK (8-14)', 37, 1, 'Skull Print Funky Leggings. These are leggings that when worn give the effect of stretchy material shorts with ribbed tights underneath. They are made of a soft material and very comfy to wear. They are one size.', '2023-12-08 11:31:27', '2023-12-08 11:31:27'),
(622, 'Black Denim Look Leggings', '24-A1-LM1141-Black-One Size - UK (8-14)', 0, 0, 'Black Denim Look Leggings. These leggings have an elasticated waist and are stretchy for a comfy fit. There is a side stitch detail to look like jeans.They are available in one size.', '2023-12-08 11:31:29', '2023-12-08 11:31:29'),
(623, 'Skull And Spider Print Leggings', '24-A1-LM5332-68-Black-S/M - UK (8-10)', 34, 1, 'Skull And Spider Print Leggings. These leggings are stretchy with a skull and spider print and a plain black stripe on the side of each leg. The leggings have knee patches and an elasticated waist for a comfy fit. The material is soft to touch.', '2023-12-08 11:31:29', '2023-12-08 11:31:29'),
(624, 'Short Sleeve Soft Knit Top with Sequinned Tiger Motif', '24-A2-102322-Grey-S/M - UK (10-12)', 14, 1, 'Short Sleeve Soft Knit Top with Sequinned Tiger Motif. Stay on trend in this stylish short sleeved loose fit jumper - available in three colours! The striking embellishment of the tiger motif will certainly make you stand out from the crowd! Key details include a deliciously soft fabric for ultimate comfort, and a round neck-line. This item is true to size.', '2023-12-08 11:31:31', '2023-12-08 11:31:31'),
(625, 'Checked Zipped Leggings', '24-A2-96069-1-Black-One Size - UK (8-12)', 0, 0, 'Checked Zipped Leggings. They are checked with two back pockets. An elasticated waist and side zips at the ankle. They are one size.', '2023-12-08 11:31:33', '2023-12-08 11:31:33'),
(626, 'Leopard Print Leggings with Knee Detail', '24-A2-LM5332-66-Brown-S/M - UK (8-10)', 24, 1, 'Leopard Print Leggings with Knee Detail. These leggings are stretchy with a leopard print and a plain black stripe on the side of each leg. The leggings have wet look knee patches and an elasticated waist for a comfy fit. The material is soft to touch.', '2023-12-08 11:31:34', '2023-12-08 11:31:34'),
