(637, 'Skinny Leopard Print Jeans with Zip Detail', '24-B1-9382-Brown-Large - UK (12-14)', 0, 0, 'Skinny Leopard Print Jeans with Zip Detail. Go wild in these on-trend skinny jeans! They have panels of leopard print along the front of each leg, contrasting with the plain black fabric of the reverse. At the bottom of each leg there is a small gold-coloured zip, matching the gold-coloured button on the waist. Other key details include; two open pockets on the rear, two open pockets on the front, a small zip fly and a circular gold coloured button, and belt loops. \nThis item is true to size.', '2023-12-08 11:31:52', '2023-12-08 11:31:52'),
