(642, 'Bow Detail Strapless Party Dress', '24-B2-LS1019-Black-Large - UK (12-14)', 0, 0, 'Bow Detail Strapless Party Dress. This panelled dress has a boned bodice and is drawn in at the waist with a beautiful bow design to show off your figure. It has a full skirt with mesh underskirt to give it lots of shape. Every girl needs a little black dress in her life, and this one is perfect for almost all occasions! Just team with heels and a clutch and you&#39;re ready to go!  \nThis item is true to size.', '2023-12-08 11:31:58', '2023-12-08 11:31:58'),
(643, 'Black Leggings with Glitter Panel', '24-B3-9165-Black-Medium - UK (10-12)', 0, 0, 'Black Leggings with Glitter Panel. These leggings have a stylish panel of shimmering glitter detail running down the front of each leg, and would be perfect teamed with heels for a smart casual look this Spring! With an elasticated waist band for extra comfort.\nThese leggings are true to size.', '2023-12-08 11:32:00', '2023-12-08 11:32:00'),
(644, 'Sleeveless Oversized Sweat Top with Velcro Detail', '24-B3-9460-Dark Grey-One Size - UK (8-14)', 32, 1, 'Sleeveless Oversized Sweat Top with Velcro Detail. Turn heads in this funky top with a twist! It has a round neck-line, and the fabric has been completely left open along each side, instead you can fasten your top together with the velcro tabs for a unique, &#39;sports luxe&#39; feel!', '2023-12-08 11:32:01', '2023-12-08 11:32:01'),
(645, 'Chiffon Boob Tube with Star Print', '24-B3-A964-Black-Large - UK (12-14)', 0, 0, 'Chiffon Boob Tube with Star Print. Get ready for the sun with this cute chiffon boob tube top available in two colours.  Key details include; an elasticated lower hem, an elastic panel at the back for maximum comfort, doubled up fabric on the chest, and a small panel on the bust with straps to tie as a halter-neck if desired. This item is true to size.', '2023-12-08 11:32:03', '2023-12-08 11:32:03'),
