(649, 'Slinky Strappy Evening Dress with Ruched Detail', 'CHANTELLE-Navy-UK 10 - EU 38', 0, 0, 'Slinky Strappy Evening Dress with Ruched Detail. Be the belle of the ball in this stylish evening dress, available in four different colours! Its material is lightweight and stretchy for a comfortable fit, and there is an elegant ruched-fabric detail on the chest. The dress has thin double straps which are subtly adorned with diamantes, and have a small knotted detail on the shoulders. This classy evening dress is the perfect choice for special occassions, just team with some high heels and a clutch bag and you&#39;re ready to dance the night away. \nThis item is true to size.', '2023-12-08 11:32:08', '2023-12-08 11:32:08'),
(650, 'V-Neck Cardigan', '25-A2-2829-Green-UK 10 - EU 38', 3, 1, 'V-Neck Cardigan. This soft button up cardigan is a wardrobe essential! Key details include ribbed fabric detail on the end of the sleeves, around the hem and around the neckline, buttons down the front and stitched detail on the elbows. \nThis item is true to size.', '2023-12-08 11:32:12', '2023-12-08 11:32:12'),
