(652, 'Smart Floral Print Dress', '25-A3-SAND-Black-UK 10 - EU 38', 0, 0, 'Smart Floral Print Dress. This timeless dress has a lovely feminine rose print and subtle clusters of sequins, and the fabric has a soft velvet feel. It is double-lined, has a scooped neck and a detachable belt in the same fabric to emphasise your waist. Other key details include a tailored cut, short sleeves and a zip on the back which runs down to the rear. \nThis item is true to size.', '2023-12-08 11:32:17', '2023-12-08 11:32:17'),
