(672, 'Pretty in Pink Skater Dress', '27-A3-TT319641-Pink-UK 10 - EU 38', 0, 0, 'Pretty in Pink Skater Dress. Look &#39;pretty in pink&#39; and feel feminine this summer in this cute little skater dress! It has a vest style top with a round neckline that is lower at the front, and is drawn in at the waist where there is a fabric belt that ties into a stylish bow. The skirt of the dress has an abstract floral print in shades of pink, purple, white and green. The skirt also has pockets on each side, and there is a long hidden zip on the left side.\nThis item is true to size.', '2023-12-08 11:33:03', '2023-12-08 11:33:03'),
(673, 'Floral Mint Skater Dress with Corset Detail', '27-A3-TT326111-Mint-UK 10 - EU 38', 0, 0, 'Floral Mint Skater Dress with Corset Detail. Treat yourself to this pretty floral dress- perfect for the approaching Summer days. It has a lined bodice with corset detail, and wide straps over the shoulder. It has a zip on the back, and the skirt is super lightweight and soft. Just team with some tan sandals for Summer-time chic. \nThis item is true to size.', '2023-12-08 11:33:04', '2023-12-08 11:33:04'),
