(680, 'Boob Tube Summer Maxi Dress', '27-B3-PEGGY-Coral-UK 10 - EU 38', 0, 0, 'Boob Tube Summer Maxi Dress.  This soft to touch and stretchy maxi dress is perfect for those days when you want to be comfortable AND stylish, and is available in three different colours! The entire chest is elasticated, just team with sandals or flip flops, grab your sunglasses and you&#39;re ready to roll. \nThis item is true to size.', '2023-12-08 11:33:20', '2023-12-08 11:33:20'),
