(695, 'Textured Peplum Top with Peter Pan Collar', '25-A2-9686-Silver-M/L - UK (12-14)', 0, 0, 'Textured Peplum Top with Peter Pan Collar. Stay on trend this Summer with this gorgeous textured peplum style top, available in two colours. It has short t-shirt style sleeves, a large peter pan collar, a full length zip on the back of the neck, and a pretty flock pattern over the entire front. It&#39;s perfect for special occassions, just team with some high heels, a pencil skirt and a clutch for classy-chic. \nThis item is true to size.', '2023-12-08 11:34:00', '2023-12-08 11:34:00'),
