(697, 'Skinny Stretchy Jeggings with Zip Pocket Detail', '4-A2-9254-Black-Large - UK (12-14)', 0, 0, 'Skinny Stretchy Jeggings with Zip Pocket Detail. Every girl needs a pair of jeggings, and these ones are available in a choice of two colours. The material is soft to touch and stretchy, and they have an elasticated waist band for ultimate comfort. Theses jeggings have metal zips on each side which open to false pockets, and there are two open pockets on the rear. They also have metal zips on the bottom of each leg. Jeggings are an essential item in every womans wardrobe, and very versatile. \nThis item is true to size.', '2023-12-08 11:34:03', '2023-12-08 11:34:03'),
