(700, 'Elegant Black Midi Dress', '4-A3-TRANCO-Black-Large - UK (12-14)', 0, 0, 'Elegant Black Midi Dress. This dress has a padded bust with gorgeous metal detail on the back to add the perfect finishing touch. Simply add a clutch bag for the perfect evening look!', '2023-12-08 11:34:10', '2023-12-08 11:34:10'),
(701, 'Smart Colour Contrast Shorts', '4-A4-7589-Orange-M/L - UK (12-14)', 0, 0, 'Smart Colour Contrast Shorts. These on-trend colourful shorts are perfect for the Summer season, and they&#39;re available in four different colours! They have a stylish block-colour contrast detail, with a contrasting waist-band and stitched pocket seams on the front and rear. They also have two zipped pockets on the front that fasten with a gold-coloured zip. These shorts would look perfect with some high wedges and a smart blazer!\nThese shorts are true to size.', '2023-12-08 11:34:11', '2023-12-08 11:34:11'),
(702, 'Slouchy Sleeveless Asymmetric Top', '4-A5-9399-White-M/L - UK (12-14)', 47, 1, 'Slouchy Sleeveless Asymmetric Top. Realise your inner punk and stand out from the crowd this spring in this stylish sleeveless top, with an on-trend asymmetric cut and gold wolf print motif that is adorned with safety pins.\nThis item is true to size.', '2023-12-08 11:34:14', '2023-12-08 11:34:14'),
