(730, 'Slinky Halterneck Evening Dress with Floaty Hem', '6-B1-ZUZU-Wine-UK 10 - EU 38', 0, 0, 'Slinky Halterneck Evening Dress with Floaty Hem. Be the belle of the ball in this classy little number! It has thick halterneck straps with enough length to tie into a stylish bow behind your neck, and the fabric on the chest crosses over the bust, where there is a wide panel of fabric at the waist for a flattering fit. Its material is lightweight and stretchy for ultimate comfort, and the hem of the dress- around knee-length- has a &#39;floaty&#39; finish; just team with some high heels and a clutch bag and you&#39;re ready to dance the night away! \nThis item is true to size.', '2023-12-08 11:35:20', '2023-12-08 11:35:20'),
