(736, 'Loose Fit Tee with Lace Shoulders - PLUS SIZES AVAILABLE', '7-A2-DINA-Black-UK 10 - EU 38', 0, 0, 'Loose Fit Tee with Lace Shoulders. This loose-fitting top is perfect for those days when you just want to feel comfortable (without the risk of being arrested by the fashion police!) And it is available in two colours! Key details include a round neckline, lace detail on the sleeves, shoulders and upper back, a slightly dipped hemline and a soft, lightweight material. \nThis item is true to size.', '2023-12-08 11:35:32', '2023-12-08 11:35:32'),
