(743, 'Floaty Chiffon Jewelled Halterneck Dress', '7-A4-KIRSTEEN-Black-UK 10 - EU 38', 0, 0, 'Floaty Chiffon Jewelled Halterneck Dress. Stand out from the crowd in this pretty halterneck dress, available in two colours! It is just perfect for the Summer season, the lightweight floaty fabric is ideal for keeping cool in the sun. It has jewelled embellishment around the chest and along the thin halterneck ties, adding a touch of subtle glamour. There is a hidden zip on the right hand side, and the dress is lined throughout.\nThis item is true to size.', '2023-12-08 11:35:47', '2023-12-08 11:35:47'),
