(748, 'Stripy Monochrome Maxi T-Shirt Dress with Crew Neck', '7-B3-FREEDOM-Black and White-S/M - UK (10-12)', 0, 0, 'Stripy Monochrome Maxi T-Shirt Dress with Crew Neck. You can&#39;t go wrong with monochrome, and this stylish maxi dress is no exception! It has an on-trend crew style neckline and t-shirt style sleeves, and has an all-over monochrome stripy print. There is also a sassy slit in the left-hand side of the dress. The style of this dress is so versatile, it would look just as nice with sandals as it would with a pair of hi-top trainers! \nThis item is true to size.', '2023-12-08 11:35:58', '2023-12-08 11:35:58'),
