(862, 'Knit Detailed High Heels', 'S-9A-L-85-Black-UK 3 - EU 36', 8, 1, 'Knit Detailed High Heels\nHas a decorative strap and buckle\nHas a zip for easy fitting\nComplete with a folded knit detail\nShoes have a slim fit', '2023-12-08 11:41:03', '2023-12-08 11:41:03'),
