(864, 'Flat Pumps with Beaded Bow Toe', 'ST-1-128-20-Khaki-UK 3 - EU 36', 0, 0, 'Flat Pumps with Beaded Bow Toe. These flat pumps are simple yet sophisticated, subtle but stylish! And they&#39;re available in two different colours! Key details include; round toe, subtle shimmering all-over material, bow design detail on the toe, one half of bow embellished with bronze, silver and purple beads, and rubber sole with grip.', '2023-12-08 11:41:13', '2023-12-08 11:41:13'),
(865, 'Embellished Flats with Ankle Strap', 'ST-1-B9757-Black-UK 3 - EU 36', 0, 0, 'Embellished Flats with Ankle Strap. Be comfortable AND stylish at once with these beautiful flat shoes, available in a choice of two colours! Key details include; pointed toe, flat sole, an adjustable ankle strap, and silver and gold studded embellishment over the entire material.', '2023-12-08 11:41:16', '2023-12-08 11:41:16'),
(866, 'Faux Leather Ballet Pump with Sequin Toe', 'ST-1-LX053-Black-UK 3 - EU 36', 4, 1, 'Faux Leather Ballet Pump with Sequin Toe. Check out these brand new flat pumps! A wardrobe essential for every female, and these ones are available in two colours! Key details include; flat rubber soles with non-slip grip, faux leather material, round toe covered with gold sequins, and two faux leather decorative straps laid over the sequins, each with a decorative gold button.', '2023-12-08 11:41:19', '2023-12-08 11:41:19'),
(867, 'Patent Pointy Stiletto with Lace Look and Mesh Detail', 'ST-1/2-J7288-Dark Red-UK 3 - EU 36', 11, 1, 'Patent Pointy Stiletto with Lace Look and Mesh Detail. Points are back! And these ones are extra special... with a stylish triangular mesh panel on the toe, overlaid with thin strips of material in the style of a corset, these stilettos are perfect for partying the night away!', '2023-12-08 11:41:23', '2023-12-08 11:41:23'),
(868, 'Leopard Print Stiletto with Patent Heel', 'ST-2-ES12219-Black-UK 3 - EU 36', 0, 0, 'Leopard Print Stiletto with Patent Heel. Release your inner animal in these leopard print stilettos, now available in three different colours! The leopard print material has a satin feel to it, and the stiletto heel and platform are patent. These shoes have a rounded toe. Dare to be bold this Summer!', '2023-12-08 11:41:29', '2023-12-08 11:41:29'),
(869, '2 Tone Patent Wedges', 'ST-2-ES12243-Rouge-UK 3 - EU 36', 0, 0, '2 Tone Patent Wedges. Treat yourself and make your feet feel sweet in these stylish 2 tone wedges, available in four colours! Key details include: A round toe, patent material on shoe, a wedged heel - half hessian material and half patent material, and a rubber sole with grip.\nPlease be aware that some shoes will be delivered without boxes.', '2023-12-08 11:41:35', '2023-12-08 11:41:35'),
(870, '2 Tone Leopard Print Ballet Shoe', 'ST-2-ES12261AB-Leopard and Beige-UK 3 - EU 36', 0, 0, '2 Tone Leopard Print Ballet Shoe. Ladies, who doesn&#39;t love a bit of animal print? These stylish pumps will liven up any outfit! Key details include; beige patent detail on the toe and heel, a rounded point toe, rubber sole with grip, and a satin-feel leopard print material.', '2023-12-08 11:41:40', '2023-12-08 11:41:40'),
(871, 'Velvet Feel Pointy Heel with Disco Bow', 'ST-2-ES13644BD-Burgundy-UK 3 - EU 36', 5, 1, 'Velvet Feel Pointy Heel with Disco Bow. Get on your dancing shoes! These stylish heels are a lovely burgundy colour, and have a bow detail on the toe made from little gold squares. The whole shoe has a soft velvet feel, and has a pointy toe.', '2023-12-08 11:41:42', '2023-12-08 11:41:42'),
(872, 'Black Rounded Toe Stiletto', 'ST-2-I4324-Black-UK 3 - EU 36', 0, 0, 'Black Rounded Toe Stiletto. Don&#39;t miss out on this stylish pair of stilettos- a timeless classic! Key details include a faux- soft leather material, with a shiny black heel and platform. These are the perfect heels to take you from the office to the bar!', '2023-12-08 11:41:44', '2023-12-08 11:41:44'),
(873, 'Pointy Party Shoe with Diamantes', 'ST-2-I8749-Wine-UK 3 - EU 36', 1, 1, 'Pointy Party Shoe with Diamantes. Stand out from the crowd in these fabulous high heels, available in two colours! The whole shoe, which is a soft velvet material, is adorned with dainty little diamantes- guaranteed to make you sparkle and shine like a star!', '2023-12-08 11:41:46', '2023-12-08 11:41:46'),
(874, 'Pointy Party T- Bar Stiletto with Diamante Detail', 'ST-2-I8804-Red and Black-UK 3 - EU 36', 0, 0, 'Pointy Party T- Bar Stiletto with Diamante Detail. Sparkle like a star in these beautiful high heels, available in three colours! The material of the main body has a velvet feel, and the t-bar joining to the adjustable ankle strap is adorned with dainty little diamantes which continue around the full edge of the heel.', '2023-12-08 11:41:49', '2023-12-08 11:41:49'),
(875, 'Low Court Shoe with Metal Buckle and Heel Plaque', 'ST-3-128-22-Beige-UK 3 - EU 36', 0, 0, 'Low Court Shoe with Metal Buckle and Heel Plaque. Don&#39;t miss out on these brand new court shoes, available in three different colours! Key details include; an on-trend chunky low heel with a metal plaque, panels of PVC-style material on the heel and toe, soft faux leather material for the remaining shoe, and a metal buckle detail on the toe with diamante&#39;s on either side.', '2023-12-08 11:41:54', '2023-12-08 11:41:54'),
(876, 'Quilted Faux Leather Pumps with Bow', 'ST-3-JN-807-Beige-UK 3 - EU 36', 0, 0, 'Quilted Faux Leather Pumps with Bow. Being casual doesn&#39;t mean you have to neglect fashion! These stylish flat pumps are available in not one, not two, but FIVE colours! (That&#39;s one for every day of the working week... just saying!) Key details include; faux leather material, rubber grips on the sole, stitched quilted effect over the main body of shoe, a plain panel of material over the pointed toe, and a cute little bow!', '2023-12-08 11:41:59', '2023-12-08 11:41:59'),
(877, 'Flat Pumps with Half Moon Diamante Detail', 'ST-3-LX052-Khaki-UK 3 - EU 36', 0, 0, 'Flat Pumps with Half Moon Diamante Detail. Make your feet feel special in these cute flats, available in two colours! Key details include; soft faux leather material, flat sole with rubber grip, round toe, cross over design on the toe with a small panel of shiny gold fabric, beautifully finished with a decorative half-moon shaped embellishment that is adorned with diamantes.', '2023-12-08 11:42:05', '2023-12-08 11:42:05'),
(878, 'Patent Slingback Wedges', 'ST-3-SD1244NR-Black-UK 3 - EU 36', 0, 0, 'Patent Slingback Wedges. Summer is fast approaching! Why not treat yourself to these on-trend patent wedges? Key details include... Black patent material for entire shoe, a split wedge heel which is half hessian rope-style material and half black patent material, and a visible stitch around the whole wedge. Also, these shoes have a rubber sole with grip.', '2023-12-08 11:42:09', '2023-12-08 11:42:09'),
(879, 'Shimmering Metallic Pumps', 'ST-3-XF207-Beige-UK 3 - EU 36', 0, 0, 'Shimmering Metallic Pumps. Make your feet the stars of the show with these cute flat pumps, now available in three colours! Key details include; flat rubber soles with slight grip and a glittery material over the whole shoe.', '2023-12-08 11:42:11', '2023-12-08 11:42:11'),
(880, 'Flat Pumps with Diamante Pattern Toe', 'ST-3-XF209-Beige-UK 3 - EU 36', 0, 0, 'Flat Pumps with Diamante Pattern Toe. These flat pumps are stylish yet practical for busy feet, and are available in four different colours! Key details include; a round toe, very subtle all over shimmer on material, a pretty flower design on the toe made from clear diamantes, and a rubber sole with grip.', '2023-12-08 11:42:15', '2023-12-08 11:42:15'),
(881, '&#39;Indian Dream&#39; Chiffon Halterneck Maxi Dress', 'T0-B1-K0001-Orange-M/L - UK (12-14)', 0, 0, '&#39;Indian Dream&#39; Chiffon Halterneck Maxi Dress. Be the belle of the ball in this stylish maxi dress, now available in three colours! The dress is fully lined, and its lightweight chiffon material is perfect for the Summer season. It has denim detail on the bust, which is adorned with bronze beads and studs. The vibrant abstract print on the dress is both feminine and quirky and perfect for any occasion. Other key details include a panel of elasticated fabric on the back for ultimate comfort, and two thin halterneck straps. \nThis item is true to size.', '2023-12-08 11:42:20', '2023-12-08 11:42:20'),
(882, 'Wet Look Leggings with Silver Leopard Print Panels', 'T0-B3-WZ-143-Black-Medium - UK (8-10)', 22, 1, 'Wet Look Leggings with Silver Leopard Print Panels. Release your inner-animal in these funky wet-look leggings! They have on-trend contrasting panels of silver leopard-print on each leg, perfect for those wild nights out with the girls! Other key details include elasticated waistband and stretch material for ultimate comfort. \nThis item is true to size.', '2023-12-08 11:42:23', '2023-12-08 11:42:23'),
(883, 'Vest Maxi Dress with Studded Belt', 'T0-B4-MARIA-Black-M/L - UK (12-14)', 0, 0, 'Vest Maxi Dress with Studded Belt. This soft to touch and stretchy maxi dress is perfect for those days when you want to be comfortable AND stylish, and is available in three different colours! It has a summery all-over floral print, and a racer style back. It comes with a thin studded faux-leather waist belt. Perfect for barbeques, picnics in the park and lazy days on the beach. \nThis item is true to size.', '2023-12-08 11:42:24', '2023-12-08 11:42:24'),
