(894, 'Smart High Waisted Colour Contrast Shorts', 'T1-B2-7754-Orange-M/L - UK (12-14)', 0, 0, 'Smart High Waisted Colour Contrast Shorts. These high waisted block colour shorts are perfect for the Summer season, and they&#39;re available in four different colours! They have a lightweight feel and are lined, and have a hidden zip on the back. These shorts have pockets on each side of the front, which fasten with a gold-coloured zip and are lined with contrasting black fabric and there is a panel of black fabric running down each side. Wear with a cropped top and cut-out wedges for a stylish Summer look!\nThis item is true to size.', '2023-12-08 11:42:46', '2023-12-08 11:42:46'),
