(905, 'Leopard Print Chiffon Shift Dress with Belt', 'T2-A2-LAYLA-Grey-One Size - UK (8-14)', 12, 1, 'Leopard Print Chiffon Shift Dress with Belt. Unleash your inner animal with this stylish shift dress, now available in two colours! It is made from a sheer fabric that will keep you cool in the summer sun! It comes with a patent black belt to emphasise your waist, is sleeveless, and is double lined with the sheer fabric. Would look great with a pair of heels or wedges!\nThis item is true to size.', '2023-12-08 11:43:10', '2023-12-08 11:43:10'),
