(907, 'Monochrome Vertical Striped Leggings', 'T2-A2-WZ-160-11-Black and White-One Size - UK (8-14)', 3, 1, 'Monochrome Vertical Striped Leggings. Leggings are an essential item in every girls wardrobe- why not mix it up with these monochrome stripy ones!? In a soft-stretchy fabric for ultimate comfort, and with a wide waist band- just team with a pair of pumps and a lightweight vest and you&#39;re ready to rock.\nThis item is true to size.', '2023-12-08 11:43:12', '2023-12-08 11:43:12'),
