(1019, 'Plaited Faux Leather Belt with Metal Buckle Detail', 'BO-BLT1-ROSITA', 228, 1, 'Plaited Faux Leather Belt with Metal Buckle Detail. Accessorizing your outfit could not be easier with this simple yet stylish faux leather belt, now available in two colours! The belt has a plaited look and to fasten it around your hips, there is a circular metal buckle that the belt feeds through and folds back on itself where it can be secured with a metal popper.', '2023-12-08 11:46:43', '2023-12-08 11:46:43'),
(1020, 'Skinny Snakeskin Effect Belt', 'BO-BLT3-LF-9053', 111, 1, 'Skinny Snakeskin Effect Belt. \"Sssso Sssstylish\"! Jazz up your outfit with this on-trend, super skinny faux leather belt, available in two different colours! An easy way to introduce a bit of animal print into your wardrobe, this subtle little belt has a snakeskin effect material which is also incorporated into the small metal buckle.', '2023-12-08 11:46:44', '2023-12-08 11:46:44'),
(1021, 'Bohemian Embellished Belt', 'BO-BLT5-A142', 127, 1, 'Bohemian Embellished Belt. The pretty embellishment on this belt is perfect for welcoming the Spring/Summer season, and is available in a choice of two colours! Key features include; a large metal buckle with flower and diamante detail, adjustable size, a row of round metal plaques with an embossed pattern, and two rows of small metal and diamante detail. The belt is available in three sizes.', '2023-12-08 11:46:45', '2023-12-08 11:46:45'),
(1022, 'Knit And Fur Detailed Faux Suede Boots', 'S-11B-SY305', 0, 0, 'Knit And Fur Detailed Faux Suede Boots\nVery gorgeous lace up boots\nFeatures knit detail at the top and fur on the front\nHeel has the wooden look', '2023-12-08 11:46:47', '2023-12-08 11:46:47'),
(1023, 'Faux Suede Mid-Calf Lace Up Boots', 'S-9B-P1202', 0, 0, 'Faux Suede Mid-Calf Lace Up Boots', '2023-12-08 11:46:53', '2023-12-08 11:46:53'),
(1024, 'Patent Platform Court Shoe With Faux Snakeskin Heel', 'SS-11B-12639', 0, 0, 'Patent Platform Court Shoe With Faux Snakeskin Heel. This item is true to size', '2023-12-08 11:46:55', '2023-12-08 11:46:55'),
(1025, 'Cut Out Shoe Boot with Stud and Zip Detail', 'ST-2-I9169', 43, 1, 'Cut Out Shoe Boot with Stud and Zip Detail. Step into the Spring/Summer season in style with these on-trend cut out boots, available in three colours! Key details include; two adjustable straps- one over the bridge of your foot and one around the ankle- which have black buckles on them, a zip on the back of the heel with a circular gold pulley, and a chunky heel with gold and black diamante studs.', '2023-12-08 11:46:57', '2023-12-08 11:46:57'),
(1026, 'Lightweight Jumper With Diamante Decoration - PLUS SIZES AVAILABLE', 'T1-B5-147', 11, 1, 'Long Sleeve Lightweight Jumper With Diamante Decoration. This jumper is true to size \nShoulder pads included', '2023-12-08 11:47:01', '2023-12-08 11:47:01'),
(1027, 'Studded Chiffon Camisole', 'T3-B2-HM1645', 0, 0, 'Studded Chiffon Camisole. This cute little camisole is available in a choice of two colours! It is just perfect for the summer season- the sheer material is lightweight and floaty- allowing you to stay cool and comfortable! It has thin double straps that meet in a racer style at the back, and all along the hem there are small silver studs. There is a small keyhole cut at the back with a clasp fastener. This camisole would look lovely with skinny jeans, leggings or jeggings and a pair of on-trend wedges.\nThis item is true to size.', '2023-12-08 11:47:08', '2023-12-08 11:47:08'),
(1028, 'Soft-Knit Summer Tee with Crochet Detail', 'T3-B3-HM1455', 22, 1, 'Soft-Knit Summer Tee with Crochet Detail. Being casual doesn&#39;t mean you should neglect style- this short sleeved tee is perfect for those days when you just want to relax- and it&#39;s available in three colours! Its material is soft and sheer, and it has a pretty crocheted pattern around the neckline. This top is really versatile and easy to wear- a summer must-have!\nThis item is true to size.', '2023-12-08 11:47:09', '2023-12-08 11:47:09'),
(1029, 'Open Heel Fishnet Tights', '12-A2-1002', 0, 0, 'Open Heel Fishnet Tights. Look fab in these open hell fishnet tights, available in black and brown. Perfect to wear with a dress or tunic!', '2023-12-08 11:47:11', '2023-12-08 11:47:11'),
(1030, 'Mini Flower Handbag', 'B3-B1-8146', 7, 1, 'Mini Flower Handbag. These bag is perfect for completing your evening look. It is available in grey, purple, gold and black and features a flower design with a detachable strap.', '2023-12-08 11:47:12', '2023-12-08 11:47:12'),
(1031, 'Aztec Print Strappy Summer Playsuit', '9-A3-MANDY', 0, 0, 'Aztec Print Strappy Summer Playsuit. Spring has sprung! And the warmer weather means one thing... Playsuits! This one is colourful and bright, guaranteed to make you feel all summery! Its material is soft to touch, it has a scooped round neckline and is a loose fit, perfect for summer fun! This playsuit would look great with sandals, plimsols, flip flops- its so versatile! Just don\'t forget your shades and suncream! \nThis item is true to size.', '2023-12-08 11:47:13', '2023-12-08 11:47:13'),
(1032, 'Silk Look Printed Maxi Dress', '8-B1-005', 22, 1, 'Silk Look Printed Maxi Dress. Look fab this season in this silk look printed maxi dress, available in grey, teal, red, blue and pink. Wear with summer sandals to get the ultimate look!', '2023-12-08 11:47:14', '2023-12-08 11:47:14'),
(1033, 'Strappy Sequin Gypsy Dress', '27-A1-VIOLET', 60, 1, 'Strappy Sequin Gypsy Dress. This dress is perfect for those warmer days, available in black, green and brown. Key details include adjustable straps, sequin decoration with a gypsy style skirt.', '2023-12-08 11:47:15', '2023-12-08 11:47:15'),
(1034, 'Little Black Lace Dress', '13-B5-ELEGANT', 0, 0, 'Little Black Lace Dress. Everyone needs a little black dress and this one is guaranteed to get you some attention. Key details include sequin straps, sequin top detail with lace decoration.', '2023-12-08 11:47:16', '2023-12-08 11:47:16'),
(1035, 'Lace Halterneck Dress', 'R-BOX1-FOX', 0, 0, 'Lace Halterneck Dress. Look a million dollars in this lace halterneck dress with diamante decoration. Wear with strappy sandals to get the ultimate look!', '2023-12-08 11:47:16', '2023-12-08 11:47:16'),
(1036, 'Red Silk Look Boob Tube Evening Dress', '15-A4-ZANETA', 17, 1, 'Red Silk Look Boob Tube Evening Dress. Look a million dollars in this red silk look boob tube evening dress. Key features include a boob tube design, chiffon front detail, decorated with red diamantes.', '2023-12-08 11:47:17', '2023-12-08 11:47:17'),
(1037, 'Red Silk Look Evening Dress', '23-A2-AGNEZKA', 0, 0, 'Red Silk Look Evening Dress. Look a million dollars in this red silk look evening dress. Key features include a chiffon front detail, decorated with silver diamantes.', '2023-12-08 11:47:18', '2023-12-08 11:47:18'),
(1038, 'Faux Leather And Lace Evening Dress', '14-B2-9505', 0, 0, 'Faux Leather And Lace Evening Dress. Turn some heads in this gorgeous leather and lace evening dress, available in black and khaki. Key details include a sleeveless design with faux leather and lace detail, completed with a zip at the side.', '2023-12-08 11:47:19', '2023-12-08 11:47:19'),
(1039, 'Blue Jeggings', '12-A4-LM940', 0, 0, 'Blue Jeggings. These legs are perfect for a causal everyday look. Key features include an elasticated waist, completed with two back pockets.', '2023-12-08 11:47:20', '2023-12-08 11:47:20'),
(1040, 'Black Silk Look Leggings', '13-A4-LM5332-70', 0, 0, 'Black Silk Look Leggings. These black silk look leggings with wet look panels are perfect for an evening and casual look. These leggings are available in one size and have an elasticated waist.', '2023-12-08 11:47:21', '2023-12-08 11:47:21'),
(1041, 'Black Sparkly Chiffon Strappy Top', '6-B3-NIRVANA', 0, 0, 'Sparkly Chiffon Strappy Top.  Look sexy in this black sparkly chiffon strappy top. Wear with skinny jeans and heels to complete your look!', '2023-12-08 11:47:21', '2023-12-08 11:47:21'),
(1042, 'Layered Chiffon Beaded Top', '7-A4-A2415', 22, 1, 'Layered Chiffon Beaded Top. Look sexy in these black layered chiffon beaded top. Key features include a layered chiffon design, adjustable straps, completed with black beaded decoration.', '2023-12-08 11:47:22', '2023-12-08 11:47:22'),
(1043, 'Lightweight Wine Stripy Jumper', '27-A1-BAXO', 27, 1, 'Lightweight Wine Stripy Jumper. Perfect for those warmer days and colder days. This jumper is a must have! Key features include long sleeves, a striped design with a zip detail back.', '2023-12-08 11:47:23', '2023-12-08 11:47:23'),
(1044, 'Red Rose Playsuit', '27-B1-CHIKA', 0, 0, 'Red Rose Playsuit. Look pretty this season in this red rose playsuit. Key features include long sleeves with a red rose print.  Please note that the shorts on this playsuit come up one size shorter.', '2023-12-08 11:47:24', '2023-12-08 11:47:24'),
(1045, 'Vintage Blue Bodycon Dress', '20-A3-CARMEN', 11, 1, 'Vintage Blue Bodycon Dress. Look fab in this blue and white vintage print bodycon dress. Wear with heels for an evening look and dress down with sandals for the ultimate day to day look!', '2023-12-08 11:47:25', '2023-12-08 11:47:25'),
(1046, 'Blue Skinny Jeans', '14-B1-P483735', 7, 1, 'Blue Skinny Jeans. Add these must have jeans to your wardrobe this season. Key details include a skinny design with double button detail.', '2023-12-08 11:47:26', '2023-12-08 11:47:26'),
(1047, 'Black Bodycon Dress With Lace Sleeves', '8-B4-ROSA', 4, 1, 'Black Bodycon Dress With Lace Sleeves. Everybody needs a little black dress and this is the perfect one for you! The lace sleeves adds the perfect finishing touch to this gorgeous number!', '2023-12-08 11:47:27', '2023-12-08 11:47:27'),
(1048, 'Layered Sparkly Scarf', 'BO-D2-CC601', 0, 0, 'Layered Sparkly Scarf. Wrap up for those colder days with this layered sparkly scarf, available in beige, wine and grey.', '2023-12-08 11:47:28', '2023-12-08 11:47:28'),
(1049, 'Contrast Panel Bodycon Dress', '28-A3-CHLOE', 17, 1, 'Contrast Panel Bodycon Dress. This is a must have this season! If you want to turn some heads and dress to impress then this is the dress for you! Available in white/lime green and white/coral, this dress features adjustable straps with a bodycon fit. Don\'t miss out ladies on this gorgeous number!', '2023-12-08 11:47:29', '2023-12-08 11:47:29'),
(1050, 'Black Lace Skater Dress', '6-B1-DIJA', 0, 0, 'Black Lace Skater Dress. Look pretty this season in this black lace skater dress. Key details include a skater design, 3/4 length sleeves, completed with a black belt.', '2023-12-08 11:47:30', '2023-12-08 11:47:30'),
(1051, 'Yellow Summer Trousers', '13-A2-CHI', 11, 1, 'Yellow Summer Trousers. Get ready for summer in these yellow trousers. Wear with sandals and a casual shirt to complete your look!', '2023-12-08 11:47:31', '2023-12-08 11:47:31'),
(1052, 'Flower Buckle Handbag', 'B2-A2-076', 0, 0, 'Flower Buckle Handbag. Get the look with this flower buckle handbag, available in white and black. Key details include double faux leather straps, removable adjustable shoulder strap, completed with flower and buckle front detail.', '2023-12-08 11:47:31', '2023-12-08 11:47:31'),
(1053, 'Basic Black Shopper Bag', 'B3-B2-705', 0, 0, 'Basic Black Shopper Bag. Complete your outfit with this basic black faux leather shopper bag. This bag features a large spacious inside, numerous compartments to keep all your valuables and a removable purse to add the perfect finishing touch!', '2023-12-08 11:47:32', '2023-12-08 11:47:32'),
(1054, 'Diamante Bow Faux Leather Handbag', 'B3-A1-010', 0, 0, 'Diamante Bow Faux Leather Handbag. Sparkle your way through this season with this diamante box faux leather black handbag. Key details include faux leather double straps, removable shoulder straps, completed with a faux leather bow with diamante decoration.', '2023-12-08 11:47:33', '2023-12-08 11:47:33'),
(1055, 'Black Diamante Beaded Handbag', 'B3-B3-830', 0, 0, 'Black Diamante Beaded Handbag. Complete your look with this gorgeous black diamante beaded handbag. Key details include faux leather double straps, detachable shoulder strap, numerous compartments, completed with diamante and beaded decoration.', '2023-12-08 11:47:34', '2023-12-08 11:47:34'),
(1056, 'Butterfly Print Structured Satchel', 'B1-B3-80019-1', 0, 0, 'Butterfly Print Structured Satchel. Fly away this season with this butterfly print structured satchel, available in black, dark blue and grey. With its various compartments, it will keep your belongings well organised in style! It has a long shoulder strap which can be worn across your body or on the shoulder. Take your pick!', '2023-12-08 11:47:34', '2023-12-08 11:47:34'),
(1057, 'Faux Fur Satchel', 'B3-A2-375', 0, 0, 'Faux Fur Satchel. Looking for a smart bag with an edge? Here it is ladies! This faux fur satchel is a must have this season! It has a structured design, detachable shoulder strap, faux leather and faux fur detail with magnetic fasteners! It even comes in three gorgeous colours! Don\'t miss out!', '2023-12-08 11:47:35', '2023-12-08 11:47:35'),
(1058, 'Faux Leather Handbag With Metal Buckle', 'B2-B3-431', 0, 0, 'Faux Leather Handbag With Metal Buckle. Key details include a faux leather finish, silver metal buckle, adjustable shoulder strap, completed with compartments to keep all your valuables!', '2023-12-08 11:47:36', '2023-12-08 11:47:36'),
(1059, 'Faux Leather Handbag With Circle Buckle', 'B3-B4-458', 0, 0, 'Faux Leather Handbag With Circle Buckle. Don\'t miss out on this gorgeous handbag, available in pink and black. Key features include faux leather double straps, detachable shoulder strap, front pouch, numerous compartments, completed with a silver buckle decoration.', '2023-12-08 11:47:37', '2023-12-08 11:47:37'),
(1060, 'Faux Fur And Faux Leather Satchel', 'B2-A3-376', 0, 0, 'Faux Fur And Faux Leather Satchel. This faux fur satchel is a must have this season! Key features include a faux leather single handle, detachable shoulder strap completed with faux fur detail.', '2023-12-08 11:47:38', '2023-12-08 11:47:38'),
(1061, 'Peach Peep Toe Bow Heels', 'S-3-0287', 0, 0, 'Peach Peep Toe Bow Heels. If you are looking for the perfect pair of evening shoes then you have come to the right place! These peach peep toe bow heels are a must have this season! Key features include a sling back, peep toe design, decorated with a bow.', '2023-12-08 11:47:38', '2023-12-08 11:47:38'),
(1062, 'Strappy Denim Wedges', 'S-1-10574', 0, 0, 'Strappy Denim Wedges. Add these strappy denim wedges to your summer wardrobe! Key details include a hessian wedge with a faded black denim material. With their height and comfort, these shoes tick all the right boxes!', '2023-12-08 11:47:39', '2023-12-08 11:47:39'),
(1063, 'Long Sleeve Floral Playsuit', '21-B3-MOYA', 0, 0, 'Long Sleeve Floral Playsuit. Look pretty this season in this long sleeve floral playsuit. Key details include a long sleeve design with floral print. Wear with sandals to complete your look!', '2023-12-08 11:47:40', '2023-12-08 11:47:40'),
(1064, 'Black Floral Midi Kaftan', '14-A2-XIMENA', 25, 1, 'Black Floral Midi Kaftan. Look stylish and fashionable on the beach in this black floral midi kaftan. Key details include a midi length, 3/4 length sleeves with a floral design.', '2023-12-08 11:47:41', '2023-12-08 11:47:41'),
(1065, 'Wet Look Skater Skirt', 'ISKM235', 0, 0, 'Wet Look Skater Skirt. Stand out from the crowd in this wet look skater skirt, available in burgundy and bronze. Key features include a skater design with a zip up back. Perfect for a night out with the girls!', '2023-12-08 11:47:41', '2023-12-08 11:47:41'),
(1066, 'White Diamante Cross Top', '10-A2-DENY', 0, 0, 'White Diamante Cross Top. Look chic in these long white diamante cross top. Key details include a loose fit, subtle dip hem design, decorated with a black diamante cross.', '2023-12-08 11:47:43', '2023-12-08 11:47:43'),
(1067, 'Soft Purple Detailed Jeans', '28-A1-HUDA', 0, 0, 'Soft Purple Detailed Jeans. Turn heads in these statement-making jeans! They have a bold purple pattern, a zip and button fastener and a slight stretch in the fabric for ultimate comfort! Want to be a little bit different and stand out from the crowd? Well these jeans are perfect for you!', '2023-12-08 11:47:44', '2023-12-08 11:47:44'),
(1068, 'Sky Blue Summer Dress', '4-B2-TIFFANY', 0, 0, 'Sky Blue Summer Dress. Look pretty in this sky blue summer dress. Key features include loose capped sleeves, skater design, a round neck with detailed print. Perfect for those warmer days!', '2023-12-08 11:47:44', '2023-12-08 11:47:44'),
(1069, 'Ice Blue Denim Shirt', '5-B4-JILL', 0, 0, 'Ice Blue Denim Shirt. This shirt can be dressed up or down therefore you on\'t want to miss out on this must have! Key details include capped sleeves, two small front pockets, popper front fasteners, completed with a tie to add the perfect finishing touch!', '2023-12-08 11:47:45', '2023-12-08 11:47:45'),
(1070, 'Summer Floral Jeans', '4-A2-HONEY', 7, 1, 'Summer Floral Jeans. Stand out from the crowd in these summer floral jeans. Key details include two front and back pockets, button and zipped fastener, completed with a floral pattern. Perfect for the ultimate festival look!', '2023-12-08 11:47:46', '2023-12-08 11:47:46'),
(1071, 'Animal Print Jeans', '7-B2-CHANEL', 37, 1, 'Animal Print Jeans. Go wild this season in these animal print jeans, available in a blue leopard print and mint snake. Key features include a bold pattern, two front and back pockets with a zip and button fastener. Don\'t miss out ladies!', '2023-12-08 11:47:47', '2023-12-08 11:47:47'),
(1072, 'Floral Print Jeans', '14-B3-LUCKY', 0, 0, 'Floral Print Jeans. Look pretty in florals this season in these gorgeous jeans, available in grey and coral. Perfect for those warmer days to wear with a crop top! Key features include two front and back pockets with a button and zip fastener.', '2023-12-08 11:47:48', '2023-12-08 11:47:48'),
(1073, 'Wet Look Black Skorts', '4-A5-MARSHA', 5, 1, 'Wet Look Black Skorts. These skorts are so versatile! Simply pair with a crop top and some wedges for the ultimate summer look and wear with a jumper for those colder days! These chic shorts have an elasticated waist with a shiny finish.', '2023-12-08 11:47:49', '2023-12-08 11:47:49'),
(1074, 'Cropped Chiffon Shirt', '8-A3-ITPM4738', 0, 0, 'Cropped Chiffon Shirt. Show some skin in this cropped chiffon shirt. Key features include a cropped design, chiffon material, 3/4 length sleeves with a patterned design. Wear with high waisted jeans to complete your look!', '2023-12-08 11:47:50', '2023-12-08 11:47:50'),
(1075, 'Paisley Print Dress', '10-A4-8022', 0, 0, 'Paisley Print Dress. Look cool and casual in this paisley print dress, available in white, navy and black. Key features include a round neck, long sleeves, elasticated waist with a paisley print pattern.', '2023-12-08 11:47:51', '2023-12-08 11:47:51'),
(1076, 'Chiffon Tribal Print Maxi Dress', '17-B4-618', 24, 1, 'Chiffon Tribal Print Maxi Dress. Stand out from the crowd this season in this chiffon tribal print maxi dress, available in purple, orange, teal and brown. Key details include a sleeveless design, elasticated waist, tribal print, completed with two front ties. Perfect for summer!', '2023-12-08 11:47:52', '2023-12-08 11:47:52'),
(1077, 'Cropped Chiffon Diamond Print Shirt', '18-A3-M4738', 14, 1, 'Cropped Chiffon Diamond Print Shirt. Key features include a cropped design, chiffon material, 3/4 length sleeves with a diamond cross design. Wear with high waisted jeans to complete your look!', '2023-12-08 11:47:53', '2023-12-08 11:47:53'),
(1078, 'Layered Top With Gold Detail', '7-A5-RAE', 0, 0, 'Layered Top With Gold Detail. Stand out from the crowd in this layered top with gold detail, available in black and white. Key details include a round neck, layered design, completed with gold beaded decoration.', '2023-12-08 11:47:54', '2023-12-08 11:47:54'),
(1079, 'T.Shirt With Diamante Decoration', '3-A4-9695', 0, 0, 'T.Shirt With Diamante Decoration. Add this essential item to your wardrobe this season, available in black, white and beige. Key features include short sleeves, a round neck, capped sleeves, completed with diamante decoration.', '2023-12-08 11:47:55', '2023-12-08 11:47:55'),
(1080, 'Detailed Round Neck Jumper', '19-B3-10784', 0, 0, 'Detailed Round Neck Jumper. Wrap up for those warmer days in style with this detailed round neck jumper, available in black and white. Key details include a round neck, long sleeves, completed with a cut out front with beaded decoration.', '2023-12-08 11:47:56', '2023-12-08 11:47:56'),
(1081, 'Textured Short Sleeve Top', '8-A5-10700', 26, 1, 'Textured Short Sleeve Top. Look cool and casual in these textured short sleeve top, available in black and white. Key features include short sleeves, a round neck with front design.', '2023-12-08 11:47:57', '2023-12-08 11:47:57'),
(1082, 'Cut Out Bow Chiffon Top', '10-B3-ITPM4606', 0, 0, 'Cut Out Bow Chiffon Top. Look pretty in this cut out bow chiffon top, available in white and black. This sheer top includes capped sleeve and cut out back with bow detail.', '2023-12-08 11:47:58', '2023-12-08 11:47:58');
INSERT INTO `products` (`id`, `name`, `sku`, `quantity`, `is_in_stock`, `description`, `created_at`, `updated_at`) VALUES
(1083, 'Silver Print Pink Trousers', '24-B2-COCO', 0, 0, 'Silver Print Pink Trousers. Look gorgeous and trendy in pink without being too chalky and sickly sweet. Super soft, skinny and lightweight trousers with all over print are perfect for a sunny summer\'s day. They have open pockets on the rear and on each side at the front, and have a small zip-fly with a metal button fastener. These trousers would look great with a cute white or grey top and wedge sandals or decorative flats.', '2023-12-08 11:47:59', '2023-12-08 11:47:59'),
(1084, 'Colourful Front Harem Trousers', '2-B1-9697', 0, 0, 'Colourful Front Harem Trousers. Create your outstanding summer look with lightweight colourful harem trousers! The main details include a gold chain detail and two front pockets. The elasticated waistband makes them perfect for any silhouette and in combination with minimal top or vest and light sandal will become an essential garment on your summer holidays!', '2023-12-08 11:48:00', '2023-12-08 11:48:00'),
(1085, 'Leopard Print Skinny Trousers', '24-B1-065', 0, 0, 'Leopard Print Skinny Trousers. This pattern is one of those fashion trends that never really goes away! Made of stretch fabrics, these trousers will perfectly hug your figure and in combination with plain colours, configurable accessories and high heels will make you look  fabulous and eye-catching. The key details include two front and back pockets, long length completed with a button fastener.', '2023-12-08 11:48:00', '2023-12-08 11:48:00'),
(1086, 'Elasticated Waist Black Harem Trousers', '7-A1-X9653', 0, 0, 'Elasticated Waist Black Harem Trousers. Looking for something feminine and sexy, but in the meantime super comfy? Then these harem trousers are a perfect deal for you! They\'re configurable, they\'re cool, practical enough for being outside all day long and can be easily translated to night outfit just by adding some accessories and heels. The key details include elasticated waistband and two side angled pockets.', '2023-12-08 11:48:01', '2023-12-08 11:48:01'),
(1087, 'Striped Sleeveless Bodycon Dress', '28-B2-13411', 1, 1, 'Striped Sleeveless Bodycon Dress. Don\'t miss the chance to highlight your shape with this configurable but stylish striped bodycon dress! Stretch thick fabric makes this dress fit  perfectly, so there is no necessity to slim up your figure with the shapewear. The main details include dark metal zip in the centre of the back. This dress works ideally with tights and ankle boots for an alternative approach to everyday casual wear.', '2023-12-08 11:48:02', '2023-12-08 11:48:02'),
(1088, 'Velvet Print Trousers', '28-B3-JO', 3, 1, 'Velvet Print Trousers. Are you a trousers-lover, but would like to make your look more gorgeous? These velvet print trousers will be an ideal addition to your wardrobe! These trousers will make you feel cozy and trendy and the soft fabric print will add a bit of opulence to your outfit. They are best styled with a configurable classic top, blazer and heels to become perfect choice for the evening events.', '2023-12-08 11:48:03', '2023-12-08 11:48:03'),
(1089, 'Dark Brown Skinny Stretchy Jeggings with Zip Detail', '17-A1-8816', 0, 0, 'Dark Brown Skinny Stretchy Jeggings with Zip Detail. Made to look like jeans-skin tight, jeggings allow you not just look beautiful, but feel it! They are always trendy and be the perfect counterpart to any top, jumper or blazer. To complete your summer look you can choose some nice flats or a pair of open toed shoes. The key features include elasticated waistband and two zip false pockets.', '2023-12-08 11:48:04', '2023-12-08 11:48:04'),
(1090, 'Smart Chinos With Belt Detail', '20-B1-07677', 21, 1, 'Smart Chinos With Belt Detail. Although the chinos model is quite configurable, they are an essential fashion item in any women\'s summer wardrobe! These cute trousers are made from lightweight fabric and the main features include bright colour belt and two false back pockets. For the formal style, you can mix chinos with light top or blouse and high heels and for the weekend outfit heels can be replaced to pumps.', '2023-12-08 11:48:04', '2023-12-08 11:48:04'),
