(1149, 'White Belted Skater Dress', 'T3-A1-MIMI', 0, 0, 'White Belted Skater Dress. Get ready for summer in this white belted skater dress. Key features include a sleeveless design, textured pattern with a brown belt to add the perfect finishing touch! Pair with sandals for the ultimate look!', '2023-12-08 11:48:57', '2023-12-08 11:48:57'),
(1150, 'Nude Floral Collared Dress', '3-B4-IRENA', 0, 0, 'Nude Floral Collared Dress. Enjoy the summer with this nude floral collared dress, perfect for any occasion! For a casual outfit, simply add a pair of sandals and for an evening look, pair with some heels! Key features include a black collar, a floral print design with a side zip.', '2023-12-08 11:48:58', '2023-12-08 11:48:58'),
(1151, 'Lace Leopard Print Top', '2-A2-OONAGH', 32, 1, 'Lace Leopard Print Top. Go wild in this leopard print top with black lace. Key features include a loose fit, round neck, leopard print design completed with black lace. This top works beautifully with plain leggings and casual flats and for evening event just add a pair of high heels and neutral accessories.', '2023-12-08 11:48:59', '2023-12-08 11:48:59'),
(1152, 'Patterned Ruffle Chiffon Dress', '7-A3-MEG', 0, 0, 'Patterned Ruffle Chiffon Dress. Looking for something to fill your summer wardrobe? Well ladies, you have come to the right place. This dress is absolutely stunning! With its sleeveless and layered design, this dress is sure to turn some heads! It has a detailed floral pattern with a zip down the side. Don\'t miss out on this gorgeous number!', '2023-12-08 11:49:00', '2023-12-08 11:49:00'),
(1153, 'Blue Cropped Jeans', '28-B1-AYA', 0, 0, 'Blue Cropped Jeans. Make a style statement in these blue cropped jeans. You can\'t have enough blue jeans this season so why not add this gorgeous pair to your collection? Key features include a cropped design with a zip and button fastener.', '2023-12-08 11:49:01', '2023-12-08 11:49:01'),
(1154, 'Faded Black Stripy Blazer', '7-B1-PAULA', 10, 1, 'Faded Black Stripy Blazer. Look chic at work in this faded black stripy blazer. Key features include a one button design, long sleeves with a stripy print. Perfect for an office look! Wear with skinny jeans and a blouse to add the perfect finishing touches!', '2023-12-08 11:49:02', '2023-12-08 11:49:02'),
(1155, 'Polka Dot Midi Length Culotte Shorts', '7-A2-LUNA', 0, 0, 'Polka Dot Midi Length Culotte Shorts. Enjoy hot summer days with these lovely and eye catching culotte shorts!!! They are super comfy, however ideally fits for summer urban outfit! These shorts have elasticated waistband  and delicate gathers on the front. To create dramatic and chic look just add a pair of pointy heels and plain chiffon blouse.', '2023-12-08 11:49:02', '2023-12-08 11:49:02'),
(1156, '3/4 Sleeve Camel Chiffon Midi Dress', '13-A1-RAY', 0, 0, '3/4 Sleeve Camel Chiffon Midi Dress. Create a gorgeous look with stunning super feminine chiffon midi dress! Lightweight material and classic design makes this dress perfect for professional look, however by mixing this dress with sparkly jewelry and high heel shoes you will look fabulous at any evening event! the key features include two gathers on the neckline, elasticated waistband, completed with a delicate black belt.', '2023-12-08 11:49:03', '2023-12-08 11:49:03'),
(1157, 'Sleeveles Orange Leopard Print Dress', '6-A1-AIDA', 13, 1, 'Sleeveles Orange Leopard Print Dress. Grab this eye-catching leopard dress now and be sure you is right on the hottest trend! This dress is extremely glamorous, but at the same time elasticated material makes it easy to wear. Close-fitting top and skater skirt, completed with delicate v-neckline adds more charm to your chic look.', '2023-12-08 11:49:04', '2023-12-08 11:49:04'),
(1158, 'Leopard Chiffon Blouse With Bow Detail', '3-B2-KIKI', 0, 0, 'Leopard Chiffon Blouse With Bow Detail . Max out your style with this attractive leopard chiffon blouse! Made from cheer fabric it becomes perfect for any summer outfit! This blouse works beautifully with plain black skinny trousers or pencil skirt, however mixed with sparkly jewelry and ankle strap stilettos you will look stunning at any evening event as well. Key features include lightweight material, bow detail on the front and and lovely frill sleeves.', '2023-12-08 11:49:05', '2023-12-08 11:49:05'),
(1159, 'Multi Colour Shift Tunic', 'R-BOX3-TIA', 0, 0, 'Multi Colour Shift Tunic. This lovely colorful print shift tunic is configurable, but elegant and ideal for hot summer days! Warm patterns combined with straight cut design makes this tunic excellent for barbecues or picnics in the park! This tunic can be beautifully mixed with flat strappy sandals or pumps, large shopper bag and cat eye sunglasses.', '2023-12-08 11:49:06', '2023-12-08 11:49:06'),
(1160, 'Strappy Skater Dress', '25-A1-SUE', 0, 0, 'Strappy Skater Dress. Look outstanding with this fashionable strappy skater dress! Fully elasticated material will hug your body around the waist and loose skater skirt will make you feel free to move. So this skater dress is absolutely ideal for any body shape and will highlight your silhouette gently. Key features include stretch fabric and adjustable elasticated straps.', '2023-12-08 11:49:06', '2023-12-08 11:49:06'),
(1161, 'Shiny Elasticated Waist Belt', 'BO-4-1181', 162, 1, 'Shiny Elasticated Waist Belt. Look smart at any occasion with this outstanding shiny waist belt! It will be a great supplement to your evening outfit and shiny beading will add extra glam to look! Key features include elasticated fabric, shinny beading design and metal fastener.', '2023-12-08 11:49:07', '2023-12-08 11:49:07'),
(1162, 'Oval Buckle Belt With Metal Detail', 'BO-A5-LF-9092', 85, 1, 'Oval Buckle Belt With Metal Detail. This trendy oval buckle belt will be a perfect addition to you summer wardrobe! Designed in sweet pink and gentle nude colours, this belt will fit beautifully with any summer dress! Key features include faux leather fabric, metal flexible decorations and oval buckle with small diamonds.', '2023-12-08 11:49:08', '2023-12-08 11:49:08'),
(1163, 'Plaited Belt With Metal Buckle', 'BO-2-LF-9087', 94, 1, 'Plaited Belt With Metal Buckle. This lovely plaited belt is essential in every woman\'s summer wardrobe! It is available in three trendy colours: white, beige and black. It can be easily matched with gladiator\'s sandals or configurable flats and will be a subtle addition to any summer outfit! Key features include plaited design and metal buckle.', '2023-12-08 11:49:09', '2023-12-08 11:49:09'),
(1164, 'Sheer Shirt With Frill Detail', '8-A5-138', 0, 0, 'Sheer Shirt With Frill Detail. Feel smart and fresh during warmer months with this elegant sheer shirt! This stylish shirt is designed from lightweight fabric which makes it perfect for summer social events and parties. Key features include cute lace and frill decoration on the front, flounced sleeves, frill hem, completed with an elasticated waistband to highlight your silhouette gently. It works beautifully with classic straight trousers or configurable pencil skirt, just don\'t forget a pair of pointed court shoes to create the ultimate chic look.', '2023-12-08 11:49:10', '2023-12-08 11:49:10'),
(1165, 'White Lace Shorts', '10-A3-1302', 0, 0, 'White Lace Shorts. Grab this amazing white lace shorts to give yourself an extremely sexy and at the same time a delicate look! These shorts are the best choice for warm weather, as white colour and lace fabric go hand in hand, you will feel extremely trendy at any occasion. Key features include lightweight lace material and elasticated waistband.', '2023-12-08 11:49:11', '2023-12-08 11:49:11'),
(1166, 'Pink Cat Print Dress', '4-A2-J3020', 0, 0, 'Pink Cat Print Dress. You will definitely love this this cute pink cat print dress! This lovely dress is perfect for walks in the park or barbecue party! This dress is elegant and still lets you move freely, just add a pair of configurable flat shoes and some neutral accessories. Key feature include black Peter Pan collar, sleeveless design, small zip fastener on the side, chiffon under layer and outstanding kitty cat print.', '2023-12-08 11:49:12', '2023-12-08 11:49:12'),
(1167, 'Snake Print Skinny Trousers', '2-A3-MC086', 0, 0, 'Snake Print Skinny Trousers. Create funky and trendy look with this stunning snake print skinny trousers! They are perfect addition to your festival or social event outfit! For elegant and sophisticated look, just combine these trousers with neutral sweater or top and ankle boots! Key features include two front pocket, two back pockets, a metal buckle and zip fastening.', '2023-12-08 11:49:13', '2023-12-08 11:49:13'),
(1168, 'Chiffon Striped Wide Leg Trousers', '12-A5-3046', 0, 0, 'Chiffon Striped Wide Leg Trousers. Stand out from the crowd with these elegant chiffon wide leg trousers! They are a great deal for city chic summer look! Lightweight fabric makes your feel fresh during warmer season and vertical striped print will elongate your silhouette! Key features include two front pockets and zip fastener with button buckle on the side.', '2023-12-08 11:49:13', '2023-12-08 11:49:13'),
(1169, 'Pink Long Sleeve Blouse', '3-A3-UMA', 0, 0, 'Pink Long Sleeve Blouse. Get ultra-feminine look with this stunning pink blouse! Want to stand out from the crowd, but still to look elegant? Then this blouse is perfect for you. Straight cut design makes this piece suitable for the professional outfit, just mix it with calm pastel colours and neutral footwear. For the night out look, this blouse works great with skinny black trousers, peep toe high heels and sparkly accessories.', '2023-12-08 11:49:14', '2023-12-08 11:49:14'),
(1170, 'Beige Tie Front Top', '27-A3-BONITA', 0, 0, 'Beige Tie Front Top. Work your look with this cute beige tie front top! It is so lightweight and airy that you can feel comfy even in a warmer weather! Vintage car print adds classic and at the same time individual touch to your casual outfit! Key features include golden bottons and sleeveless design, finished with tie on the front.', '2023-12-08 11:49:15', '2023-12-08 11:49:15'),
(1171, 'Dip Hem Blouse with Chest Pockets', '15-A3-ALEISHA', 0, 0, 'Dip Hem Blouse with Chest Pockets. Feel especially comfortable with this dip hem blouse! Made from soft airy material this blouse is perfect for summer holiday outfit! It works beautifully with cut off shorts and neutral sandals, finished with cute satchel bag. Key features include small white bottons on the front and two zip detail pockets on the chest.', '2023-12-08 11:49:16', '2023-12-08 11:49:16'),
(1172, 'Leopard Print Crop Top', '3-A3-KARA', 0, 0, 'Leopard Print Crop Top. Refresh your wardrobe with this attractive leopard print crop top! You cannot refuse to add this top into your look, as it is especially trendy this season. The monochrome leopard print gives a glam touch and stretchy material highlights your shapes. To complete the ultimate look, mix this top with bodycon skirt or high-waisted shorts, combined with neutral black wedge sandals.', '2023-12-08 11:49:17', '2023-12-08 11:49:17'),
(1173, 'Aztec Print Dress with Cut Out Back', '8-A2-TONIA', 0, 0, 'Aztec Print Dress with Cut Out Back. You will be feeling lovey in this aztec print dress! This dress has configurable design, however the cut out back detail makes it glam and attractive. This dress will look beautifully with pastel pointy shoes and plain envelope clutch bag. Key features include elasticated material, round neckline and cut out detail on the back.', '2023-12-08 11:49:18', '2023-12-08 11:49:18'),
(1174, 'Strappy Slip Dress', '19-B4-SUZIE', 28, 1, 'Strappy Slip Dress. Look pretty this summer in this gorgeous strappy slip dress! This dress is perfect for any time of the day outfit! Available in fabulous black and sweet pink colours, this dress will make you feel glamour and stylish at any occasion! Key features include elasticated straps and stretchy fabric.', '2023-12-08 11:49:18', '2023-12-08 11:49:18'),
(1175, 'Strappy V-neckline Playsuit', 'R-BOX3-NISHKA', 0, 0, 'Strappy V-neckline Playsuit. Feel relaxed in this lovey V-neckline playsuit! Made from elasticated fabrics, this playsuit will allow to move freely, however still look trendy and elegant! Combined with ankle strap wedge sandals and envelope clutch you will stand out from the crowd at any evening event. For casual look, just mix this playsuit with plain black pointy flats and large shopper bag. Key features include stretchy material, adjustable straps and elasticated waistband.', '2023-12-08 11:49:19', '2023-12-08 11:49:19'),
(1176, 'Black Strappy Vest Top', '10-A3-MEA', 0, 0, 'Black Strappy Vest Top. No summer wardrobe is complete without a cute black strappy vest top! It is easy to wear and can be matched with anything! This simply elegant top is decorated with golden chain straps, what adds more subtle to you casual look!', '2023-12-08 11:49:20', '2023-12-08 11:49:20'),
(1177, 'Black Mesh Insert Skater Dress', 'R-BOX2-KAYA', 0, 0, 'Black Mesh Insert Skater Dress. Enjoy your night out in this fabulous black mesh insert skate dress! This dress will add a gentle charm to your evening outfit! For ultimate look combine it with peep toe high heels, glitter clutch and sparkly accessories. Key features include elasticated little bit shinny fabric, mesh long sleeves, mesh neckline and \nmesh insert on the back.', '2023-12-08 11:49:21', '2023-12-08 11:49:21'),
(1178, 'Checked Skater Dress', '26-B3-JUDITH', 0, 0, 'Checked Skater Dress. You will love this cute checked skater dress! This dress is best deal for picnics in the park or weekend barbecue. Vintage design gives a classic touch to your casual outfit and bold checked print will keep you on trend this season! Key features include pointed flat collar, elasticated material and small belt detail.', '2023-12-08 11:49:22', '2023-12-08 11:49:22'),
(1179, 'Lace Up Plimsolls', 'S-4-YS003A', 0, 0, 'Lace Up Plimsolls. Get the ultimate look in these lace up plimsolls, avaialble in black, pink, sky blue and dark blue. These shoes would look perfect with a pair of skinny jeans or a summer dress! Don\'t miss out ladies so grab your pair now!', '2023-12-08 11:49:22', '2023-12-08 11:49:22'),
(1180, 'Studded Faux Leather Belt', 'BO-A2-LP-9110', 53, 1, 'Studded Faux Leather Belt. Stand out from the crowd in this studded faux leather belt, available in teal and black. Key features include a studded design. Wear with jeans to get the ultimate biker chic look!', '2023-12-08 11:49:23', '2023-12-08 11:49:23'),
(1181, 'Skinny Faux Leather Skull Belt', 'BO-A3-JM-1043', 83, 1, 'Skinny Faux Leather Skull Belt. Complete your look with this skinny faux leather skull belt, available in black, pink, blue and white. Key features include a faux leather design , completed with a silver skull to add the perfect finish touch! Give every outfit a standout appeal with this belt!', '2023-12-08 11:49:24', '2023-12-08 11:49:24'),
(1182, 'Skinny Faux Leather Chain Belt', 'BO-B5-LF-9106', 211, 1, 'Skinny Faux Leather Chain Belt. Look fab this season in this skinny faux leather chain belt, available in green, blue, white and orange. Key features include a faux leather finish with chain decoration. Don\'t miss out ladies!', '2023-12-08 11:49:25', '2023-12-08 11:49:25'),
(1183, 'Navy Lace Skater Dress', '26-B4-SDQ', 0, 0, 'Navy Lace Skater Dress. Look gorgeous this summer in this navy lace skater dress. Key features include a skater design, elasticated straps, completed with a black lace detail. This dress will make you feel a million dollars so grab one while you still can!', '2023-12-08 11:49:26', '2023-12-08 11:49:26'),
(1184, 'Bodycon Dress With Velvet Detail', '9-B3-3474', 0, 0, 'Bodycon Dress With Velvet Detail. Turn some heads this season in this bodycon dress with velvet detail. Key features include a midi length, sleeveless design with a velvet front detail. This dress is ideal with a night out with the girls. Just be sure to pair it with some killer heels and a sparkling clutch bag to complete your look!', '2023-12-08 11:49:27', '2023-12-08 11:49:27'),
(1185, 'Strappy Tartan Peplum Top', '12-A3-ITPM-5097', 17, 1, 'Strappy Tartan Peplum Top. Stand out from the crowd in this strappy tartan peplum top. Key features include a tartan print  and peplum design. Simply team with a pair of skinny jeans and gladiator sandals to complete your chic look!', '2023-12-08 11:49:28', '2023-12-08 11:49:28'),
(1186, 'Black Lace Bodycon Dress', '7-A4-AISHA', 0, 0, 'Black Lace Bodycon Dress. Everyone needs a little black dress so add this number to your wardrobe. Key features include ling lace sleeves with a bodycon fit. Wear with killer heels and a blazer to complete this outfit. If you are looking to impress a certain someone this season then this is the dress for you!', '2023-12-08 11:49:28', '2023-12-08 11:49:28'),
(1187, 'Mint Palm Tree Summer Playsuit', '2-A4-MONA', 25, 1, 'Mint Palm Tree Summer Playsuit. Add this gorgeous playsuit to your summer collect right away! Key features include a palm tree print, sleeveless design with an elasticated waist. Wear with sandals to complete your girly summer look!', '2023-12-08 11:49:29', '2023-12-08 11:49:29'),
(1188, 'Peach Bodycon Paisley Dress', '8-A4-3535', 0, 0, 'Peach Bodycon Paisley Dress. Turn some heads in this gorgeous peach bodycon dress with paisley print! Key features include a detail paisley design with a padded bust. This dress hugs your body perfectly and accentuates your fabulous shapes!', '2023-12-08 11:49:30', '2023-12-08 11:49:30'),
(1189, 'Casual Belted Skater Dress', 'KAT', 0, 0, 'Casual Belted Skater Dress. Look cool and casual in this belted skater dress, available in coral and green. Key details include a short sleeve design, round neck, competed with a belt. Wear with ballet pumps or hi-tops to get your ultimate casual look.', '2023-12-08 11:49:31', '2023-12-08 11:49:31'),
(1190, 'Printed Cropped Trousers', '8-B3-003629', 25, 1, 'Printed Cropped Trousers. Stand out from the crowd in these printed cropped trousers, available in yellow, grey and blue. Key features include an elasticated waist with two front pockets. Team with the matching printed crop top to complete your look! You don\'t want to miss out on this gorgeous co-ordinate so grab it now while you can!', '2023-12-08 11:49:32', '2023-12-08 11:49:32'),
(1191, 'Printed Crop Top', '10-A2-LIA', 51, 1, 'Printed Crop Top. Stand out from the crowd in this printed crop top, available in yellow, grey and blue. Key features include a cropped design with adjustable straps. Team with printed cropped trousers to complete your look! You don\'t want to miss out on this gorgeous co-ordinate so grab it now while you can!', '2023-12-08 11:49:33', '2023-12-08 11:49:33');
INSERT INTO `products` (`id`, `name`, `sku`, `quantity`, `is_in_stock`, `description`, `created_at`, `updated_at`) VALUES
(1192, 'Pretty Pink Lace Playsuit', '14-A1-3540', 0, 0, 'Pretty Pink Lace Playsuit. Look pretty in this pretty pink lace playsuit. Key features include a ruffle neck, short sleeves with an open back. Want to turn some heads this season? Be sure to grab this gorgeous number before it\'s too late!', '2023-12-08 11:49:34', '2023-12-08 11:49:34'),
(1193, 'Floral Shirt Dress', '18-A3-IDRM3189', 51, 1, 'Floral Shirt Dress. Look pretty this season in this floral shirt dress. This dress is lightweight and perfect for those warmer days! Key features include a floral collared design, capped sleeves, completed with a zip up back.', '2023-12-08 11:49:35', '2023-12-08 11:49:35'),
(1194, 'Aztec Midi Dress', '22-A4-KEIRA', 2, 1, 'Aztec Midi Dress. Look the part in this aztec midi dress. Key features include short sleeves, midi length with an aztec pattern. Wear with gladiator sandals to complete your cool and casual look!', '2023-12-08 11:49:35', '2023-12-08 11:49:35'),
(1195, 'Chiffon Bow Shirt- PLUS SIZES AVAILABLE', '9-A1-AINE', 51, 1, 'Chiffon Bow Shirt. Look the part in the office this season in this chiffon bow shirt, available in white and black. Key features include long sleeves with a front bow design. Simply pair with smart trousers to get the ultimate office look or a pair of skinny jeans for your cool and casual weekend look!', '2023-12-08 11:49:36', '2023-12-08 11:49:36'),
(1196, 'Red Cross Over Detail Dress', '17-A2-FS-1', 0, 0, 'Red Cross Over Detail Dress. Look red hot this season in this bodycon dress with cross over detail. Key features include a sleeveless design, bodycon fit, zip up back, completed with a cross over front design. Don\'t miss out ladies on this must have dress!', '2023-12-08 11:49:37', '2023-12-08 11:49:37'),
(1197, 'Smart Pink Spot Dress', '28-B2-MILDA', 0, 0, 'Smart Pink Spot Dress. Stand out from the crowd in this smart pink spot dress. Key features include short sleeves, a round neck with a detailed pink spot front. This dress is perfect for a sexy office look! Simply pair with pumps or a pair of heels to complete your look!', '2023-12-08 11:49:38', '2023-12-08 11:49:38'),
(1198, 'Green Floral Bodycon Skirt', 'R-BOX1-KYRA', 0, 0, 'Green Floral Bodycon Skirt. Add this must have to your summer wardrobe! This green floral bodycon skirt is absolutely gorgeous! Key features include an elasticated waist with a midi length. Pair with the matching green floral crop top to complete your look! Co-ordinates are in this summer so don\'t miss out!', '2023-12-08 11:49:39', '2023-12-08 11:49:39'),
(1199, 'Floral Layered Summer Dress', '25-B3-003559', 0, 0, 'Floral Layered Summer Dress. Look pretty this summer in this layered summer dress. It is perfect for picnics in the park with your friends! The floral design will keep you on trend this season! Key features include a layered floral design. Don\'t miss out ladies, it comes in two fabulous colours!', '2023-12-08 11:49:40', '2023-12-08 11:49:40'),
(1200, 'Zipped Tracksuit Bottoms', '20-A1-JET', 25, 1, 'Zipped Tracksuit Bottoms. Look cool and casual in these zipped tracksuit bottoms, available in dark grey and grey. Key features include an elasticated waist, zipped sides and front with leather detail. Wear with hi-top trainers to complete your look!', '2023-12-08 11:49:41', '2023-12-08 11:49:41'),
(1201, 'Dot Print Mini Skater Dress', '18-A4-915-2', 50, 1, 'Dot Print Mini Skater Dress. Look cool and girly with this stunning mini skater dress! This dress perfectly works with a pair of plain leggings and neutral flats. The key features include classic design and elasticated material!', '2023-12-08 11:49:42', '2023-12-08 11:49:42'),
(1202, 'Multicolour Sleeveless Playsuit with Belt', '8-A2-9846-3', 0, 0, 'Multicolour Sleeveless Playsuit with Belt. Enjoy warmer weather with this trendy sleeveless playsuit! Made from lightweight material it allows you to stay cool even during hot summer days! It matches ideally with a pair of gladiator sandals and large shopper bag. Key features include elasticated chest and waist, two side pockets completed with delicate belt.', '2023-12-08 11:49:43', '2023-12-08 11:49:43'),
(1203, 'Floral Mini Dress with Frill Sleeves', '16-A4-236FL', 0, 0, 'Floral Mini Dress with Frill Sleeves. Create romantic look with this cute floral mini dress! Vintage floral print, mesh insert in the front and delicate frill sleeves will add a feminine touch to to your casual summer outfit! This dress can be easily mixed with strappy sandals, plain cardigan and small satchel bag. Key features include lightweight fabric and elasticated waistband.', '2023-12-08 11:49:44', '2023-12-08 11:49:44'),
(1204, 'Roman Coin Print Shift Dress', '5-A4-H4', 0, 0, 'Roman Coin Print Shift Dress. Stand out from the crowd with this unique print shift dress! Available in fabolous black and cute pink colours this dress is a must in every trendy lady\'s wardrobe this season! This dress works perfectly with lace-up high heel ankle boots or plain configurable flats. Key features include white pointed flat collar, sleeveless design and small zip at the back.', '2023-12-08 11:49:45', '2023-12-08 11:49:45'),
(1205, 'Floral Print Mini Skater Dress', '26-A3-915-4', 0, 0, 'Floral Print Mini Skater Dress. You will definitely love this sweet mini skater dress! This dress is perfect for social events and picnics in the park! To achieve ultimate girly look this dress can be ideally matched with plain brogues and cropped blazer. Key details include elasticated material and a vintage floral print design.', '2023-12-08 11:49:45', '2023-12-08 11:49:45'),
(1206, 'Fur Print Clutch Bag with Metal Fastening', 'B3-A2-999-9', 0, 0, 'Fur Print Clutch Bag with Metal Fastening. This stunning vintage style clutch bag is an essential piece of any chic lady evening outfit! This clutch bag works perfect fit little black dress, golden accessories and classic high heels! Key features include metal fastening, glamorous animal fur look like print, zipped inner pocket and detachable chain strap.', '2023-12-08 11:49:46', '2023-12-08 11:49:46'),
(1207, 'Braided Shoulder Bag with Butterfly Detail', 'B2-B4-B015', 0, 0, 'Braided Shoulder Bag with Butterfly Detail. You will love this sweet braided shoulder bag, as it can easily fit to any casual look and is practical in use. The butterfly detail gives a feminine tough to your daily outfit. Key features include metal magnetic fastening, zipped inner fastening, zipped inner pocket and detachable adjustable strap.', '2023-12-08 11:49:47', '2023-12-08 11:49:47'),
(1208, 'Cross Body Bag With Fringe Tassel Detail', 'B1-A3-L8038', 0, 0, 'Cross Body Bag With Fringe Tassel Detail. Enjoy your outdoors activities with this cute cross body bag! This bag has configurable design and looks nicely with any weekend outfit! Key features include zipped fastening, metal fastening pocket on the front, zipped pocket inside and at the back, adjustable strap and delicate fringe tassel detail on the side.', '2023-12-08 11:49:48', '2023-12-08 11:49:48'),
(1209, 'Cross Body Bag With Tab Fastening Detail', 'B3-A5-L8032', 0, 0, 'Cross Body Bag With Tab Fastening Detail. This bag is essential accessory of any daily outfit! This bag is trendy and at the same time practical, what makes it suitable for movement-based activities. Key features include adjustable strap,magnetic tab fastening, zipped inner fastening, magnetic fastening front and back pockets.', '2023-12-08 11:49:49', '2023-12-08 11:49:49'),
