(1272, 'Black Textured Bodycon Dress', '14-B3-7970', 3, 1, 'Black Textured Bodycon Dress. Show off your fabulous figure in this black textured bodycon dress. This sophisticated looking dress is ideal for a night out with your friends and can easily be matched with high heels and a diamante clutch! Key features include a bodycon fit, textured material with faux leather detailed sleeves.', '2023-12-08 11:50:47', '2023-12-08 11:50:47'),
(1273, 'Sleeveless Keyhole Dress with Diamond Back Detail', '2-A5-7910', 1, 1, 'Sleeveless Keyhole Dress with Diamond Back Detail. Look pretty this summer with this stylish keyhole dress! Simply designed on the front and subtle diamond details at the back make this dress ideal for special occasion or date! Match it with pointed high heels and diamond detailed clutch and you will get a classic elegant look! Key features include elasticated fabrics, keyhole cut bust and cut off back with diamond details.', '2023-12-08 11:50:47', '2023-12-08 11:50:47'),
(1274, 'White Cut Out Design and Mesh Insert Leggings', '14-A3-LM90008', 15, 1, 'White Cut Out Design and Mesh Insert Leggings. Turn those long sunny days in to an effortless fashionable affair with this ultra modern white leggings! These leggings will keep you on-trend and at the same time will give you comfort and fresh! This piece compound all hottest trends of this season: pure white colour, bouncy cut off style and sexy mesh inserts! These leggings can be easily mixed with crop top, hi-tops and trucker hat!', '2023-12-08 11:50:48', '2023-12-08 11:50:48'),
(1275, 'Black Leather Look Leggings with Lace Insert', '8-A1-LM8290-70', 0, 0, 'Black Leather Look Leggings with Lace Insert. These leather look leggings are ideal to toughen up every woman\'s casual look! Made from soft elasticated material they hug the body perfectly! Mix them with chiffon blouse, leather jacket and ankle boots to get rock chic outfit! Key features include elasticated waistband and lace details.', '2023-12-08 11:50:49', '2023-12-08 11:50:49'),
(1276, 'Black Beaded Dress With Faux Leather Front', '1-B4-7919', 0, 0, 'Black Beaded Dress With Faux Leather Front. No outfit is complete without a statement faux leather dress! This dress is ideal for girly nights out! Key features include a faux leather front, zip up back with beaded collar.', '2023-12-08 11:50:50', '2023-12-08 11:50:50'),
(1277, 'Textured Dress With Faux Leather Detail', '2-B5-7968', 0, 0, 'Textured Dress With Faux Leather Detail. This faux leather dress is sure to add a biker chic look to your wardrobe this season! If you want to stand out from the crowd and make a style statement then this dress is perfect for you! Key features include a zip up back, textured body with faux leather detail.', '2023-12-08 11:50:51', '2023-12-08 11:50:51'),
(1278, 'Flap Detail Boob Tube Dress', '2-B3-HM1213', 35, 1, 'Flap Detail Boob Tube Dress. Get unique and sophisticated party look with this subtle boob tube dress! This dress is a great addition to your occasional wardrobe, and be sure you will be a prom queen in it! Made from silk look material this dress has subtle design, so to achieve the ultimate evening look just add golden jewelry and a pair of black high heels. Key features include, padded bust,detachable adjustable straps, two flaps and gathers on the front and zipped back fastening.', '2023-12-08 11:50:52', '2023-12-08 11:50:52'),
(1279, 'Shiny Black Leggings With Gold Detail', '17-A3-LM8290-78', 16, 1, 'Shiny Black Leggings With Gold Detail. Look fab in these shiny black leggings. Everyone needs a pair of black leggings as they go with every single one of your outfits! These gorgeous leggings have a gold decoration on the knee with black sequins! Grab a pair while you still can!', '2023-12-08 11:50:53', '2023-12-08 11:50:53'),
(1280, 'Wide Leg Pleated Trousers', '3-A2-LM1299', 1, 1, 'Wide Leg Pleated Trousers. These lightweight wide leg pleated trousers are the ideal alternative to the maxi skirts! They have fully relaxed design, but silhouette is still classic and elegant, so these trousers will perfectly fit to any urban chic outfit! They work beautifully with wedges and cropped blouse and for holiday look add cat eye sunglasses! Key features include elasticated waistband and airy semi-sheer fabrics.', '2023-12-08 11:50:54', '2023-12-08 11:50:54'),
(1281, 'Mesh and Diamond Beading Bodycon Dress', '1-A1-HM1667', 0, 0, 'Mesh and Diamond Beading Bodycon Dress. This outgoing bodycon dress is a glamour must-have for any fashion lover! Made from elasticated material this dress hugs and highlight your body, so you definitely will stand out from the crowd in any occasional event! Mix this dress with t-bar high heels and sequin clutch bag to get romantic evening look! Key features include bodycon design, mesh inserts with diamond beading and small zip at the back.', '2023-12-08 11:50:55', '2023-12-08 11:50:55'),
(1282, 'Pleated Chiffon Dress with Black Lace Detail', '24-A1-6602', 90, 1, 'Pleated Chiffon Dress with Black Lace Detail. Upgrade your summer casual look with this stunning pleated chiffon dress! This delightful dress will become a lovely addition to your warmer weather wardrobe! To achieve trendy occasional look, mix it with a pair of black pointed high heels and classic blazer! Key features include loose design and black lace detail.', '2023-12-08 11:50:56', '2023-12-08 11:50:56'),
(1283, 'Floral Print T-shirt', '1-A3-RHONA', 0, 0, 'Floral Print T-shirt. Flirt with floral print this summer! This cute T-shirt will refresh any woman\'s casual outfit! Bright colours and subtle design will make your look fashionable and eye-catching. This T-shirt works ideally with a pair of blue jeans and configurable pumps! It is a great deal for the weekend activities and picnics. Key features include elasticated material and loose style.', '2023-12-08 11:50:57', '2023-12-08 11:50:57'),
