(1285, 'Black Embroidered Waistband Harem Trousers', '3-B1-7825', 23, 1, 'Black Embroidered Waistband Harem Trousers. Make a statement in these wonderful embroidered harem trousers! Fashionable and comfortable, they are an essential summer wardrobe update! For the ultimate look, mix these trousers with bright top, loose cardigan and gladiator sandals. Key features include lightweight airy material, embroidered front of the waistband and elasticated back, two front pocket and two faulty back pockets.', '2023-12-08 11:50:58', '2023-12-08 11:50:58'),
(1286, 'Faux Leather Pumps with Snake Look Buckle', 'S-12B-14126', 25, 1, 'Faux Leather Pumps with Snake Look Buckle. Ideal for work and weekend activities, these beautiful faux leather pumps are a must for every glamour chic casual look! These pumps has configurable design completed with snakeskin look heel and buckle on the toe.', '2023-12-08 11:50:59', '2023-12-08 11:50:59'),
