(1458, 'Knitted Detail Low Backed Dress', '12-A4-DY010', 11, 1, 'Knitted Detail Low Backed Dress. This dress is sleeveless with a retro collar on the front and a low round back. The dress has a zip at the back and is fitted.. The black dress has an inner dress in beige, and the peach has a white one that shows through the knitted design and is stretchy for that perfect fit. Very stylish dress for under £7. Available in black and peach. \nMaterial:\n35% Cotton\n60% Polyester\n5% Elastane\nApprox measurements for UK size 8:\nchest 44cm\nlength shoulder to hem 82cm', '2023-12-08 12:03:28', '2023-12-08 12:03:28'),
(1459, 'Dog Tooth Check Skater Skirt', '4-B3-DY003', 3, 1, 'Dog Tooth Checked Skater Skirt. This skirt is excellent quality. It has a fixed wide waistband with a concealed side zip. Ideal for a night out or for work. Excellent value coming in at under £5. Combine this skirt with a chic top and pair of heels.\nMaterial: \n35% Cotton\n60% Polyester\n5% Elastane\nApprox measurements for UK size 8:\nWaist 35cm\nLength from top of waistband to the hem 41cm', '2023-12-08 12:03:31', '2023-12-08 12:03:31'),
(1460, 'Small Shoulder Owl Bag', 'B3-A4-1016', 0, 0, 'Small Shoulder Owl Bag. Show your individuality with this lovely owl bag! This nice bag is lightweight and delicate, however spacious enough to carry on your essentials during the social event, trip or festival! Key features include small inner pocket, flap front closure and chic chain strap.  Don\'t delay and grab this cute bag now for affordable price!\nMaterial:\nFaux Leather\nApproximate Width: 15cm\nApproximate Height: 17cm\nApproximate Depth: 5cm', '2023-12-08 12:03:33', '2023-12-08 12:03:33'),
(1461, 'Large Tote Handbag With Twin Handles', 'B2-A1-6863', 0, 0, 'Large Tote Handbag With Twin Handles. Meet the autumn this this stunning tote handbag! This bag is perfect for your daily activities, as it is spacious enough to carry on all what your will need during long working day! This handbag matches best with riding boots, cosy parka and knitted scarf! Key features include, twin handles, zipped fastener, one zipped inner and outer pockets. Hurry up and grab this practical, but stylish handbag now!\nMain Material:\nFaux Leather\nApproximate Width: 34cm\nApproximate Height: 30cm\nApproximate Depth: 14cm', '2023-12-08 12:03:34', '2023-12-08 12:03:34'),
(1462, 'Large Owl Print Satchel Handbag', 'B2-A2-841-3', 0, 0, 'Large Owl Print Satchel Handbag. Get creative look with this extraordinary satchel handbag! This handbag is ideal for studies or everyday activities, as this lovely handbag is ultra versatile and spacious, moreover it can be worn across the body or over the shoulder! Key features include flap front and zipped closure, two open outer pockets and one zipped pocket, long adjustable strap, two inner departments and two zipped inner pockets. Be the first to order this cool satchel bag as only limited number of this style is available!\nMain Material:\nPVC\nApproximate Width: 34cm\nApproximate Height: 21cm \nApproximate Depth: 12cm', '2023-12-08 12:03:35', '2023-12-08 12:03:35'),
(1463, 'Sleeveless Floral Blouse with Frill and Lace Detail', '10-B2-DY015', 50, 1, 'Sleeveless Blouse with Frill and Lace Detail. This chiffon feel floral blouse is sleeveless. It has a frill on the bottom and lace around the hips and the shoulders. It has faux leather edging on the sleeves and the neckline. It has one button fastening at the back. There is a lining on the front. It has a loose fit. Available in navy and cream.  Excellent value at under £5.\nMaterial:\n100% Polyester\nApprox measurements for UK size 8:\nChest 47cm\nLength shoulder to hem 58cm', '2023-12-08 12:03:36', '2023-12-08 12:03:36'),
(1464, 'Cat Printed Faux Leather Handbag', 'B3-A3-A0399', 21, 1, 'Cat Printed Faux Leather Handbag. Be the first to get this personalized design handbag! This lovely day handbag is perfect to carry all your essentials and stay stylish at any occasion! Key features include twin handles, long adjustable detachable strap, zipped fastener, one zipped outer and inner pockets, completed with small open inner pockets!\nMaterial:\nFaux Leather\nApproximate Width: 36cm\nApproximate Height: 22cm\nApproximate Depth: 12cm', '2023-12-08 12:03:37', '2023-12-08 12:03:37'),
(1465, 'Mid Length Cardigan with Pockets', '14-A1-EMER', 8, 1, 'Mid Length Cardigan with Pockets. This ex branded cardigan is excellent value. It has a rolled edge with 5 large contrasting buttons and two front pockets. Available in camel and dark grey. As this cardigan is ex branded the labels may be cut. \nMaterial: 100% Acrylic\nApprox measurements for size S:\nChest 51cm\nLength shoulder to hem 73cm', '2023-12-08 12:03:40', '2023-12-08 12:03:40'),
(1466, 'Black Handbag With Ribbon Detail', 'B2-A3-9080', 0, 0, 'Black Handbag With Ribbon Detail. Stay fashionable this season with chic bag! Quality, however affordable this bag will be a perfect addition to your  casual outfit! Key features include twin handles, zipped fastener, one zipped outer pocket, one zipped inner pocket and adjustable detachable strap. Don\'t delay, grab this attractive handbag now and be sure you will look trendy at any occasion!\nMaterial:\nPVC\nApproximate Width: 35cm\nApproximate Height: 24cm\nApproximate Depth: 10cm', '2023-12-08 12:03:42', '2023-12-08 12:03:42'),
(1467, 'Dipped Hem Blouse with Knitted Sleeves', '5-B5-FALLON', 30, 1, 'Dipped Hem Blouse with Knitted Sleeves. This chiffon feel blouse is perfect for that special night out. It has a round neck and slightly dipped hem at the back. It has a button fastening at the back of the neck and thin knitted long sleeves.The blouse is lightweight so ideal for your suitcase too. This item is ex branded.\nMaterial:\nBody 100% Polyester\nSleeves 70% Polyester, 15% Wool, 15% Acrylic\nApprox size for UK size 8\nBust 46cm\nLength Shoulder to hem 59cm', '2023-12-08 12:03:43', '2023-12-08 12:03:43'),
(1468, 'Black Hobo Bag With Bow And Diamond Detail', 'B3-A3-9060', 0, 0, 'Black Hobo Bag with Bow and Diamond Detail. Add a feminine touch to you casual outfit with this spectacular hobo bag! Available in chic black colour, this bag is ultra versatile and functional, so you can carry on all your essentials! Key features include two handles, zipped fastening, one zipped outer pocket, spacious inner department with small zipped pocked, bow and diamond detail on the front, completed with delicate tassels.\nMaterial:\nFaux Leather\nApproximate Width: 42cm\nApproximate Height: 28cm\nApproximate Depth: 12cm', '2023-12-08 12:03:44', '2023-12-08 12:03:44'),
(1469, 'Black Faux Leather Handbag With Chain Detail', 'B3-A3-833', 0, 0, 'Black Faux Leather Handbag With Chain Detail. You will definitely love this amazing black handbag, as it is easy to wear and practical. Ideal for professional or just for any casual outfit! This stunning bag will look best with black ankle boots, classic coat and silky scarf! Key features include single handle, zipped fastening, chain and strap detail on the front, one inner department with small zipped pocket. Order this charming handbag now and it will become a key piece of your daily look!\nMaterial:\nFaux Leather\nApproximate Width: 32cm\nApproximate Height: 28cm\nApproximate Depth: 10cm', '2023-12-08 12:03:45', '2023-12-08 12:03:45'),
(1470, 'Chiffon Feel Blouse with Pocket and Zip Detail', '7-A1-2031', 0, 0, 'Chiffon Feel Blouse with Pocket and Zip Detail. This black long sleeved blouse is ideal for a night out or for work. It is very stylish with two pockets and a zip detail on the front. The pockets have faux leather trimming and the shoulders have faux leather on them too. The neck is round and the back hem is slightly dipped.The sleeves have a small cuff and button. This bloused is available in one size, please check the measurements for further details. Extremely good value. \nMaterial:\n100% Acrylic\nApprox measurements:\nChest 46cm\nLength from shoulder to hem 61cm', '2023-12-08 12:03:46', '2023-12-08 12:03:46');
