(1471, 'Lightweight Soft Knit Long Cardigan', '14-B4-JANELLE', 11, 1, 'Lightweight Soft Knit Long Cardigan. This cardigan is extremely soft. It has 7 contrasting buttons and two front pockets with matching buttons. It has ribbing on the bottom hem and wide ribbing on the cuffs. Lightweight, ideal to put in your suitcase or handbag for extra warmth as the day goes on. Available on Royal Blue and Mocha. This cardigan is ex branded and may therefore have the labels cut.\nMaterial:\n93% Cotton\n7% Polyamid\nApprox measurements for size s:\nChest 48cm\nLength shoulder to hem 86cm', '2023-12-08 12:03:47', '2023-12-08 12:03:47'),
(1472, 'Yellow Wellies With Adjustable Buckle', 'ST-2-09AL129', 0, 0, 'Yellow Wellies With Adjustable Buckle. Make wet weather awesome in these bright yellow wellies! Extra comfy and waterproof, these funky wellington boots are ideal for festivals, however they are trendy enough for the ultimate urban look as well! Key features include water resistant PVC, knee high design and adjustable buckle at top. Hurry up, order these fascinating wellies now for affordable price as only limited number of this style is available!\nMaterial:\nPVC\nApproximate measurements for Size UK4: \nInner Sole: 24 cm', '2023-12-08 12:03:50', '2023-12-08 12:03:50'),
(1473, 'Funky Print Wellington Boots', 'ST-2-DY125', 0, 0, 'Funky Print Wellington Boots. Get ready for rainy and snowy season with these fun wellies! Cosy and waterproof, these fantastic wellies will make you stand out from the crowd at any weather! Key features include durable sole, water resistant fabric and adjustable buckle. Hurry up, purchase these cool wellies now and be sure you are on-trend!\nMaterial:\nPVC\nApproximate measurements for Size UK4: \nInner Sole: 23 cm', '2023-12-08 12:03:52', '2023-12-08 12:03:52'),
(1474, 'Floral Print Wellies With Buckle', 'ST-2-DY019', 0, 0, 'Floral Print Wellies With Buckle. No matter where you are, from festivals to high street, these outstanding wallies will make you feel stylish and cosy at any occasion! Made from soft waterproof PVC, these lovely wellington boots will work best with hooded parka, denim shorts and plain knee high socks! Key features include water resistant fabric, durable sole and adjustable buckle. Don\'t delay and grab these captivating wellies now!\nMaterial:\nFaux leather \nApproximate measurements for Size UK4: \nInner Sole: 23 cm', '2023-12-08 12:03:54', '2023-12-08 12:03:54'),
(1475, 'Black floral print wellington boots', 'ST-2-DY109', 0, 0, 'Black Floral Print Wellington Boots. It\'s time to keep your feet dry and warm with these beautiful wellies! These cute wellington boots will add a feminine touch to your festival or just casual autumn outfit! Chic floral print and charm black colour make them ultra versatile, so you can match it to any style or mood! Key features include waterproof fabric, rubber sole and adjustable buckle. Don\'t miss your chance and grab these lovely wellies now!\nMaterial:\nFaux leather \nApproximate measurements for Size UK4: \nInner Sole: 24 cm', '2023-12-08 12:03:56', '2023-12-08 12:03:56'),
(1476, 'Bow Tie Chunky Heel Court Shoes', 'S-10A-CH04', 0, 0, 'Bow Tie Chunky Heel Court Shoes. Good news for high heels lovers - these fantastic chunky heel shoes is perfect for autumn weather! Available in chic black, retro brown and gentle apricot colours, these court shoes are ideal for daily outfits! Key features include faux leather waterproof fabric, chunky heel, small platform and delicate bow at the front. Don\'t delay and grab these stunning casual shoes now, as only limited quantity of this style is available!\nMaterial:\nFaux Leather\nHeel Height: 12cm\nPlatform Height: 2cm\nApproximate measurements for Size UK4: \nInner Sole: 23.5 cm', '2023-12-08 12:03:58', '2023-12-08 12:03:58'),
(1477, 'Blue Paisley Print Kimono With Tassels', '4-B3-ABBI', 11, 1, 'Blue Paisley Print Kimono With Tassels. Get ready for holidays with this chic kimono! Made from lightweight semi sheer material, this stunning kimono will be a great addition to your bohemian outfit! Just pair it with denim shorts, black vest top and wedge sandals to achieve ultimate holiday look! Key features include loose design, half sleeves and black tassels on the hem. \nMaterial:\n100% Polyester\nApproximate measurements for SM size:\nChest: 61cm\nTotal length (Shoulder to hem): 71cm', '2023-12-08 12:04:02', '2023-12-08 12:04:02'),
(1478, 'Heart Print Chiffon Top', '3-A4-DY-013', 52, 1, 'Heart Print Chiffon Top. Add a romantic touch to your day to night outfit with this lovely chiffon top! For the best look, team it with simple pencil skirt, plain black ankle boots and classic blazer! Key features include semi cheer fabric, 3/4 sleeves, frilled hem round neckline and button fastening at the back. Hurry up and don\'t miss a chance to look cute in this charming top!\nMaterial:\n100% Polyester\nApproximate measurements for size UK8:\nChest: 47cm\nTotal length (Shoulder to hem): 52cm', '2023-12-08 12:04:04', '2023-12-08 12:04:04'),
(1479, 'Knitted Cardigan With Front Pockets', '18-A3-ELIDH', 13, 1, 'Knitted Cardigan With Front Pockets. Achieve ultimate casual look with this amazing knitted cardigan! Best for colder weather, this knitted cardigan will make you feel ultra comfy and warm! For trendy casual outfit, mix it with skinny jeans, vest top, riding boots and oversized scarf! Key features include open front design, dip hem, long sleeves and two pockets. Don\'t delay, order this nice cardigan now! \nMaterial:\n100% Cotton\nApproximate measurements for size UK 14/16:\nChest: 50cm\nTotal length (Shoulder to hem): Front: 71cm; Back 77cm', '2023-12-08 12:04:06', '2023-12-08 12:04:06'),
(1480, 'Dark Denim Regular Fit Skinny Jeans', '12-B1-ADELEY', 0, 0, 'Dark Denim Regular Fit Skinny Jeans. These ultra comfy skinny jeans is a must-have to any woman\'s wardrobe this season! These jeans are ideal for colder days, just match them with checked shirt, knitted cardigan and lace up boots to achieve trendy urban look! Key features include zipped and button fastener, completed with four front and two back pockets. Grab them now and look stylish this autumn!\nMaterial:\n76% Cotton\n23% Polyester\n1% Elastane\nApproximate measurements for the size UK10:\nWaist: 39cm\nTotal length (Waist to hem) : 97cm', '2023-12-08 12:04:12', '2023-12-08 12:04:12'),
(1481, '3/4 Sleeve Patterned Jumper', 'SKYLER-001', 27, 1, '3/4 Sleeve Patterned Jumper. This jumper has a horizontal cable pattern across the front. It has a wide round neck and 3/4 sleeves. Available in black, cream and purple. A bargain jumper for under £5.\nMaterial:\n100% Cotton\nApprox measurements for UK size 14/16:\nChest 53cm\nLength from shoulder to hem 65cm', '2023-12-08 12:04:18', '2023-12-08 12:04:18'),
(1482, 'Short Sleeved Beaded Detail Jumper', 'MIRIAM-002', 5, 1, 'Short Sleeved Beaded Detail Jumper. This lightweight jumper has a very soft feel. It has beading around the neckline. Pastel colours. This is an ex-branded product and therefore the labels may be cut off. Fabulous jumper for under £5.\nMaterial:\n100% Acrylic\nApprox measurements for UK size 14-16\nChest 52cm\nLength from shoulder to hem 69cm', '2023-12-08 12:04:20', '2023-12-08 12:04:20'),
(1483, 'Open Front Long Cardigan with Pockets', 'BRYN-001', 0, 0, 'Open Front Long Cardigan with Pockets. This chunky knit loose fit cardigan is excellent value. It has an open front, ideal to put a belt round. It has two pockets on the front and a cable design on the back. \nMaterial:\n100% Acrylic\nApprox measurements for size Small\nChest 60cm\nLength shoulder to hem 72cm', '2023-12-08 12:04:22', '2023-12-08 12:04:22'),
(1484, 'Striped Detail Long Jumper', 'DESTINY-001', 0, 0, 'Striped Detail Long Jumper. This soft long jumper is a bargain coming in at under £5. It is blue at the neck, going into black on the waist and then into fuschia at the bottom. It has a round neck and is soft to touch. Ideal to wear with leggings or a pair of jeans. \nMaterial:\n100% Acrylic\nApprox measurements for size small:\nchest 53cm\nlength from shoulder to hem 74cm', '2023-12-08 12:04:25', '2023-12-08 12:04:25'),
(1485, 'Cowl Neck Long Jumper with Cable Detail', 'R-BOX4-ELLY-001', 0, 0, 'Cowl Neck Long Jumper with Cable Detail. This gorgeous jumper has a wide rib detail at the hem and on the sleeves. The cowl neck is ribbed too. There is a cable detail on the front of the jumper. Excellent value at £4.99. This jumper is black and white flecked. \nMaterial:\n100% Acrylic\nApprox measurementsd for size medium:\nchest 48cm\nlength from shoulder to hem 77cm', '2023-12-08 12:04:27', '2023-12-08 12:04:27'),
(1486, 'Soft Jumper with Elbow Patches and Shoulder Detail AVAILABLE IN PLUS SIZES', 'WINNIFRED-001', 9, 1, 'Soft Jumper with Elbow Patches and Shoulder Detail. This jumper has a soft knit. The neck is round with ribbing. There is a shoulder tab with a button. The sleeve has contrasting elbow patches with a double hem at the cuff.  The double hem on the jumper has a split on each side. An excellent quality jumper for under £5. Ideal to wear with leggings or jeans. Very comfortable to wear.\nMaterial:\n80% cotton\n20% polyamide\nApprox measrements for size small:\nchest 43cm\nlength from shoulder to hem 64cm', '2023-12-08 12:04:28', '2023-12-08 12:04:28'),
(1487, 'Cable Knit Soft Flecked Jumper', 'TAHIA-001', 0, 0, 'Cable Knit Soft Flecked Jumper. This jumper has a very soft and warm feel to it. The front has a cable design and it has raglan sleeves. The neck is round and ribbed. There are little side slits at the bottom hem. Excellent value for under £5. Ideal for wearing over jeans or leggings and with a pair of ankle or long boots. Available in three warm colours.\nMaterial:\n100% Acrylic\nApprox measurements for UK size 10\nChest 42cm\nLength from shoulder to hem 65cm', '2023-12-08 12:04:34', '2023-12-08 12:04:34'),
(1488, 'Loose Knit Short Sleeved Jumper', 'ZYANA-001', 54, 1, 'Loose Knit Short Sleeved Jumper. This loose knit jumper has short sleeves and a round neck. It has a loose fit and could be worn on it\'s own, over a cami or over a blouse. It would be perfect with a skirt, leggings or jeans. Available in two colours. Great value under £5.\nMaterial:\n50%Cotton\n40% Acrylic\n10% Nylon\nApprox measurements for a size small:\nChest 48cm\nLength from shoulder to hem 60cm', '2023-12-08 12:04:37', '2023-12-08 12:04:37'),
(1489, 'Chunky Knit Flecked Round Neck Jumper', 'AVRIL-001', 2, 1, 'Chunky Knit Flecked Round Neck Jumper. These two jumpers are colourful and very warm. They have a round neck and ribbing at the cuffs and hem. There is pattern detail on the body where the arms are attached. Perfect for wearing with jeans or leggings. A bargain for under £5!\nMaterial:\n71% Polyacrylic\n19% Wool\n10% Polyamide\nApprox measurements for size small:\nChest 47cm\nLength from shoulder to hem 68cm', '2023-12-08 12:04:43', '2023-12-08 12:04:43'),
(1490, 'Peach Knitted Jumper', 'PATTI-001', 32, 1, 'Peach Knitted Jumper. This jumper has a close knit and has a round neck. The arm and side seams are visible. It has side splits with the back hem being ribbed and the front hem rolled up. A prettty jumper at a bargain price. Great to wear with jeans or leggings and a pair of boots.\nMaterial:\n100% Acrylic\nApprox measurements for size small:\nChest 45cm\nLength from shoulder to hem at the front 67cm', '2023-12-08 12:04:46', '2023-12-08 12:04:46'),
(1491, 'Stripe Detail Knitted Jumper', 'ELERY-001', 0, 0, 'Stripe Detail Knitted Jumper. This jumper has a round neck and a knitted striped contrasting pattern. It is a long jumper and would look fab with leggings or a pair of jeans and boots. This jumper is a loose fit. Soft, warm jumper for any occasion. \nMaterial:\n100% Acrylic\nApprox measurements for a size small:\nChest 52cm\nLength from shoulder to hem 76cm', '2023-12-08 12:04:48', '2023-12-08 12:04:48'),
(1492, 'Boob Tube Leopard Mini Dress', '3929-252', 18, 1, 'Boob Tube Leopard Mini Dress. Get ready fro the party with this stunning dress! Made from lightweight material this dress will add an ultimate chic to your occasional outfit! Key features include sleeveless design, slightly elasticated fabric, zipped fastener at the back and delicate bow detail.\nMaterial:\nShell:\n5% Elastane\n32% Nylon\n63% Polyester\nLining:\n100% Lining\nApproximate measurements for size S:\nChest: 37cm\nTotal length (Underarm to hem): 69cm', '2023-12-08 12:04:51', '2023-12-08 12:04:51'),
(1493, 'Chunky Knit Cable Design Jumper', 'ELOISE-001', 13, 1, 'Chunky Knit Cable Design Jumper. This multi coloured jumper has a round neck. The knit is chunky with some loose knitting in the pattern. It has a horizontal cable pattern across the front and down the sleeves. It has side splits with hem being longer at the back. Great with a pair of leggings and boots. It will keep you warm and cosy. This is an ex branded jumper and the labels may be cut off. \nMaterial:\n100% Acrylic\nApprox measurements for UK size 8:\nChest 50cm\nLength from shoulder to front hem 66cm', '2023-12-08 12:04:54', '2023-12-08 12:04:54'),
(1494, 'Shopper Bag With Colourful Detail', '009-356', 0, 0, 'Shopper Bag With Colourful Detail. Meet autumn in bright patterns with this amazing shopper bag! Be sure you will love this stunning bag, as it is ultra versatile and functional! For best casual look just mix it with riding boots, simple jeans and knitted cardigan! Key features include zip closure, small zipped outer pocket, single department and adjustable detachable strap. Don\'t miss a chance to get this exclusive bag now!\nMaterial: \nFaux Leather\nApproximate Width: 42cm\nApproximate Height: 26cm\nApproximate Depth: 12cm', '2023-12-08 12:04:55', '2023-12-08 12:04:55'),
(1495, 'Fading Design Loose Knit Jumper', 'ASPEN-001', 0, 0, 'Fading Design Loose Knit Jumper. This loose knit cotton jumper has a round low neck at the front. It has a loose fit and has raglan sleeves. You could match it up with a cami, boob tube, leggings and boots for a great look. Available in two colours, blue and coral.\nMaterial:\n100% cotton\nApprox measurements for size small:\nChest 53cm\nLength from shoulder to hem 60cm', '2023-12-08 12:04:57', '2023-12-08 12:04:57'),
(1496, 'Cable Knit Baggy Jumper', 'ASTON-001', 1, 1, 'Cable Knit Baggy Jumper. This loose fitting jumper is excellent value. It has a round neck. Ribbihng on the neck, cuffs and hem. Available in three colours. Great for a those chilly evenings.\nMaterial:\n100% Acrylic\nApprox measurements for size small:\nChest 64cm\nLength from shoulder to hem 64cm', '2023-12-08 12:05:00', '2023-12-08 12:05:00'),
(1497, 'Open Front Long Cardigan', 'TABITHA-001', 0, 0, 'Open Front Long Cardigan. This mocha cardigan is open at the front and has ribbing all the way round. The knit is soft to touch. It has a shawl collar. The sleeves have ribbiing on the cuffs.\nMaterial:\n100% Acrylic\nApprox measurements for size small:\nChest 41cm\nLength from shoulder to hem at the back 76cm', '2023-12-08 12:05:02', '2023-12-08 12:05:02'),
(1498, 'Cream Smock Style Soft Knit Jumper', 'ENYA-001', 3, 1, 'Cream Smock Style Soft Knit Jumper. This cream jumper has a thin striped design from the shoulder to the bust, back and front, to give a slight smock effect. It has a gold coloured edge to the round neckline. The jumper has a very soft feel and would be great for any occasion. Team it up with jeans, leggings or a skirt for that trendy look. \nMaterial:\n77% Acrylic\n20% Polyamide\n3% Elastane\nApprox measurements for size small:\nChest 35cm\nLength shoulder to hem 65cm', '2023-12-08 12:05:04', '2023-12-08 12:05:04'),
(1499, 'Grey Fleck Chunky Knit Jumper', 'BRIA-001', 9, 1, 'Grey Fleck Chunky Knit Jumper. This quality jumper has a loose fit. It has a design on the front. It has ribbing on the neck, sleeves and hem. Great to wear with jeans or leggings and a pair of boots. \nMaterial:\n100% Acrylic\nApprox measurements for size small:\nChest 52cm\nLength from shoulder to hem 60cm', '2023-12-08 12:05:05', '2023-12-08 12:05:05'),
(1500, 'Flecked Batwing Open Front Cardigan', 'FRAN-001', 0, 0, 'Flecked Batwing Open Front Cardigan. This cotton and polyester cardigan has batwing sleeves and is open at the front. It is black and white flecked and has a loose knit. It has a loose fit. Great to wear for any occasion. Put with a cami, blouse, top, leggings or jeans to make the perfect outfit. Excellent quality and super value at £4.99!\nMaterial:\n50% Cotton\n50% Polyester\nApprox measurements for size small:\nChest 54cm\nLength from shoulder to em at the back 70cm', '2023-12-08 12:05:07', '2023-12-08 12:05:07'),
(1501, 'Cable Design Long Knitted Jumper', 'R-BOX4-AZAELA-001', 0, 0, 'Cable Design Long Knitted Jumper. This cream jumper has a cable design on the front and is long. It has a rolled neck with ribbing at the hem and cuffs. This is excellent quality for just £4.99! Team with some leggings or jeans for a perfect look. \nMaterial:\n52% Cotton\n48% Acrylic\nApprox measurements for size small:\nChest 42cm\nLength from shoulder to hem 73cm', '2023-12-08 12:05:09', '2023-12-08 12:05:09'),
(1502, 'Waffle Design Fitted Bodycon Dress', 'KALEA-001', 60, 1, 'Waffle Design Fitted Bodycon Dress. This dress has a deep round neck at the back and long sleeves. The material has a waffle pattern all over and is fitted. This dress has a slim fit with a slight stretch. Available in orange and purple. Ideal for any occasion, look through our shoes and boots to complete your outfit for under £10.\nMaterial: \n95% Polyester\n5% Elastane\nApprox measurements for UK size 10:\nChest 39cm\nLength from shoulder to hem 83cm', '2023-12-08 12:05:11', '2023-12-08 12:05:11'),
