(1551, 'Long Sleeve Sparkly Silver Knit Jumper', 'LILITA-002', 49, 1, 'Long Sleeve Sparkly Silver Knit Jumper. Create streamlined charming outfits with this astonishing jumper! Warm and ultra comfy this jumper is best for colder weather, just add a pair of wet look leggings, knee high boots and leather waistcoat to achieve trendy autumn look! Key features include long sleeves, round neckline, straight design and delicate sparkly knitting. Order now and and get excellent quality and super value at £4.99! Ex-Branded Product (Labels may be cut off)\nMaterial: \n90% Acrylic\n10% Metallic\nApprox measurements for UK size Small:\nChest:40cm\nTotal Length (Shoulder to hem): 65cm', '2023-12-08 12:07:03', '2023-12-08 12:07:03'),
(1552, 'Dipped Hem Oversized Batwing Top', 'AGA-2-002', 0, 0, 'Dipped Hem Oversized Batwing Top. Get stylish casual look with this lovely top! Matched with plain skinny jeans or leggings this cute top will add a trendy touch to your daily outfit! Key features include loose design, dipped hem and elasticated material. Be the first to order this nice top just for £4.99! Ex-Branded Product (Labels may be cut off)\nMaterial: \n95% Polyester\n5% Elastane\nApprox measurements for One Size:\nChest: 72cm\nTotal Length (Shoulder to hem): Front: 55cm; Back: 70cm', '2023-12-08 12:07:04', '2023-12-08 12:07:04'),
(1553, 'Loose Fit Batwing Jumper With Dip Hem', 'AGA-002', 2, 1, 'Loose Fit Batwing Top With Dip Hem. Meet the autumn season with this appealing jumper! This fall is all about oversized tops, so be sure you will look trendy at any occasion! This cute top works beautifully with mini pencil skirt or shorts, however for ultimate outfit add a knitted scarf and a pair of riding boots! Ex-Branded Product (Labels may be cut off)\nMaterial: \n95% Polyester\n5% Elastane\nApprox measurements for One Size:\nChest: 68cm\nTotal Length (Shoulder to Hem): Front: 57cm; Back: 77cm', '2023-12-08 12:07:05', '2023-12-08 12:07:05'),
(1554, 'Lace Insert Jumper With Zipped Detail', '10673.2-002', 2, 1, 'Lace Insert Jumper With Zipped Detail. Add a romantic touch to your casual looks with this amazing jumper! Soft and cosy this trendy piece is ideal for any day to night outfit! Pretty and very feminine this stunning jumper will look best with simple jeans, platform court shoes and sparkly jewelry. Don\'t miss a chance to get good quality for affordable price and order this stylish jumper now!\nMaterial: \n65% Polyester\n35% Cotton\nApprox measurements for UK size S/M:\nChest: 50cm\nTotal Length (Shoulder to hem): 61cm', '2023-12-08 12:07:07', '2023-12-08 12:07:07'),
(1555, 'Smart Fluffy Zipped Cardigan', '9408-002', 15, 1, 'Smart Fluffy Zipped Cardigan. Add a sparkle touch to your autumn wardrobe with this outstanding cardigan! Simply designed, but at the same time chic, this stunning cardigan is ideal for social activities, concerts or festivals! To complete the look, just mix it with black chiffon shirt, skater skirt and knee high boots! Key features include long sleeves, v-neckline, zipped fastening and charming sparkly knitting. Don\'t delay and order this glamorous cardigan now!\nMaterial:\n50% Polyester\n50% Acrylic\nApproximate measurements for Size S/M:\nChest: 48cm\nTotal length (Shoulder to hem): 62cm', '2023-12-08 12:07:09', '2023-12-08 12:07:09'),
(1556, 'Shiny Studded Leggings', 'LM8290-73-001', 13, 1, 'Shiny Studded Leggings. These gorgeous leggings have a shiny look. They have square studs on the thigh and round ones just above the knee. They have a good stretch to them for a perfect fit. Would look great with a jumper or a cropped top and a pair of our new quality ankle boots. \nMaterial:\n85% Polyamide\n15% Elastane\nApprox measurements for a size S/M:\nWaist 33cm, stretched 44cm\nLength from waist to ankle 89cm', '2023-12-08 12:07:11', '2023-12-08 12:07:11'),
(1557, 'Sparkly Reindeer Leggings', 'ENLEG9857-001', 27, 1, 'Sparkly Reindeer Leggings. These leggings have a reindeer design. There is a slight sparkle to the material. Great stretch for a perfect fit.  There is a wide waistband. These leggings will be lovely and warm and would look great with a pair of fur topped boots.\nMaterial:\n85% Polyamide \n15% Elastane\nApprox measurements:\nWaist 31cm, stretching to 43cm across the front\nLength from waistband to ankle 90cm', '2023-12-08 12:07:12', '2023-12-08 12:07:12'),
(1558, 'Embellished Collar Jumper', '9683-002', 0, 0, 'Embellished Collar Jumper. Add charm to your style on off-duty days with this smart jumper! This soft knitted jumper is perfect for colder weather day to night outfits, as it\'s extremely cozy and embellished flowers on the collar make this piece trendy and feminine! Don\'t miss an opportunity to create stylish look for affordable value and order this amazing jumper now!\nMaterial:\n47% Acrylic\n37% Cotton \n16% Polyamide\nApproximate measurements for Size S/M:\nChest: 41cm\nTotal length (Shoulder to hem): 56cm', '2023-12-08 12:07:12', '2023-12-08 12:07:12'),
(1559, 'Sparkly Snowflake Leggings', 'ENLEG9860-001', 0, 0, 'Sparkly Snowflake Leggings. These leggings are soft to touch and very warm. They have a faded gold snowflake design all over and the material has a slight sparkle in it. They have a wide waistband and a lovely stretch for a perfect fit. Match them up with a winter jumper and a pair of boots for that trendy look.\nMaterial:\n85% Polyamide\n15% Elastane\nApprox measurements:\nWaist on one side 34cm, stretching to 45cm.\nLength from waistband to ankle 90cm', '2023-12-08 12:07:14', '2023-12-08 12:07:14'),
(1560, 'Knitted Stud Skull Jumper', '10033-002', 20, 1, 'Knitted Stud Skull Jumper. Enjoy autumn with this ultra comfy jumper! This nice jumper follows this season\'s trends in a sparkly knit! For ultimate look, mix it with leather look leggings, biker boots and large shopper bag! Hurry up and grab this cool jumper now for affordable price!\nMaterial:\n95% Acrylic\n5% Metallic \nApproximate measurements for Size S/M:\nChest: 56cm\nTotal length (Shoulder to hem): 66cm', '2023-12-08 12:07:16', '2023-12-08 12:07:16'),
(1561, 'Fair Isle Patterned Fleece Lined Leggings', 'ENLEG140-4-001', 18, 1, 'Fair Isle Patterned Fleece Lined Leggings. Available in brown and grey these leggings will keep you very warm. They have a furry fleece lining and are very comfortable. Great with a plain jumper and furry boots. Look through the website to complete your outfit for under £15! \nMaterial:\n85% Polyamide\n15% Elastane\nApprox measurements:\nWaist on one side 33cm stretching to 43cm\nLength from waistband to ankle 96cm', '2023-12-08 12:07:16', '2023-12-08 12:07:16'),
(1562, 'Black Thermal Soft Leggings', 'ENLEG9939-001', 0, 0, 'Black Thermal Soft Leggings. These plain black leggings are soft and fleece lined. They will keep you warm. Match up with one of our under £5 jumpers and a pair of ankle boots for that perfect look!\nMaterial:\n85% Polyamide\n15% Elastane\nApprox measurements:\nWaist across one side 31cm stretching to 41cm\nLength from waistband to ankle 96cm', '2023-12-08 12:07:19', '2023-12-08 12:07:19'),
(1563, 'Smart Hook Fastening Cardigan', '10157-002', 32, 1, 'Smart Hook Fastening Cardigan. This charming cardigan will make your occasional look chic and gorgeous! Made from fluffy and sparkly knit fabric, completed with pearl beading on the front, this cardigan will look best with little black dress, platform court shoes and embellished hard case clutch! Hurry up and purchase this lovely cardigan now!\nMaterial:\n50% Polyester\n30% Acrylic\n20% Metallic\nApproximate measurements for Size S/M:\nChest: 53cm\nTotal length (Shoulder to hem): Front: 56cm; Back: 64cm', '2023-12-08 12:07:20', '2023-12-08 12:07:20'),
(1564, 'Shiny Black Leggings with Skull Detail', 'ENLEG-193-001', 1, 1, 'Shiny Black Leggings with Skull Detail. These shiny leggings have a skull and cross bone design in black diamante on each knee. They have two side pockets on the front and two back pockets. They are stretchy for a perfect fit. Ideal with a cropped top or baggy jumper and a pair of flat ballet pumps or ankle boots. Search lessthan10pounds.com to make that perfect outfit for under £15!\nMaterial:\n91% Polyamide\n9% Elastane\nApprox measurements for size S/M:\nWaist on one side 31cm stretching to 41cm\nLength from waistband to ankle 94cm', '2023-12-08 12:07:22', '2023-12-08 12:07:22');
