(1574, 'Grey Knitted Cardigan With Front Pockets', '10263-002', 0, 0, 'Grey Knitted Cardigan With Front Pockets. Lend an elegant lady twist to your autumn look with this delicate grey cardigan! This gorgeous cardigan is the best option for winter special occasions, as it it\'s cosy and the same time looks smart and luxurious! Just mix it with black bodycon dress, high heel boots and small hard case clutch! Key features include long sleeves, hook fastening and two front pockets.\nMaterial:\n100% Acrylic\nApproximate measurements for Size S/M:\nChest: 48cm\nTotal length (Shoulder to hem): 71cm', '2023-12-08 12:07:37', '2023-12-08 12:07:37'),
