(1578, 'Geometric Print Knitted Baggy Jumper', '10510-002', 0, 0, 'Geometric Print Knitted Baggy Jumper. Add a graphic splash to your autumn wardrobe with this exclusive jumper! Ultra soft and cosy, this jumper is ideal for casual outfit! For the ultimate look just mix it with cigarette trousers, lace up ankle boots and oversized scarf! Don\'t delay, order this beautiful jumper now and stand out from the crowd at any occasion!\nMaterial:\n69% Acrylic\n29% Polyamide\n2% Angora\nApproximate measurements for One Size:\nChest: 52cm\nTotal length (Shoulder to hem): 70cm', '2023-12-08 12:07:42', '2023-12-08 12:07:42'),
