(1580, 'Cowl Back Lace Detail Dress', 'AZARIA-001', 1, 1, 'Cowl Back Lace Detail Dress. This stunning dress has a shimmer to the material. It has a slight stretch. There is a wide black lace panel at the waist on the front. It has a cowl back with a tie across the top that could be hidden if not needed.  Available in 4 gorgeous colours. \nMaterial:\n100% Polyester\nApprox measurements for a UK size 8:\nChest across one side 42cm\nLength from shoulder to hem 95cm', '2023-12-08 12:07:48', '2023-12-08 12:07:48'),
