(1587, 'Dip Hem Oversized Knitted Jumper', '10933-002', 26, 1, 'Dip Hem Oversized Knitted Jumper. Enjoy autumn weather in this sweet jumper! Chunky knitting will make you feel extremely cosy and sparkly gold and silver knits will add some glitz to your casual outfit! This lovely jumper matches perfectly with skinny jeans, knee high boots and elegant tote bag! Hurry up and order this amazing jumper now!\nMaterial:\n50% Acrylic\n35% Polyester\n15% Viscose\nApproximate measurements for Size S/M:\nChest: 58cm\nTotal length (shoulder to hem): Front: 40cm; Back: 60cm', '2023-12-08 12:08:08', '2023-12-08 12:08:08'),
