(1639, 'Sparkly Knit Long Jumper AVAILABLE IN PLUS SIZES', 'R-BOX3-LINA-002', 0, 0, 'Sparkly Knit Long Jumper. Update your winter wardrobe with this smart sparkly jumper! Lightweight but warm this jumper is ideal for winter holidays or any day time activities! Key features include v-neckline, long sleeves and chic sparkly knitting. Don\'t delay and get great value just for £4.99!\nMaterial:\n100% Acrylic\nApprox measurements for size Small:\nAcross one side of chest 40cm\nLength from shoulder to hem 80cm', '2023-12-08 12:10:31', '2023-12-08 12:10:31'),
