(1733, 'Ruffle Sleeve Lace Dress', 'JO10896-002', 0, 0, 'Ruffle Sleeve Lace Dress. Get romantic look with this stunning lace dress! Elegant and ultra versatile, this dress is perfect for any day-to-night outfit! For ultimate look, just mix it with knee high boots, leather jacket and silky scarf! Key features include stretchy underlayer, ruffle sleeves, round neckline and button fastening at the back.\nMaterial:\n60% Cotton\n40% Polyester\nApproximate measurements for Size Small:\nChest: 44cm\nTotal length(Shoulder to hem): 85cm', '2023-12-08 12:13:53', '2023-12-08 12:13:53'),
(1734, 'White Ruffle Front Shirt', 'INGA-002', 31, 1, 'White Ruffle Front Shirt. Refresh your professional wardrobe with this elegant shirt! Ideal for office style, this shirt works beautifully with plain black trousers or pencil skirt, pointy high heels and classic blazer. Key features include gathered elasticated back, cap sleeves and button fastening on the  front.  A great value just for £5.99! Ex-branded product (Labels may be cut off)\nMaterial:\n100% Polyester\nApprox measurements for a size small:\nChest across one side 39cm\nLength from shoulder to hem 58cm', '2023-12-08 12:13:55', '2023-12-08 12:13:55'),
(1735, 'Black Gathered Dress with Lace Insert.', '104000100-002', 0, 0, 'Black Gathered Dress with Lace Insert. Get ready for your special occasion with this beautiful dress! Classic and elegant, this dress will make you stand out from the crowd at any evening event! Key features include elasticated material, short sleeves, zipped fastening on the side, key hole neckline, lace insert on the front and around the neckline. A gorgeous dress for just under £6!\nMaterial:\n100% Polyester\nApprox measurements for size UK8:\nAcross one side of chest 38cm\nLength from shoulder to hem 92cm', '2023-12-08 12:13:56', '2023-12-08 12:13:56'),
(1736, 'Print Front Bodycon Dress With Mesh Insert', '12283-002', 64, 1, 'Print Front Bodycon Dress With Mesh Insert. Look chic and fabulous with this lovely dress! This stunning dress ideal for dates, nights-out or parties! Key features include bodycon design, mesh inserts on the front and zipped fastening at the back. Hurry up and order this stunning dress for affordable price!\nMaterial:\n100% Polyester\nApprox measurements for size Small:\nAcross one side of chest 39cm\nLength from shoulder to hem 84cm', '2023-12-08 12:13:58', '2023-12-08 12:13:58'),
(1737, 'Dusty Pink Loose Knit Long Jumper in Plus Sizes', 'VMAN-001', 0, 0, 'Dusty Pink Loose Knit Long Jumper. This jumper has a v-neck. It has a loose knit and will keep you very warm. Available in sizes UK 16-28. This jumper would look fabulous with a pair of our leggings and would complete your outfit for under £10!\nOur model is wearing a UK size 16.\nMaterial:\n100% Acrylic\nApprox measurements for a size UK 16:\nChest across one side 53cm\nLength from shoulder to hem 76cm', '2023-12-08 12:14:00', '2023-12-08 12:14:00'),
(1738, 'Wine Loose Knit Jumper in Plus Sizes', 'VIVIAN-001', 5, 1, 'Wine Loose Knit Jumper. This gorgeous jumper has a v-neck and ribbing on the cuffs, hem and neck. It is available in UK sizes 16-28. Add a pair of our leggings to complete your outfit for under £10!\nModel is wearing UK size 16.\nMaterial: \n100% Acrylic\nApprox measurements for a UK size 16:\nChest across one side 50cm\nLength from shoulder to hem 61cm', '2023-12-08 12:14:02', '2023-12-08 12:14:02'),
(1739, 'Block Colour Bodycon Dress', 'MC0128-001', 0, 0, 'Block Colour Bodycon Dress. This bodycon dress is red, white and black. It is stretchy and sleeveless. It has a round neckline. Great for that special party, Christmas or New Year\'s Eve. Match with a pair of stiletto shoes to complete your outfit for under £12!\nModel is wearing a size UK 8\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for size UK 8:\nChest across one side 36cm\nLength from shoulder to hem 105cm', '2023-12-08 12:14:04', '2023-12-08 12:14:04'),
(1740, 'Stretch Trousers with Zips and Leather Look Panels', 'G9921-001', 0, 0, 'Stretch Trousers with Zips and Leather Look Panels. These trousers have leather look panels on the front legs, under the waist at the back and two leather look back pockets. There are two zipped false pockets on the front and a wide waistband. These trousers are pull on design. Would look fantastic with a pair of our quality ankle boots and a jumper or blouse. You could have all of that for under £18!\nModel is wearing a UK size 6-8.\nMaterial:\n91% Polyamide\n9% Elastane\nApprox measurements for size UK 6-8:\nWaist 32cm stretching to 40cm \nLength from top of waistband to ankle 95cm', '2023-12-08 12:14:06', '2023-12-08 12:14:06'),
(1741, 'Diamond Pattern Jumper with Sleeve Detail', '5061-001', 0, 0, 'Diamond Pattern Jumper with Sleeve Detail. This jumper has a round neck. The main body has a diamond pattern. The jumper has a soft knit. Great to team up with a pair of leggings to complete your outfit for under £10. \nModel is wearing a size S/M.\nMaterial:\n90% Acrylic\n10% Nylon\nApprox measurements for a size S/M:\nChest across one side 39cm\nLength from shoulder to hem 60cm', '2023-12-08 12:14:07', '2023-12-08 12:14:07'),
(1742, 'Baggy Loose Knit Flecked Jumper', '8285-001', 0, 0, 'Baggy Loose Knit Flecked Jumper. This jumper comes in two colours with a base colour of either black or beige with lots of bright coloured flecks in the knit. It has a round neck and one pocket on the chest. Put together with a pair of our leggings to complete your outfit for under £10!\nModel is wearing one size.\nMaterial:\n60% Acrylic\n40% Polyester\nApprox measurements for one size:\nChest across one side 54cm\nLength from shoulder to hem 66cm', '2023-12-08 12:14:08', '2023-12-08 12:14:08'),
(1743, 'Cable Design Chunky Jumper', '263-001', 24, 1, 'Cable Design Chunky Jumper. This jumper will keep you lovely and warm through the cold winter months. It has a cable design on the front. It has a round neck with ribbing and on the cuffs and hem too. Available in two colours. A super jumper to have in any wardrobe for just £4.99!\nModel is wearing one size.\nMaterial:\n80% Acrylic\n20% Wool\nApprox measurements for one size:\nChest across one side 56cm\nLength from shoulder to hem 67cm', '2023-12-08 12:14:10', '2023-12-08 12:14:10'),
(1744, 'Chunky Flecked Fluffy Cardigan', 'J6055-001', 0, 0, 'Chunky Flecked Fluffy Cardigan. This gorgeous cardigan will keep you very warm. It has a deep V at the front, 5 cream buttons and two front pockets. Team this cardigan up with a pair of leggings, trousers or jeans to complete your outfit. \nModel is wearing size S/M.\nMaterial:\n90% Acrylic\n10% Nylon\nApprox measurements for size S/M:\nChest across one side 48cm\nLength from shoulder to hem 68cm', '2023-12-08 12:14:11', '2023-12-08 12:14:11');
