(1745, 'Baggy V-Neck Jumper', 'LORENA-001', 0, 0, 'Baggy V-Neck Jumper. This jumper is black with a large white stripe across the chest and sleeves. It is a loose fitting jumper and has a V-neck. Great to keep you warm, team up with a pair of leggings, trousers or jeans to complete your outfit. \nModel is wearing a size Small.\nMaterial:\n100% Acrylic\nApprox measurements for a size small:\nChest across one side 56cm\nLength from shoulder to hem 78cm', '2023-12-08 12:14:13', '2023-12-08 12:14:13'),
(1746, 'Sparkly Soft Knit Cardigan PLUS SIZES AVAILABLE', 'SYDNEY-001', 0, 0, 'Sparkly Soft Knit Cardigan. This cardigan has a silver thread in the knit to give it a sparkle. It has a low round neck line and 8 white buttons on the front. These cardigans come up about one size larger than label says. Available in pink and grey. Great to put over jeans, leggings, a dress or skirt. Super value at £4.99! \nModel is wearing UK size 4/6.\nMaterial:\n65% Cotton, 3% Polyester\n30% Acrylic, 2% Metallic Fibres\nApprox measurements for size UK 4/6:\nChest across one side 40cm\nLength from shoulder to hem 65cm', '2023-12-08 12:14:14', '2023-12-08 12:14:14'),
(1747, 'Ex Branded Stretchy Top with Jacquard Front Panel', 'CHENNILITY-001', 0, 0, 'Ex Branded Stretchy Top with Jacquard Front Panel. This top has short sleeves and a round ribbed neckline. It is a wide baggy top. It has a jacquard panel with black embroidery on at the front. This top is ex branded and may therefore have the labels cut. This top would look great with jeans or a pair of leggings. Match them up for a complete outfit for under £10!\nModel is wearing a UK size 8.\nMaterial:\n94% Cotton, 3% Viscose, 2% Elastane\nApprox measurements for UK size 8:\nChest across one side 50cm\nLength from shoulder to hem 55cm', '2023-12-08 12:14:17', '2023-12-08 12:14:17'),
(1748, 'Peach Dress with Lace Detail', '00082-001', 0, 0, 'Peach Dress with Lace Detail. This dress is fully lined. The bodice is lace with capped sleeves. The skirt has small pleats all the way round. There is a deep V at the back of the neck and a concealed zip. An excellent dress for that special night out. Team with a smart blazer to complete your outfit for around £12!\nModel is wearing a size UK 8.\nMaterial:\n75% Cotton, 25% Polyester\nLining 100% Polyester\nApprox measurements for a UK size 8:\nChest across one side 38cm\nLength from shoulder to hem 88cm', '2023-12-08 12:14:19', '2023-12-08 12:14:19'),
(1749, 'Pink Stretch Trousers with Lace Detail', 'LM8859-001', 0, 0, 'Pink Stretch Trousers with Lace Detail. These gorgeous trousers are pull on and are stretchy for a perfect fit. They have a wide waistband , two front zips for a false pocket and a zip at each ankle. There is a lace panel on the front of each leg. Team with a pair of ankle boots and a jumper or blouse to complete your outfit. \nModel is wearing a size small.\nMaterial:\n95% Cotton\n5% Elastane\nApprox measurements for a size small:\nWaist on one side 32cm stretching to 39cm\nLength from top of waistband to ankle 92cm', '2023-12-08 12:14:21', '2023-12-08 12:14:21'),
(1750, 'Fleeced Blue Stretchy Jeggings', 'G9977-001', 0, 0, 'Fleeced Blue Stretchy Jeggings. These dark blue denim look jeggings are stretchy for a perfect fit. They are fleece lined to keep you warm. There are two back pockets. Team up with a pair of ankle boots and a baggy jumper to complete your outfit for around £17. \nModel is wearing one size.\nMaterial:\n95% Polyester\n5% Spandex\nApprox measurements for one size:\nWaist on one side 29cm stretching to 40cm\nLength from waist to ankle 89cm', '2023-12-08 12:14:23', '2023-12-08 12:14:23'),
(1751, 'Black and Grey Patterned Leggings', 'G8709-001', 0, 0, 'Black and Grey Patterned Leggings. These leggings have a Fair Isle pattern on them. They are stretchy for a perfect fit. The waistband is ribbed for extra comfort. They will keep you warm. Team up with a pair of our boots and a jumper to complete your outfit. \nModel is wearing one size.\nMaterial:\n91% Polyamide\n9% Elastane\nApprox measurements for one size:\nWaist across one side 30cm stretching to 39cm\nLength from top of waistband to ankle 91cm', '2023-12-08 12:14:24', '2023-12-08 12:14:24'),
