(1753, 'Velvet Feel Floral Print Leggings', 'LM8291-B-7-001', 3, 1, 'Velvet Feel Floral Print Leggings. These ultra soft leggings are stretchy for a perfect fit. They are fleece lined to keep you extra warm. Team up with ankle boots and a baggy jumper to complete your outfit. You will not be disappointed with these gorgeous leggings. \nModel wears size S/M.\nMaterial:\n85% Polyamide\n15% Elastane\nApprox measurements for size S/M:\nWaist across one side 32cm stretching to 43cm\nLength from waist to ankle 87cm', '2023-12-08 12:14:25', '2023-12-08 12:14:25'),
(1754, 'Velvet Feel Tiger Print Leggings', 'LM8291-B-6-001', 10, 1, 'Velvet Feel Tiger Print Leggings. These ultra soft fleece lined leggings are excellent quality. They are stretchy for a perfect fit. Would look great with a pair of our ankle boots and a baggy jumper. \nModel is wearing size S/M.\nMaterial:\n85% Polyamide\n15% Elastane\nApprox measurements for size S/M:\nWaist on one side 32cm stretching to 43cm\nLength from waist to hem 91cm', '2023-12-08 12:14:27', '2023-12-08 12:14:27'),
