(1756, 'Knitted Poncho with Gold Coloured Embossing', 'LM66188-001', 0, 0, 'Knitted Poncho with Gold Coloured Embossing. This poncho is soft knit and has dipped down side hems and a fringe on the arm area. It has a slit neck opening. Would look great with anything from jeans to a dress. Available in black and cream and is free size.\nMaterial:\n100% Polyester\nApprox measurements for this poncho:\nLength from shoulder to hem 53cm\nFree size across the chest.', '2023-12-08 12:14:29', '2023-12-08 12:14:29'),
(1757, 'Black Hand Knitted Scarf', 'S-721-001', 0, 0, 'Black Hand Knitted Scarf. This chunky scarf has been hand knitted and is lovely and soft to wear with your winter jacket or coat. \nMaterial:\n100% Acrylic\nApprox measurements:\nWidth 30cm\nLength 233cm', '2023-12-08 12:14:30', '2023-12-08 12:14:30'),
