(1761, 'Khaki Sequined Knitted Poncho', 'LM66191-001', 0, 0, 'Khaki Sequined Knitted Poncho. This poncho has a knitted design throughout and sown in sequins. The arm area is fringed and dips down. It is a free size poncho. Team with leggings, jeans or trousers to complete your outfit. \nModel is wearing one size.\nMaterial: \n100% Acrylic\nApprox measurements for length from the shoulder to the hem 58cm.', '2023-12-08 12:14:35', '2023-12-08 12:14:35'),
(1762, 'Knitted Fringed Poncho', 'LM66198-001', 0, 0, 'Knitted Fringed Poncho. This soft poncho is available in black and cream. The sleeves are fringed and this is a free size poncho. Team with a pair of leggings, jeans or trousers. Great value at under £6!\nModel is wearing one size.\nMaterial:\n100% Acrylic\nApprox measurements for length from shoulder to hem 62cm', '2023-12-08 12:14:36', '2023-12-08 12:14:36'),
(1763, 'Chunky Knit Snood', 'SNOOD-001', 0, 0, 'Chunky Knit Snood. This snood will keep you warm this winter. A fabulous accessory for anyone to have. Available in black and cream.\nMaterial:\n100% Acrylic', '2023-12-08 12:14:37', '2023-12-08 12:14:37'),
(1764, 'Long Khaki Jumper With Metal Button Detail', 'R-BOX4-KORA-002', 0, 0, 'Long Khaki Jumper With Metal Button Detail. Update your casual wardrobe with this trendy jumper! Lightweight and super comfy, this jumper is ideal for your daily activities! Key features include stretchy material, long sleeves and delicate button detail of the neckline. A fantastic jumper just for £4.99!\nMaterial:\n100% Acrylic\nApprox measurements for the size UK 6/8:\nChest across one side 42cm\nLength from shoulder to hem 82cm', '2023-12-08 12:14:38', '2023-12-08 12:14:38'),
(1765, 'Fringe Knitted Cardigan With Pearl Buttons', 'O2-002', 42, 1, 'Fringe Knitted Cardigan With Pearl Buttons. Stay stylish during colder months with this stunning cardigan! Chic and ultra cosy this cardigan is ideal for any daily activities or social events! Key features include elasticated knitting, v-neckline, 3/4 sleeves and charm pearl button fastening on the front. Hurry up and order this amazing jumper now for affordable price! \nMaterial:\n100% Acrylic\nApprox measurements for the size S/M:\nChest across one side 49cm\nLength from shoulder to hem 64cm', '2023-12-08 12:14:39', '2023-12-08 12:14:39'),
(1766, 'Black Leather Look Front Trousers', 'R-BOX3-13370-002', 0, 0, 'Black Leather Look Front Trousers. Look cool and attractive in these ultra trendy trousers! Made from elasticated material these trousers will hug your body gently! For the best look just mix them with silky top or blouse, lace up high heel boots and patent envelope clutch! They have a front zip and button. Two front pockets and two back ones. Fabulous trousers for only £5.99!\nMaterial:\n65% Polyester\n35% Viscose\nApproximate measurements for the smallest size:\nWaist: 38cm\nTotal length (waist to hem): 95cm', '2023-12-08 12:14:42', '2023-12-08 12:14:42'),
