(1768, 'Multi Coloured Soft Cardigan', 'BRIAR-002', 26, 1, 'Multi Coloured Soft Cardigan. Wrap up in style this season with this cute cardigan! Versatile and super comfy, this cardigan is perfect for daily activities or just for lounging at home! Key features include stretchy knitting, long sleeves and button fastening on the front. A lovely cardigan for affordable price!\nMaterial:\n100% Acrylic\nApprox measurements for a size Small:\nChest on one side 42cm\nLength from shoulder to hem 60cm', '2023-12-08 12:14:46', '2023-12-08 12:14:46'),
(1769, 'Monochrome Open Front Cardigan With Pockets', 'ELLE-002', 0, 0, 'Monochrome Open Front Cardigan With Pockets. Refresh your winter wardrobe with this amazing cardigan! Warm, however still stylish enough to be a part of professional look! For ultimate casual outfit, just team it with little black dress, simple trousers or pencil skirt. A fantastic cardigan for just £4.99!\nMaterial:\n100% Acrylic\nApprox measurements for a size Small:\nChest on one side 46cm\nLength from shoulder to hem 56cm', '2023-12-08 12:14:48', '2023-12-08 12:14:48'),
(1770, 'Cowl Neck Long Sleeve Jumper', 'KARYN-002', 12, 1, 'Cowl Neck Long Sleeve Jumper. Get ready for colder season with this stunning jumper! This jumper is ideal for weekend outdoor activities or just for lounging at home! Team it with jeggings, knee high boots and leather jacket to achieve ultimate look!\nMaterial:\n100% Acrylic\nApprox measurements for a size Small:\nChest on one side 44cm\nLength from shoulder to hem 65cm', '2023-12-08 12:14:49', '2023-12-08 12:14:49'),
