(1772, 'Cowl Neck Cable Knit Baggy Jumper', 'ELINA-002', 0, 0, 'Cowl Neck Cable Knit Baggy Jumper. Excellent option for winter outfit! Key features include baggy design and long sleeves. There is a cable design on the front of the jumper. Soft feel. Excellent value at under £5. Team with a pair of jeans or bodycon skirt  to complete your look!\nMaterial:\n100% Acrylic\nApprox measurements for a size Small:\nChest across one side 54cm\nLength from shoulder to hem 73cm', '2023-12-08 12:14:55', '2023-12-08 12:14:55'),
