(1774, 'Short Sleeved Long Black Cardigan', 'MARTINA-001', 25, 1, 'Short Sleeved Long Black Cardigan. This chunky long cardigan has one front button. It has ribbing on the waist, and all edging. This cardi will keep you warm. It is ex branded and may therefore have the labels cut. Available in pus sizes.\nModel is wearing UK size 16.\nMaterial:\n85% Acrylic, 15% Wool\nApprox measurements for a size UK 16:\nChest across one side 50cm\nLength from shoulder to hem 81cm', '2023-12-08 12:14:59', '2023-12-08 12:14:59'),
(1775, 'Loose Knit Shawl Collar Cardigan', 'CEREN-001', 0, 0, 'Loose Knit Shawl Collar Cardigan. This cardigan has one button below the collar. It has two front pockets and has loose fitting sleeves. There is ribbing all around the hem line and cuffs. This cardigan is gorgeous and amazing value at just £4.99!\nModel is wearing size Small.\nMaterial:\n100% Acrylic\nApprox measurements for size small:\nChest across one side 43cm\nLength from shoulder to hem 70cm', '2023-12-08 12:15:01', '2023-12-08 12:15:01'),
(1776, 'Ex Branded Shawl Collar Patterned Knit Jumper', 'MACIE-001', 0, 0, 'Shawl Collar Patterned Knit Jumper. This cream and mocha jumper is stunning. It has cream and mocha stripes and a diamond pattern knitted on the front. This jumper is ex branded and may therefore have the labels cut. This is an excellent jumper and a bargain at £4.99!\nModel is wearing size small.\nMaterial:\n100% Acrylic\nApprox measurements for size small:\nChest across one side 46cm\nLength from shoulder to hem 72cm', '2023-12-08 12:15:03', '2023-12-08 12:15:03'),
(1777, 'Pom Pom Hood Knitted Dress', 'TILLY-001', 0, 0, 'Pom Pom Hood Knitted Dress. This hooded dress is great for any occasion! Simply put on some thick pair of tights, a lovely pair of winter boots and a over-shoulder bag! Key features include double layered hood with fur trimming, adjustable tie with pom pom detail, capped sleeves and two cute small pockets at the bottom.\n Material:\n100% Acrylic\nApprox measurements for size UK 10:\nChest across one side 42cm\nLength from shoulder to hem 86cm', '2023-12-08 12:15:04', '2023-12-08 12:15:04'),
