(1827, 'Box Style Handbag', 'H014-001', 0, 0, 'Box Style Handbag. This camel coloured bag has a front and back flap pocket with two magnetic fasteners. It has a zipped top and a middle zipped compartment inside. It has a zipped internal side pocket and an open one. This bag has two grab handles and a detachable, adjustable shoulder strap. Fabulous work bag or for an evening out.\nMaterial:\nFaux Leather\nApprox measurements:\nLength 34cm\nWidth 18cm\nHeight 24cm', '2023-12-08 12:17:14', '2023-12-08 12:17:14'),
(1828, 'Square Handbag with Quilted Detail', 'H5666-001', 0, 0, 'Square Handbag with Quilted Detail. This square design bag has quilted sides. It has two grab handles with a buckle detail on the front. There is a back zip pocket. The top opening is zipped.  It has two extra zipped compartments on the top. There is an internal pocket. \nMaterial:\nFaux Leather\nApprox measurements:\nLength 27cm\nWidth 19cm\nHeight 27cm', '2023-12-08 12:17:15', '2023-12-08 12:17:15'),
(1829, 'Square Handbag With Crossbody Strap', '5122-002', 0, 0, 'Square Handbag With Crossbody Strap. Inspired by the 90s favourite this lovely shiny bag will hit the high street with a storm! Key features include a shiny finish, adjustable crossbody strap, numerous compartments, completed with two carrying handles and a top zip opening! \nMaterial:\nFaux Leather\nApprox measurements:\nWidth 31cm\nHeight 25cm \nDepth 12cm', '2023-12-08 12:17:16', '2023-12-08 12:17:16'),
(1830, 'Tote Handbag With Shoulder Strap', 'H0307-002', 0, 0, 'Tote Handbag With Shoulder Strap. This fabulous hangbag is perfect for a day at the mall! Key features include buckle detail on the two carrying handles with a zip opening at the top, adjustable shoulder strap, two zip pockets in the inside, along with two open pockets for phone, keys, etc. \nMaterial:\nFaux Leather\nApprox measurements:\nWidth 45cm\nHeight 28cm\nDepth 23cm', '2023-12-08 12:17:17', '2023-12-08 12:17:17'),
(1831, 'Sparkly Knitted Jumper', 'AMBER-002', 19, 1, 'Sparkly Knitted Jumper. Sparkle your wardrobe this winter with this fabulous jumper! Team up with a pair of jeans and a lovely pair of chunky boots, finishing with a floppy hat for that ultimate look! Key features include sequin detail, long sleeves and a round neck. \nMaterial:\n48% Polyester\n51% Acrylic\n1% Metallic Yarn \nApprox measurements for size UK 8:\nChest across one side 47cm\nLength from shoulder to hem 62cm', '2023-12-08 12:17:18', '2023-12-08 12:17:18'),
(1832, 'Long Knitted Cardigan With Open Front', 'ADDIE-002', 0, 0, 'Long Knitted Cardigan With Open Front. This fabulous knitted cardigan will keep you extra warm this winter! Simply team up with a t-shirt, a pair of warm leggings and a lovely pair of pumps! Key features include a open front, two side pockets and long sleeves.\nMaterial:\n100% Acrylic\nApprox measurements for size UK 6-8:\nChest across one side 47cm\nLength from shoulder to hem 95cm', '2023-12-08 12:17:26', '2023-12-08 12:17:26'),
(1833, 'Cable Knitted Cardigan', 'ADELIA-002', 0, 0, 'Cable Knitted Cardigan. What more can you want other then this fabulous knitted cardigan! Perfect for an evening with your loved ones! Simple team up with a gorgeous dress, tights and a pair of pumps! Key features include waffle design on the sleeves and on the back, V-neck, cable design down the front, it has 4 buttons on the front with two side pockets. Available in Blue and Grey! \nMaterial:\n90% Acrylic\n10% Wool\nApprox measurements for size UK 8:\nChest on one side 55cm\nLength from shoulder to hem 77cm', '2023-12-08 12:17:28', '2023-12-08 12:17:28'),
(1834, 'Long Knitted Cardigan', 'BELLA-002', 0, 0, 'Long Knitted Cardigan. Update your winter wardrobe this season with this luxury long knitted cardigan! Simply team up with a t-shirt, jeans and a lovely pair of long knee boots! Key features include a open front, two side pockets and long sleeves. Available in 3 colours! Hurry and get this fabulous cardigan for just under £5!\nMaterial:\n100% Acrylic\nApprox measurements for sizeUK 6/8:\nChest on one side 46cm\nLength from shoulder to hem 90cm', '2023-12-08 12:17:32', '2023-12-08 12:17:32'),
(1835, 'Cable Design Knitted Jumper', 'ARIEL-002', 10, 1, 'Cable Design Knitted Jumper. This fabulous jumper will keep you extra warm this season! Simply team up with a pair of jeans, lovely pair of shoes, and a over-the-shoulder bag for that ultimate look! Key features include cable design, long sleeves and a round neck. \nMaterial:\n90% Acrylic\n10% Wool \nApprox measurements for size UK 8:\nChest on one side 42cm\nLength from shoulder to hem 64cm', '2023-12-08 12:17:35', '2023-12-08 12:17:35'),
(1836, 'Knitted Jumper With Cable Design', 'ROSEMARY-002', 0, 0, 'Knitted Jumper With Cable Design. Why not treat yourself to this fabulous knitted jumper! Perfect for a day at the mall! Simply team up with a skirt of your choice and a lovely pair of Chelsea boots! Key features include cable design, long sleeves, round neck and is light fitted. \nMaterial:\n100% Acrylic\nApprox measurements for size Small:\nChest across one side 50cm\nLength from shoulder to hem 70cm', '2023-12-08 12:17:41', '2023-12-08 12:17:41'),
(1837, 'Knitted Jumper Dress', 'RICKI-002', 0, 0, 'Knitted Jumper Dress. Update your winter wardrobe with this fabulous knitted jumper dress! Team up with thick tights and a pretty pair of shoes! Key features include turtle neck, short sleeves and cable design at the front. Available in 3 colours! \nMaterial:\n100% Acrylic\nApprox measurements for size Small:\nChest across one side 42cm\nLength from shoulder to hem, Front: 78cm Back: 82cm', '2023-12-08 12:17:43', '2023-12-08 12:17:43'),
(1838, 'Knitted Jumper With Front Zip', 'HAZEL-002', 0, 0, 'Knitted Jumper With Front Zip. Keep warm this winter in this gorgeous knitted jumper with front zip, available in black and coral. Key features include long sleeves, round neck with front zip. Perfect with skinny jeans and Chelsea boots! \nMaterial:\n100% Acrylic\nApprox measurements for Size UK10:\nChest across one side: 38cm\nLength from shoulder to hem 63cm', '2023-12-08 12:17:44', '2023-12-08 12:17:44'),
(1839, '3/4 Sleeve Stripy Pattern Jumper', '10379-002', 78, 1, '3/4 Sleeve Stripy Pattern Jumper. Refresh your winter wardrobe with this gorgeous jumper! Perfect for a day at the mall with the girls! Key features include round neck, a button on each side of the shoulders, two side pockets, fold up sleeve with cable design.\nMaterial:\n100% Acrylic\nApproximate measurements for the size XLarge:\nChest: 53cm \nTotal length (Shoulder to hem) : 68cm', '2023-12-08 12:17:51', '2023-12-08 12:17:51');
