(1840, 'Waffle Design Knitted Jumper PLUS SIZE AVAILABLE', 'LOGAN-002', 0, 0, 'Waffle Design Knitted Jumper PLUS SIZE AVAILABLE. Update your wardrobe this season with this fabulous knitted jumper! Perfect for a evening out with your loved one! Simply team up with skinny jeans and a lovely pair of pumps! Key features include waffle design, round neck and long sleeves. \nMaterial:\n100% Acrylic\nApprox measurements for size UK 10:\nChest across one side 47cm\nLength from shoulder to hem 69cm', '2023-12-08 12:17:53', '2023-12-08 12:17:53'),
(1841, 'Knitted Cardigan With Hood', 'ALENA-002', 0, 0, 'Knitted Cardigan With Hood. Refresh your wardrobe this season with this fabulous knitted cardigan! Perfect for a date with your loved one! Key features include a hood with cable design on the inside, one button on the top of the cardigan, cable design on the inside of the cardigan and with two side pockets.\nMaterial:\n100% Acrylic\nApprox measurements for size Small:\nChest across one side 43cm\nLength from shoulder to hem 69cm', '2023-12-08 12:17:56', '2023-12-08 12:17:56'),
(1842, 'Knitted Cardigan With Waterfall Front PLUS SIZE AVAILABLE', 'LINDY-002', 0, 0, 'Knitted Cardigan With Waterfall Front. Update your winter wardrobe with this beautiful knitted cardigan! Team up with a long sleeve t-shirt, skater skirt and a lovely pair of knee high boots! Perfect for a day at the mall with the girls! Key features include long sleeve, cable design and a waterfall collar.\nMaterial:\n100% Acrylic \nApprox measurements for size a small:\nChest across one side 40cm\nLength from shoulder to hem 100cm', '2023-12-08 12:17:59', '2023-12-08 12:17:59'),
(1843, 'Camel Calf Boots with Buckle Detail', '316-001', 0, 0, 'Camel Calf Boots with Buckle Detail. These boots have a pointed toe, a buckle across the front and a metal ring on the side at the top. There is a zip on the inside to fit easily. The top is wide for a comfy fit. The sole is textured for gripping. This is a good quality boot. and fantastic value at £7.99!\nMaterial:\nSynthetic Leather\nApprox measurements for a UK size 4:\nLength from ankle up 30cm\nWidth at the calf 18cm\nHeel 4cm', '2023-12-08 12:18:06', '2023-12-08 12:18:06'),
(1844, 'Calf Boots with Ankle Detail', '792-001', 0, 0, 'Calf Boots with Ankle Detail. These heeled boots have a strap and metal detail around the ankle. There is an inside zip for easy access. The sole has a grip on the bottom. Available in camel, brown and black. Super quality boots. \nMaterial:\nSynthetic Leather\nApprox measurements for a UK size 4:\nHeel 7.5cm\nAnkle to top at calf 27cm\nWidth at calf 17.5cm on one side', '2023-12-08 12:18:08', '2023-12-08 12:18:08'),
(1845, 'Ankle Boots with Stirrup Detail', '186-001', 465, 1, 'Ankle Boots with Stirrup Detail. These stunning boots are of excellent quality and a bargain for £6.99. They have a stirrup detail around the ankle with a metal chain on the back of the heel. There is a zip on the inside ankle for easy access. The heel is wood effect and the sole gripped for comfortable wearing. For the lighter brown colour please order \'coffee\'. Available in brown and black too. \nMaterial:\nSynthetic Leather\nApprox measurements for a UK size 4:\nHeel 8cm\nTop of boot 13cm', '2023-12-08 12:18:12', '2023-12-08 12:18:12'),
(1846, 'Riding Style Boots with Buckle Detail', 'B951-001', 0, 0, 'Riding Style Boots with Buckle Detail. These boots have a faux suede section on the leg and a buckle detail on the ankle. The tops are wide for a comfy fit. There is an inside leg zip for easy access. The sole is textured for extra grip. Gorgeous boots and a must have in any wardrobe!\nMaterial:\nFaux Suede and Synthetic Leather\nApprox measurements for a UK szie 4:\nHeel 4cm\nLength from ankle to top 36cm\nWidth at top 18cm on one side', '2023-12-08 12:18:16', '2023-12-08 12:18:16'),
(1847, 'High Neck Button Detail Coat SPECIAL BUY', 'EDWINA-001', 0, 0, 'High Neck Button Detail Coat. This quality coat is fully lined. It has a high neck that can be done up or left open as a collar. The opening is one line of buttons but there is a second line for decoration. The coat has panels all round. There is a tie belt which can be taken off if not needed. There are shoulder tabs with buttons and a wide cuff with four buttons on. There is a back split. Available in grey and dark navy.This coat is a special buy and has limited stock so don\'t be disappointed, order today! Please bear in mind that they may be delivered creased due to the packaging. PLEASE NOTE THAT WE RECOMMEND ORDERING ONE SIZE SMALLER THAN YOUR USUAL SIZE AS THESE COATS ARE QUITE ROOMY.  \nModel is wearing a size Small\nMaterial\nWool 40%\nMixed fibers 60%\nApprox measurements for a size small\nChest across one side 46cm\nLength from shoulder to hem 90cm', '2023-12-08 12:18:20', '2023-12-08 12:18:20'),
(1848, 'Fleece Lined Baggy Sweatshirt', 'EMERALD-001', 0, 0, 'Fleece Lined Baggy Sweatshirt. This sweatshirt will keep you warm! It has \'Cool Story Bro, tell it again\' printed on the front. It has a round neck. There is ribbing on the neck, cuffs and hem. Available in grey, black and burgundy. Great with jeans or leggings.\nModel is wearing a size S/M.\nMaterial:\n50% Cotton, 50% Polyester\nApprox measurements for size S/M:\nChest across one side 50cm\nLength from shoulder to hem 65cm', '2023-12-08 12:18:22', '2023-12-08 12:18:22'),
(1849, 'Black and White Cropped Top', 'BERYL-001', 3, 1, 'Black and White Cropped Top. This striped top has a round neck and long sleeves. Fabulous top to wear with jeans, leggings or a skirt. Great value for £4.99!\nModel is wearing size S/M.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a size S/M:\nChest across one side 40cm\nLength from shoulder to hem 38cm', '2023-12-08 12:18:24', '2023-12-08 12:18:24'),
(1850, 'Short Sleeved Flower Print Top', 'ELVIRA-001', 0, 0, 'Short Sleeved Flower Print Top. This short top would look great with jeans, leggings or a skirt. It has a round neck and short sleeves. It has a tropical flower print in pink and lavender. Fabulous for under £5!\nModel is wearing a size S/M.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a size S/M:\nChest across one side 38cm\nLength from shoulder to hem 44cm', '2023-12-08 12:18:26', '2023-12-08 12:18:26'),
(1851, 'Long Chunky Knit Cardigan with Pockets PLUS SIZES AVAILABLE', 'CELINA-001', 0, 0, 'Long Chunky Knit Cardigan with Pockets. This loose fitting cardigan has an open front with a ribbed edging. There are two deep pockets on the front too. Available in 3 colours and sizes UK 6-20. Great to keep you warm this winter. Match with a pair of jeans or leggings to complete your outfit. This item is ex branded and may therefore have the labels cut. \nModel wears size UK 6-8.\nMaterial:\n100% Acrylic\nApprox measurements for a UK size 6-8:\nChest across one side 48cm\nLength from shoulder to hem 102cm', '2023-12-08 12:18:27', '2023-12-08 12:18:27'),
(1852, 'Cream Cable Knit Jumper', 'EMBER-001', 0, 0, 'Cream Cable Knit Jumper. This quality jumper has a roll neck. It has a cable design on the front and ribbing on the cuffs and hem. Team up with jeans or leggings for a perfect look. A fabulous jumper and only £4.99!\nModel wears size UK 10/12\nMaterial:\n52% Cotton, 48% Polyacrylic\nApprox measurements for size UK 10/12:\nChest across one side 42cm\nLength from shoulder to hem 70cm', '2023-12-08 12:18:31', '2023-12-08 12:18:31'),
(1853, 'Bodycon Pencil Skirt', 'KATLYN-001', 29, 1, 'Bodycon Pencil Skirt. This stretchy skirt has an elastic waist in black for a comfy fit. It is available in 4 colours and 2 sizes. Choose one our many blouses or little tops to match with this skirt and complete your outfit for under £10!\nModel wears size S/M.\nMaterial:\n90% Polyester\n10% Elastane\nApprox measurements for s size S/M:\nWaist on one side 34cm stretching to 44cm\nLength from top of waistband to hem 64cm', '2023-12-08 12:18:33', '2023-12-08 12:18:33'),
(1854, 'Teal Patterned Bodycon Dress', 'TEGAN-001', 0, 0, 'Teal Patterned Bodycon Dress. This dress has a round neck and capped sleeves. There is gold sparkle in the pattern too. It is stretchy for a perfect fit. Great for a night out or a party! \nModel wears size S/M.\nMaterial:\n95% Viscose\n5% Elastane\nApprox measurements for a size S/M:\nChest across one side 38cm\nLength from shoulder to hem 100cm', '2023-12-08 12:18:36', '2023-12-08 12:18:36'),
(1855, 'Cowl Neck Dipped Hem Chunky Long Jumper PLUS SIZES AVAILABLE', 'STARLA-001', 0, 0, 'Cowl Neck Dipped Hem Chunky Long Jumper. This chunky jumper has a cowl neck and raglan sleeves. There are side splits and the back hem is dipped. There is a pattern on the front at the bottom. Great to wear with jeans or leggings, complete your outfit for under £10. \nModel wears a UK size 8.\nMaterial:\n100% Acrylic\nApprox measurements for a UK size 8:\nChest across one side 40cm\nLength from shoulder to hem 75cm at the front, 82cm at the back', '2023-12-08 12:18:37', '2023-12-08 12:18:37'),
(1856, 'Chunky Knit Cable Cardigan', 'LILLY-001', 0, 0, 'Chunky Knit Cable Cardigan. This cardigan has a high neck with ribbed collar. It has six leather look buttons on the front and two deep pockets. This is a very warm cardigan and would look great with jeans or leggings. Fabulous for under £5!\nModel is wearing a size Small.\nMaterial:\n100% Acrylic\nApprox measurements for a size small:\nChest across one side 44cm\nLength from shoulder to hem 65cm', '2023-12-08 12:18:43', '2023-12-08 12:18:43'),
(1857, 'Buckle Detail Double Zip Ankle Boot', '852-001', 3, 1, 'Buckle Detail Double Zip Ankle Boot. This quality boot has a strap and buckle across the front and an ankle strap with studs on. There is a zip on the outside for decoration and a zip on the inside for easy access. The sole is gripped and there is a chunky heel. A fabulous boot for this winter. Available in 3 colours. \nMaterial:\nSynthetic Leather\nApprox measurements:\nHeel 5cm', '2023-12-08 12:18:47', '2023-12-08 12:18:47'),
(1858, 'Soft Pull On Calf Boots', '629-001', 2, 1, 'Soft Pull On Calf Boots. These boots are virtually flat with a textured sole for grip. They are wrinkled at the ankle and are slightly higher at the front than the back with three studs on the side. The toe is rounded and they are very comfortable. The lighter colour is Taupe.\nMaterial:\nSynthetic Leather\nApprox measurements:\nThey are mainly flat with a very slight heel of 0.5cm\nLength from ankle to top 25cm', '2023-12-08 12:18:51', '2023-12-08 12:18:51'),
(1859, 'Wedge Boots with Quilt Detail', '747-001', 0, 0, 'Wedge Boots with Quilt Detail. These stylish wedge boots are pull on. They have a turnover cuff at the top and the back of the ankle is quilted. The toes are pointed.  Available in black and taupe. The sole is textured for gripping. \nMaterial:\nSynthetic Leather\nApprox measurements:\nHeel 9.5cm\nLength from ankle to top 11cm', '2023-12-08 12:18:54', '2023-12-08 12:18:54'),
(1860, 'Buckle Detail Biker Style Boots', '927-001', 58, 1, 'Buckle Detail Biker Style Boots. These biker style boots are of excellent quality. They have a strap detail with a buckle on the side. There is a zip for easy access and a little pull tag at the back. They come in black, brown and coffee (the lighter brown) colours. The sole has an excellent grip for the bad weather. \nMaterial:\nSynthetic Leather\nApprox measurements:\nHeel 4cm, platform 1.5cm\nLength from ankle to top 13cm', '2023-12-08 12:18:58', '2023-12-08 12:18:58'),
(1861, 'Metallic Stirrup Ankle Boot', '202-001', 20, 1, 'Metallic Stirrup Ankle Boot. These gorgeous boots have a metallic stirrup at the back and two buckle straps around the ankle. There is a zip fastening and a small pull at the back. The toe is rounded and the sole is textured for gripping. Available in black and brown.\nMaterial:\nSynthetic Leather.\nApprox measurements:\nHeel 5cm\nLength from ankle to top 9cm', '2023-12-08 12:19:02', '2023-12-08 12:19:02'),
(1862, 'Gold Flower Design Bodycon Dress', 'ELISA-002', 0, 0, 'Gold Flower Design Bodycon Dress. This fabulous dress is elegant and romantic! Perfect for a date with your loved one! Simply team up with a lovely pair of court heels and a clutch bag for the finishing touch. Key features include slightly elasticated material, high neck with no sleeves. Hurry up and get this beautiful dress for only £5.99!\nMaterial:\n95% Polyester\n5% Elastane\nApproximate measurements for a size UK S/M:\nChest: 39cm\nTotal length(Shoulder to hem): 84cm', '2023-12-08 12:19:06', '2023-12-08 12:19:06'),
(1863, 'Wet Look Pencil Skirt', 'TANISHA-002', 0, 0, 'Wet Look Pencil Skirt. This elegant skirt is perfect for an evening out to a fancy restaurant with your loved on! Simply team up with a crop top, a lovely pair of high heels and a clutch bag for that finishing touch! Key features include midi length, elasticated waist and figure hugging! Hurry up and get this fabulous skirt for only £4.99! \nMaterial:\n95% Polyester\n5% Elastane\nApproximate measurements for a size UK S/M:\nWaist: 33cm\nTotal length (Waist to hem): 73cm', '2023-12-08 12:19:07', '2023-12-08 12:19:07'),
(1864, 'Square Pattern Swing Dress', 'TAYLOR-002', 0, 0, 'Square Pattern Swing Dress. This glamorous swing dress will defiantly bring out the sixties chic look! Simply team up with a pair of gorgeous high knee boots and a fedora hat for that ultimate look! Perfect for a date with your loved one! Key features include round neck, long sleeve and loose fitted. \nMaterial:\n95% Viscose \n5% Elastane\nApprox measurements for a size UK S/M:\nChest across one side 39cm\nLength from shoulder to hem 88cm', '2023-12-08 12:19:10', '2023-12-08 12:19:10'),
(1865, 'Black Bodycon Wet Look Dress', 'BECCY-002', 0, 0, 'Black Bodycon Wet Look Dress. This fabulous and elegant dress is perfect for a night out with the girls! Simply team up with a lovely pair of heels and a over shoulder bag to complete to look! Key features include a round neck at the front and V-neck at the back, crossover split with a wet look design in the middle. Available in one size (8-12)\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a one size(8-12):\nChest across one side 41cm\nLength from shoulder to hem 89cm', '2023-12-08 12:19:11', '2023-12-08 12:19:11'),
(1866, 'Black Bodycon Dress With Sparkle Panel Design', 'KASSIDY-002', 0, 0, 'Black Bodycon Dress With Sparkle Panel Design. This gorgeous dress with make you sparkle on the dance floor! Simply team up with a lovely pair of court heel shoes and a clutch bag  for that ultimate look! Key features include a round neck at the front with a low back. Hurry up and get this glamorous dress for only under £10! \nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a size S/M - UK (8-10):\nChest across one side 40cm\nLength from shoulder to hem 91cm', '2023-12-08 12:19:12', '2023-12-08 12:19:12'),
(1867, 'Sparkly Bodycon Dress With Lace Sleeves', 'MILLY-002', 1, 1, 'Sparkly Bodycon Dress With Lace Sleeves. This gorgeous sparkly bodycon dress is perfect for a night down town with the girls! Simply team up with a fabulous pair of heels and a clutch bag for that ultimate look! Key features include lace sleeves with a lace back, round neck with a black and white design at the front. Available in two sizes! \nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a size UK 10:\nChest across one side 40cm\nLength from shoulder to hem 94cm', '2023-12-08 12:19:13', '2023-12-08 12:19:13'),
(1868, 'Checked Swing Dress', 'KARIN-002', 0, 0, 'Checked Swing Dress. Update your wardrobe this season with this fabulous checked swing dress! Simply team up with a gorgeous pair of high knee boots and a bowler hat! Perfect for a evening at a restaurant with family and friends! Key features include a round neck, loose fitting with long sleeves. \nMaterial:\n95% Viscose\n5% Elastane\nApprox measurements for a size S/M - UK (8-10):\nChest across one side 43cm\nLength from shoulder to hem 86cm', '2023-12-08 12:19:15', '2023-12-08 12:19:15'),
(1869, 'Burgundy Checked Swing Dress', 'TAMARA-002', 0, 0, 'Burgundy Checked Swing Dress. This gorgeous swing dress totally brings out the sixties chic look! Simply team up with a lovely pair of boots and a bowler hat to complete the look! Key features include a round neck, loose fit with long sleeves. \nMaterial:\n95% Viscose\n5% Elastane\nApprox measurements for a size UK 6:\nChest across one side 40cm\nLength from shoulder to hem 90cm', '2023-12-08 12:19:16', '2023-12-08 12:19:16'),
(1870, 'Long Sleeve Swing Dress', 'EMILIA-002', 0, 0, 'Long Sleeve Swing Dress. Update your wardrobe this season with this fabulous swing dress! Perfect for a evening out with your family and friends! Simply team up with a lovely pair of boots, a long cardigan and a shoulder bag to complete the look! Key features include long sleeves, round neck with a loose fit! Available in four colours! Hurry up and get this beautiful dress for only £5.99!\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a size S/M - UK (8-10):\nChest across one side 39cm\nLength from shoulder to hem 87cm', '2023-12-08 12:19:18', '2023-12-08 12:19:18'),
(1871, 'Open Front Long Jacket', 'TAMRA-002', 0, 0, 'Open Front Long Jacket. This fabulous jacket is perfect for a day at the mall with the girls! Simply team up with a t-shirt, jeans and a lovely pair of boots! Key features include light weight, open front, long sleeves, two side pockets with a square design. Hurry up and get this gorgeous jacket for only £5.99!\nMaterial:\n95% Polyester\n5% Elastane\nApproximate measurements for Size UK 8:\nChest: 46cm\nTotal length (Shoulder to hem): 89cm', '2023-12-08 12:19:20', '2023-12-08 12:19:20'),
