(1918, 'Long Denim Tunic', 'VILLEARA-001', 0, 0, 'Long Denim Tunic. This shirt style tunic has two breast pockets with buttons. The sleeves can be rolled up and buttoned with a tab. Could be worn on its own, with leggings and a belt too. \nModel is wearing a size medium.\nMaterial:\n100% Cotton\nApprox measurements for size medium:\nChest across one side 44cm\nLength from shoulder to hem 85cm', '2023-12-08 12:21:19', '2023-12-08 12:21:19'),
(1919, 'Plunge Neckline Jumpsuit Ex Branded', 'RHEA-001', 0, 0, 'Plunge Neckline Jumpsuit. The front neckline is wired to give a good shape. There are thin adjustable straps and an elasticated back for extra comfort. The material is slightly stretchy to give a perfect fit. This jump suit is ex branded and may therefore have the labels cut. The material has a crepe texture and feel.\nModel is wearing a UK size 8.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for UK size 8:\nChest across one side 33cm\nLength from bust to crutch is 61cm and total length from bust to ankle is 126cm', '2023-12-08 12:21:20', '2023-12-08 12:21:20'),
(1920, 'Fully Lined Animal Print Stretchy Dress with Belt', 'KAYE-001', 15, 1, 'Fully Lined Animal Print Stretchy Dress with Belt. This dress has a round neck and long sleeves. It is fully lined and comes with a studded buckle belt. The material is stretchy for a perfect fit. This is a quality dress and would be a great addition to anyone\'s wardrobe! Team up with one of our blazers and a clutch bag or handbag. \nModel is wearing a UK size 8.\nMaterial:\n100% Polyester\nApprox measurements for a UK size 8:\nChest across one side 40cm\nLength from shoulder to hem 101cm', '2023-12-08 12:21:23', '2023-12-08 12:21:23'),
(1921, 'Stylish Shirt Dress Ex Branded Available in Plus Sizes', 'KALIA-001', 0, 0, 'Stylish Shirt Dress Ex Branded Available in Plus Sizes. This shirt dress has a collar and long sleeves. It has a flared skirt and would also look great with a belt. The material has a crepe feel. It is ex branded and may therefore have the labels cut. You could also team up with a pair of leggings.\nModel is wearing a UK size 8.\nMaterial:\n97% Polyester\n3% Elastane\nApprox measurements for a UK size 8:\nChest across one side 41cm\nLength from shoulder to hem 86cm', '2023-12-08 12:21:25', '2023-12-08 12:21:25'),
