(1927, 'Sequined Jumper with Zipped Back Detail', 'BRONWEN-001', 11, 1, 'Sequined Jumper with Zipped Back Detail. This jumper has a round neck. The cuffs, hem and neck are ribbed. There is a full opening zip down the back. The back hem is slightly dipped. The black is flecked with silver thread and has silver sequins. The burgundy and cream have contrasting colour sequins. \nModel is wearing a size Small.\nMaterial:\n100% Acrylic\nApprox measurements for size Small:\nChest across one side 41cm\nLength from shoulder to hem 60cm', '2023-12-08 12:21:41', '2023-12-08 12:21:41'),
