(2009, 'Union Jack Soft Faux Leather Holdall', '341-33-001', 0, 0, 'Union Jack Soft Faux Leather Holdall. This large holdall has two canvas grab handles with faux leather middles and a detachable, adjustable shoulder strap. There are two zipped small side pockets on the outside for phone and keys etc and one on the back too. There is a zipped pocket and a zipped compartment inside plus two open pockets. Ideal for the gym, a weekend away or a cabin bag. Available in navy and black/navy. Very versatile and stylish holdall. \nMaterial:\nSynthetic Leather\nApprox measurements:\nLength 48cm\nHeight 35cm\nWidth 22cm', '2023-12-08 12:24:22', '2023-12-08 12:24:22'),
(2010, 'Magazine Print Clutch Bag with Buckle Detail', '4608-001', 6, 1, 'Magazine Print Clutch Bag with Buckle Detail. This gorgeous clutch bag has magazine cover photos all over. It has a buckle design on the front flap and a magnetic clasp. It has an inside pocket and a detachable chain shoulder strap. This is a stunning clutch bag. Order yours quickly as very limited stock on this item.\nMaterial:\nFaux Leather\nApprox Measurements:\nLength 26cm\nHeight 13cm\nWidth 5cm', '2023-12-08 12:24:23', '2023-12-08 12:24:23'),
(2011, 'Gathered Satin Feel Clutch Bag with Diamante Detail', 'L13286-1-001', 0, 0, 'Gathered Satin Feel Clutch Bag with Diamante Detail. This stunning clutch bag has a detachable chain shoulder strap. It has an internal pocket. There is a diamante design all the way round the middle of the bag making it almost look like a giant bow. Very pretty bag. \nApprox measurements:\nLength 27cm\nHeight 12cm\nWidth 5cm', '2023-12-08 12:24:25', '2023-12-08 12:24:25'),
(2012, 'Satin Feel Clutch Bag with Diamante Design', '0591-001', 0, 0, 'Satin Feel Clutch Bag with Diamante Design. This pretty clutch bag has a diamante and faux pearl design on the front opening flap. It has a scalloped edge and a magnetic fastening. There is a detachable chain shoulder strap and a small inside pocket. Available in khaki brown and fuchsia.\nMaterial:\n100% Polyester\nApprox measurements:\nLength 26cm\nHeight 12cm\nWidth 5cm', '2023-12-08 12:24:26', '2023-12-08 12:24:26'),
(2013, 'Diamante Clutch Bag with Clip Top Detail', '008-001', 0, 0, 'Diamante Clutch Bag with Clip Top Detail. This sweet little bag would make a lovely addition to anyone\'s wardrobe. It has full diamante front detail and black stones around the opening frame too. The back is plain silver faux leather. The fastening clip has a black and crystal effect top. There is a detachable shoulder chain. It has an inside pocket to slip your phone into. \nApprox measurements:\nLength 20cm across the bottom\nHeight 9cm\nWidth 3cm', '2023-12-08 12:24:27', '2023-12-08 12:24:27'),
(2014, 'Large Box Magazine Print Clutch Bag', '00043-001', 0, 0, 'Large Box Magazine Print Clutch Bag. This rectangular box clutch has a magazine print all over. It has a metal trim and a clasp that lifts to open. There is a detachable shoulder chain and an inside pocket. Available in red/multi and brown colours. A fabulous bag. Available in smaller size too.\nMaterial:\n100% PU\nApprox measurements:\nLength 28cm\nHeight 14cm\nWidth 3cm', '2023-12-08 12:24:28', '2023-12-08 12:24:28'),
(2015, 'Black Faux Leather Backpack', 'MY034-002', 0, 0, 'Black Faux Leather Backpack. Pack up all of your essentials into this adorable black faux leather backpack. A range of pockets are found in the inside and exterior, accompanied by slots for pens, cards and a phone. Finished with a buckle closure and fully adjustable straps. It has pearl details on the front flap and also on the two front pockets. You also have the option to have it as a backpack or as a carrier bag. \nMaterial:\nFaux Leather\nApprox measurements:\nLength 40cm\nHeight 37cm\nWidth 33cm at the bottom', '2023-12-08 12:24:29', '2023-12-08 12:24:29'),
(2016, 'Magazine Print Box Clutch Bag', '00042-001', 0, 0, 'Magazine Print Box Clutch Bag. This rectangular box clutch has magazine prints all over. It has a metal trim and a clasp that lifts to open.There is a detachable shoulder chain and an inside pocket. A fabulous bag. Available in larger sizes too.\nMaterial:\n100% PU\nApprox measurements:\nLength 20.5cm\nHeight 12.5cm\nWidth 3cm', '2023-12-08 12:24:30', '2023-12-08 12:24:30');
