(2017, 'Floral Barrel Bag with Cut Out Design', 'MY1318B-001', 0, 0, 'Floral Barrel Bag with Cut Out Design. This shiny floral barrel bag has two grab handles and a detachable, adjustable shoulder strap. It has a cut out design from the handles to the zip. The bag has an inside zipped pocket and two open pockets. There are studs on the bottom to protect the bag when put down.  \nMaterial:\n100% PU\nApprox measurements:\nLength 29cm\nHeight 23cm\nWidth 16cm', '2023-12-08 12:24:31', '2023-12-08 12:24:31'),
(2018, 'Elegant Satchel Handbag', 'MY418-002', 0, 0, 'Elegant Satchel handbag. Grab this gorgeous satchel for only £6.99! It has a detachable, adjustable shoulder strap. Along with a outer compartment at the back of the bag with two inside pockets, ideally for cards and mobile devices. It also has a zipped pocket in the side. Available in 4 colours! \nMaterial:\nFaux Leather\nApprox measurements:\nWidth 27cm\nHeight 22cm\nDepth 13cm', '2023-12-08 12:24:32', '2023-12-08 12:24:32'),
(2019, 'Two Tone Satchel Bag', 'MY2802-001', 0, 0, 'Two Tone Satchel Bag. This satchel bag has an adjustable shoulder strap. It has a front compartment and a window for name etc. There are magnetic fasteners under the buckles. This satchel has a top zip for extra security, an inside zipped pocket and two open pockets. Great for a school bag or an everyday handbag. \nMaterial:\nSynthetic Leather\nApprox measurements:\nLength 33cm\nHeight 23cm\nWidth 9cm', '2023-12-08 12:24:33', '2023-12-08 12:24:33'),
(2020, 'Patent Satchel Style Floral Handbag', 'MY475-001', 0, 0, 'Patent Satchel Style Floral Handbag. This bag has a grab handle and a detachable, adjustable shoulder strap. It has two hidden magnetic fasteners. There is an internal zipped pocket and two open ones too. The opening flap has a metal strip. There are four studs on the base to protect the bottom when putting the bag down. Choose black for the design that has pink flowers and white for the orange flowers. Also available in turquoise.  \nMaterial:\n100% PU\nApprox measurements:\nLength 26cm\nHeight 24cm\nWidth 10cm', '2023-12-08 12:24:34', '2023-12-08 12:24:34'),
(2021, 'Faux Leather Backpack', 'MY297-002', 0, 0, 'Faux Leather Backpack. Travel in style with this faux leather backpack, available in black and red. Key features include a magnetic fastener, pink lining, completed with outer and inner compartments to keep all your valuables safe! Perfect for work, school or a trip away!\nMaterial:\nFaux Leather\nApproximate measurements:\nHeight: 36cm\nWidth: 27cm\nDepth: 12cm', '2023-12-08 12:24:36', '2023-12-08 12:24:36'),
(2022, 'Heart Design Satchel Bag', 'MY280-001', 0, 0, 'Heart Design Satchel Bag. This satchel bag has an adjustable shoulder strap. It has a front compartment and a window for name etc. There are magnetic fasteners under the buckles. This satchel has a top zip for extra security, an inside zipped pocket and two open pockets. There are metal corners on the flap. Great for a school bag or an everyday handbag. \nMaterial:\nSynthetic Leather\nApprox measurements:\nLength 33cm\nHeight 25cm\nWidth 10cm', '2023-12-08 12:24:37', '2023-12-08 12:24:37'),
(2023, 'Cerise Heart Design Satchel Bag', 'MY280B1', 0, 0, 'Cerise Heart Design Satchel Bag.  This satchel bag has an adjustable shoulder strap. It has a front compartment and a window for name etc. There are magnetic fasteners under the buckles. This satchel has a top zip for extra security, an inside zipped pocket and two open pockets. There are metal corners on the flap. Great for a school bag or an everyday handbag. \nMaterial:\nSynthetic Leather\nApprox measurements:\nLength 33cm\nHeight 25cm\nWidth 10cm', '2023-12-08 12:24:39', '2023-12-08 12:24:39'),
(2024, 'Large Shopper Bag', 'MY286-001', 0, 0, 'Large Shopper Bag. This shopper bag is made of soft synthetic leather. It has two grab handles and a twist clasp at the top. It has a full top zip for extra security. There is an adjustable, detachable shoulder strap. There is a zipped pocket and two open ones inside. There are four studs on the bottom to protect the bag when put down. Plenty of room in this quality handbag. Available in three colours. \nMaterial:\nSynthetic Leather\nApprox measurements:\nLength 39cm\nHeight 37cm\nWidth 19cm', '2023-12-08 12:24:40', '2023-12-08 12:24:40'),
(2025, 'Mini Faux Leather Flower Handbag', '8134-002', 10, 1, 'Mini Faux Leather Flower Handbag. This bag is a must have! Available in yellow, orange, green, beige and fuchsia neon colours! Key features include double faux leather handles, detachable shoulder strap, magnetic fastener, completed with outer and inner compartments to store all your valuables! Perfect to brighten up your outfit! \nMaterial:\nFaux Leather\nApproximate measurements:\nHeight: 25cm\nWidth: 30cm\nDepth: 10cm', '2023-12-08 12:24:41', '2023-12-08 12:24:41'),
(2026, 'Faux Leather Flower Handbag', '8134W-002', 0, 0, 'Faux Leather Flower Handbag. This bag is a must have! Available in black, bronze, burgundy and camel! Key features include double faux leather handles, detachable shoulder strap, magnetic fastener, completed with outer and inner compartments to store all your valuables! Perfect for any occasion! \nMaterial:\nFaux Leather\nApproximate measurements:\nHeight: 32cm\nWidth: 29cm\nDepth: 12cm', '2023-12-08 12:24:43', '2023-12-08 12:24:43'),
(2027, 'Butterfly Detail Stylish Handbag', 'MY046-001', 0, 0, 'Butterfly Detail Stylish Handbag. This handbag has a twist clasp detail at the front. It has butterflies studded onto the front of the bag. There is a tab with a key inside. The top has a full zip and there are two grab handles. There is a zipped inside pocket and two open ones. There are four studs on the base to protect the bottom when setting down.\nAvailable in four colours.\nMaterial:\nSynthetic Leather\nApprox measurements:\nLength 37cm\nHeight 30cm\nWidth 17cm', '2023-12-08 12:24:45', '2023-12-08 12:24:45'),
(2028, 'Three Tone Faux Leather Handbag', 'MY312-002', 0, 0, 'Three Tone Faux Leather Handbag. This bag is a must have! At such an amazing value for only £6.99! This gorgeous bag has a zip opening at the top with a hidden zip compartment underneath the buckle detail. It has a zipped inside pocket and two open pockets for phone, keys, etc. Available in three colours! \nMaterial:\nFaux Leather\nApprox measurements:\nWidth 48cm\nHeight 34cm\nDepth 22cm', '2023-12-08 12:24:46', '2023-12-08 12:24:46'),
(2029, 'Floral Weekend Trolley Bag with Wheels', '811-001', 0, 0, 'Floral Weekend Trolley Bag with Wheels. This shiny travel holdall bag has two carrying handles. It has a zipped compartment at the bottom with a concealed expanding handle to pull the bag along on wheels. There is a full length side zip. The top opening has a full zip. There is a second zip on the top which opens almost from the bottom on one side to the other revealing a large compartment. Please order the colour according to the flower pattern. Available in five colours.\nApprox measurements:\nLength 48cm\nHeight 34cm\nWidth 23cm', '2023-12-08 12:24:48', '2023-12-08 12:24:48'),
(2030, 'Swing Dress', 'PORTIA-002', 0, 0, 'Swing Dress. This swing dress is a true day-to-night dress! Perfect for any occasion! Simply team up with ankle boots and a blazer to complete the look! Available in three colours! Hurry up ladies and grab this fabulous dress for only £5.99!\nMaterial:\n95% Viscose \n5% Elastane\nApproximate measurements for a size  S/M:\nChest: 46cm\nTotal length (Shoulder to hem): 87cm', '2023-12-08 12:24:50', '2023-12-08 12:24:50'),
(2031, 'Blue Knitted Top', 'ITPM4664-002', 21, 1, 'Blue Knitted Top. Snuggle up in style with this cosy top. Team up with a skirt, pumps and a shoulder bag to complete the ultimate look! It has a round neckline with short sleeves. Hurry up ladies and don\'t miss out on this new style! Great value for £3.99!\nMaterial:\n50% Polyester\n47% Cotton\n3% Elastane\nApproximate measurements for a size UK 8:\nChest: 37cm\nTotal length (Shoulder to hem): 57cm', '2023-12-08 12:24:52', '2023-12-08 12:24:52'),
(2032, 'Chiffon Pleated Maxi Skirt', '62', 0, 0, 'Chiffon Pleated Maxi Skirt. This maxi skirt is a holiday essential! It is available in coral, black, beige, mint, navy, white and peach! Key features include a floor length design, elasticated waist, completed with sequin detail to add the perfect finishing touch!\nMaterial:\n100 Polyester\nApproximate measurements for the One Size:\nWaist: 34cm\nTotal length(Shoulder to hem): 102cm', '2023-12-08 12:24:53', '2023-12-08 12:24:53'),
(2033, 'Blue Knitted Skater Skirt', 'ISKM389-002', 34, 1, 'Blue Knitted Skater Skirt. Update your casual with this gorgeous knitted skirt! Team up with a top and ankle boots to complete the look! It has an elasticated waist  for the perfect fit. Hurry up ladies and grab this fabulous skirt for only £3.99!\nMaterial:\n50% Polyester\n47% Cotton\n3% Elastane\nApproximate measurements for a size UK 8:\nWaist: 29cm\nLength from waist to hem: 36cm', '2023-12-08 12:24:56', '2023-12-08 12:24:56'),
(2034, 'Layered Chiffon Lace Dress', 'AB374-002', 7, 1, 'Layered Chiffon Lace Dress. Lace and chiffon. A perfect combination! This gorgeous dress is a must have and available in black, peach, cream and green! Key features include a lace top with chiffon skirt. Perfect for an evening out with the girls! \nMaterial:\n100% Polyester\nApproximate measurements for Size Small:\nChest: 32cm\nTotal length(Shoulder to hem): 87cm', '2023-12-08 12:24:58', '2023-12-08 12:24:58'),
