(2036, 'Leopard Print Harem Trousers', '1505-002', 0, 0, 'Leopard Print Harem Trousers. Bring out your wild side with this fabulous harem trousers! Team up with a hair of black heels and a crop top to complete the look! It has elasticated waist and also elasticated hem with two front pockets. Don\'t miss out on these gorgeous trousers for only £4.99! \nMaterial: \n96% Polyester\n4% Elastane\nApproximate measurements for the one size - UK (8-14):\nWaist: 34cm Stretching to 54cm\nTotal Length: 102cm', '2023-12-08 12:25:06', '2023-12-08 12:25:06'),
(2037, '3/4 Sleeve Blazer With Open Front', 'ZAHRA-002', 2, 1, '3/4 Sleeve Blazer With Open Front. Update your wardrobe with this gorgeous teal blazer! Team up with a top, skinny jeans and a pair of fabulous boots to complete the look! Hurry up ladies and grab this amazing blazer for only £5.99\nMaterial:\n95% Polyester \n5% Elastane\nApprox measurements for a size UK 8:\nChest 48cm\nLength from shoulder to hem 67cm', '2023-12-08 12:25:07', '2023-12-08 12:25:07'),
(2038, 'Strappy Cami Crop Top', 'LUICIANA-002', 16, 1, 'Strappy Cami Crop Top. Finish off a variety of looks with this gorgeous cami crop top! Team up with skinny jeans and a pair of heels to complete the look! Hurry up ladies and grab this amazing quality crop top for only £4.99! Available in three colours! \nMaterial : \n95% Polyester\n5% Elastane\nApproximate measurements for a size S/M:\nChest: 33cm\nTotal length (Shoulder to hem): 40cm', '2023-12-08 12:25:09', '2023-12-08 12:25:09'),
(2039, 'Chiffon Bodycon Dress With Beaded Detail', '903-002', 0, 0, 'Chiffon Bodycon Dress With Beaded Detail. This dress is super cute and classy! It has no sleeves with a round neckline with beaded details! Team up with killer high heels and a clutch bag! Great value for only £5.99!\nMaterial:\n95% Viscose\n5% Elastane\nApprox measurements for a size Small:\nChest across one side 45cm\nLength from shoulder to hem 84cm', '2023-12-08 12:25:10', '2023-12-08 12:25:10'),
(2040, 'Cream Chiffon Blouse With Lace Detail AVAILABLE IN PLUS SIZES', 'IMELDA-002', 0, 0, 'Cream Chiffon Blouse With Lace Detail. Refresh your wardrobe with this gorgeous chiffon blouse! It has a feminine neck tie, lace detail at the back as well as on the shoulders! Team up with a smart pair of trousers, pumps and a cardigan for the ultimate smart look! Great value for only £4.99! Ex-Branded\nMaterial : \n100% Polyester\nApproximate measurements for a size UK 12:\nChest : 46cm \nTotal length (Shoulder to hem): 65cm', '2023-12-08 12:25:13', '2023-12-08 12:25:13'),
(2041, 'Lace Bodycon Dress With Faux Leather Detail', 'ab372-002', 1, 1, 'Lace Bodycon Dress With Faux Leather Detail. Stand out from the crowd and turn some heads in this lace bodycon dress with faux leather detail, available in black, white and beige. Key features include a bodycon style sleeveless design with lace and faux leather detail. Pair with heels to complete your look! \nMaterial:\n95% Polyester\n5% Elastane\nApproximate measurements for Size Small:\nChest: 38cm\nTotal length(Shoulder to hem): 87cm', '2023-12-08 12:25:15', '2023-12-08 12:25:15'),
(2042, 'Elegant Cream Top With Chiffon Sleeve AVAILABLE IN PLUS SIZES', 'ALANNAH-002', 0, 0, 'Elegant Cream Top With Chiffon Sleeves. Update your wardrobe with this gorgeous top! It has a round neckline with butterfly chiffon sleeves! Team up with black trousers and a pair of shoes to complete the look for all under £10\'s! Hurry up ladies and grab this beautiful top for only £4.99! Ex-Branded(Labels may be cut off). \nMaterial : \n95% Polyester\n5% Elastane\nApproximate measurements for a size UK 8:\nChest : 40cm \nTotal length (Shoulder to hem): 68cm', '2023-12-08 12:25:18', '2023-12-08 12:25:18'),
(2043, 'Cropped Jeggings With Back Pockets', 'GENESIS-002', 0, 0, 'Cropped Jeggings With Back Pockets. Update your wardrobe this season with these gorgeous jeggings! It has elasticated waist for the perfect fitting! Team up with a jumper and ankle boots to complete the comfy casual look! Great value for only 4.99!\nMaterials:\n81% Cotton\n14% Polyamide\n5% Elastane\nApproximate measurements for a size Small:\nWaist: 34cm\nTotal Length: 69cm', '2023-12-08 12:25:21', '2023-12-08 12:25:21'),
(2044, 'Silver Coloured Snake Wraparound Bracelet Watch', 'WTCH-SNAKE', 50, 1, 'Silver Coloured Snake Wraparound Bracelet Watch.Slither into the season with this snake like wrap around bracelet watch. Key features include a snake skin pattern on the bracelet finished with diamante for the eyes.', '2023-12-08 12:25:26', '2023-12-08 12:25:26'),
(2045, 'Wrap Around Faux Leather Diamante Watch', 'WTCH-NCONS', 44, 1, 'Wrap Around Faux Leather Diamante Watch', '2023-12-08 12:25:26', '2023-12-08 12:25:26'),
(2046, 'Faux Leather Bag With Flower Detail', '8134-1-002', 0, 0, 'Faux Leather Flower Handbag. This bag is a must have! Available in dark blue, light blue, white, turquoise, beige, light pink and mint! Key features include double faux leather grab handles, detachable, adjustable shoulder strap, magnetic fastener, completed with outer and inner compartments to store all your valuables! Perfect for any occasion! \nMaterial:\nFaux Leather\nApproximate measurements:\nHeight: 31cm\nWidth: 44cm\nDepth: 14cm', '2023-12-08 12:25:28', '2023-12-08 12:25:28'),
(2047, 'Flower Pattern Detail Backpack', 'A405-002', 0, 0, 'Flower Pattern Detail Backpack. Travel in style with this gorgeous backpack! It has a magnetic fastening, two front pockets, two inside pockets for your phone, keys, etc. It comes in two colours! Hurry up ladies and grab this fabulous bag for only £5.99!\nMaterial:\nFaux Leather\nApproximate measurements:\nHeight: 35cm\nWidth: 55cm\nDepth: 15cm', '2023-12-08 12:25:29', '2023-12-08 12:25:29'),
(2048, 'Sparkly Viscose Scarf in 6  Pastel Colours', 'ST-130-001', 54, 1, 'Sparkly Viscose Scarf in 6  Pastel Colours. This thin sparkly thread knitted scarf has a fringe and is available in silver, light green, peach, light blue, light pink and white. They all have a silver sparkle thread though them.\nMaterial:\n100% Viscose\nApprox measurements:\nLength 214cm including the fringe\nWidth 53cm', '2023-12-08 12:25:30', '2023-12-08 12:25:30'),
(2049, 'Shiny Faux Leather Handbag With Rose Pattern', 'MY033-002', 17, 1, 'Shiny Faux Leather Handbag With Rose Pattern. This beautiful handbag has a zip fastening, a zip fastening pocket on the outside and outside, with two pockets in the inside for phone, keys etc. It also comes with a strap so you have the option to have it as a shoulder bag or as a handbag. Available in 4 colours!\nMaterial:\nSynthetic Leather\nApprox measurements:\nLength: 33cm\nHeight: 27cm\nWidth: 17cm', '2023-12-08 12:25:32', '2023-12-08 12:25:32'),
(2050, 'Grey Skater Dress With Short Sleeves AVAILABLE IN PLUS SIZES', 'TAMMY-002', 0, 0, 'Grey Skater Dress With Short Sleeves. This short sleeved skater dress has a round neck and capped sleeves. The material has a stretch to give a comfy fit! Team up with ankle boots and a handbag for the ultimate look! This dress is ex-branded and may therefore have the labels cut off. Grab this gorgeous dress for only 4.99! \nMaterial:\n95% Viscose\n5% Elastane\nApprox measurements for UK size 8:\nChest on one side 40cm\nLength from shoulder to hem 81cm', '2023-12-08 12:25:33', '2023-12-08 12:25:33'),
(2051, 'Soft Touch Purple Tunic Top Available in Plus Sizes', 'TALIYAH-001', 0, 0, 'Soft Touch Purple Tunic Top Available in Plus Sizes. It has a round neck and 3/4 sleeves. The tunic is A-lined and slightly strecthy for a perfect fit. This gorgoeus purple print tunic will look great with leggings or jeans. Available in plus sizes up to UK 30/32.\nModel is wearing a UK size 16.\nMaterial:\n96% Polyester\n4% Eastane\nApprox measuremetns for a UK size 16:\nChest across one side 52cm\nLength from shoulder to hem 84cm', '2023-12-08 12:25:35', '2023-12-08 12:25:35'),
(2052, 'Paisley Dress With Diamante Detail AVAILABLE IN PLUS SIZES', 'WILHELMINA-002', 0, 0, 'Paisley Dress With Diamante Detail. Looking for a pretty dress, then look no more! This fabulous dress is perfect! It has a round neckline with diamante detail and a key hole back with a button fastening. Complete the look with black killer heels and a gorgeous handbag all for under £10\'s! Available in Black and Cerise! Hurry up ladies and grab this gorgeous dress for only £4.99!\nMaterial:\n96% Polyester\n4% Elastane\nApprox measurements for a size UK 10:\nChest on one side 42cm\nLength from shoulder to hem 84cm', '2023-12-08 12:25:37', '2023-12-08 12:25:37'),
(2053, 'Stretchy Tunic with Slight Sparkle Available in Plus Sizes', 'CHANTAL-001', 0, 0, 'Stretchy A-Line Tunic with Slight Sparkle Available in Plus Sizes. This tunic has a round neck and 3/4 sleeves. The material is stretchy for a perfect fit. Will hang nicely due to the cut. Glitter lines here and there to give the tunic a slight sparkle. Very pretty. Team up with a pair of leggings or jeans to complete your outfit. \nMaterial:\n96% Polyester\n4% Elastane\nModel is wearing a UK size 16.\nApprox measurements for a UK size 16:\nChest across one side 52cm\nLength from shoulder to hem 85cm', '2023-12-08 12:25:40', '2023-12-08 12:25:40'),
(2054, 'Cropped Jeggings', 'THOMASINA-002', 1, 1, 'Cropped Jeggings. Refresh your wardrobe with these fabulous jeggings! It has two back packets and a fold up hem detail. It has an elasticated waist for the perfect fit! Complete the look with a top and pumps for the ultimate look! These new style jeggings come in three colours! Grab this gorgeous jeggings today for only £4.99!\nMaterial:\n65% Cotton\n25% Polyester \n10% Elastane\nApprox measurements for a size Small:\nWaist on on side 28cm, expanded 40cm\nLength from waistband to ankle 65cm', '2023-12-08 12:25:42', '2023-12-08 12:25:42'),
