(2100, 'Sleeveless Polka Dot Blouse Ex Branded', 'LACEY-003', 6, 1, 'Sleeveless Polka Dot Blouse. Just in for spring, this sweet little number will look great dressed down at a picnic with jeans or dressed up for work with a sharp tailored blazer. With a flattering sleeveless cut and light-weight crepe-like material, this is a must have to breathe fresh air into your wardrobe. This blouse is loose fitting, has a collar, button up front and small side splits. The colour is more of an off-white. Ex-branded (labels may be cut out) \nMaterial:\n100% Viscose \nModel is wearing a size UK 8: \nChest: across one side 50cm \nTotal length (Shoulder to hem): 55cm', '2023-12-08 12:27:30', '2023-12-08 12:27:30'),
(2101, 'Elegant Plum Top With Necklace', 'ESMERALDA-002', 0, 0, 'Elegant Plum Top With Necklace. Refresh your wardrobe with this beautiful plum top! Perfect for the spring look! Simply team up with a pair of skinny jeans and shoes to complete the look! It has a button fastening at the back with a chiffon layer at the front and attached is a gorgeous diamante necklace! Hurry ladies and don\'t miss out on this affordable top for only £4.99!\nMaterial:\n95% Viscose \n5% Elastane\nModel is wearing a size UK 10.\nApprox measurements for a size UK 10:\nChest across one side 41cm\nLength from shoulder to hem 70cm', '2023-12-08 12:27:32', '2023-12-08 12:27:32'),
(2102, 'Chiffon Flower Print Smock Dress', 'MIKUTA-003', 5, 1, 'Chiffon Flower Print Smock Dress. Fully-lined in the body, this dress is perfect for a romantic walk or dinner date. Both cute and classy it will flatter any shape. Get this timeless piece while you can. \nMaterial:\n95% Polyester\n5% Elastane \nModel is wearing a One Size (UK8 - 12):\nChest: 42cm\nTotal length (shoulder to hem): 78cm', '2023-12-08 12:27:34', '2023-12-08 12:27:34'),
(2103, 'Black Lace Chiffon Top With Diamante Buttons', 'CAITLIN-002', 0, 0, 'Black Lace Chiffon Top With Diamante Buttons. Stay Feminine with this gorgeous classy chiffon top! Perfect for a dinner date with your loved one! Simply team up with a skirt and a lovely pair of shoes to complete the look! Great value for only £4.99! \nMaterial:\n100% Polyester\nModel wears a size XSmall.\nApprox measurements for a size XSmall:\nChest across one side 44cm\nLength from shoulder to hem 59cm', '2023-12-08 12:27:35', '2023-12-08 12:27:35'),
(2104, 'Rose Print Lacey Top', 'VENUS-003', 13, 1, 'Rose Print Lacy Top. Incredibly simple but so so chic, this lacy top is incredible soft. Lined at the front only, it gives a subtle flash of back skin through a button-up keyhole. Wear with slouchy boyfriend jeans or a body-con black skirt for a versatile feminine look. \nMaterial:\n50% Cotton\n50% Polyester \nModel is wearing a size UK 8:\nChest: 40cm\nTotal length (shoulder to hem): 50cm', '2023-12-08 12:27:36', '2023-12-08 12:27:36'),
(2105, 'Sheer Paisley Detail Top', 'XAVIERA-003', 27, 1, 'Incredibly simple but so so chic, this sheer top is incredible soft with a gorgeous print. Lined at the front only, it gives a subtle flash of back skin through a button-up keyhole. Wear with slouchy boyfriend jeans or a body-con black skirt for a versatile feminine look. \nMaterial:\n50% Cotton\n50% Polyester \nModel is wearing a size UK 8:\nChest: 40cm\nTotal length (shoulder to hem): 50cm', '2023-12-08 12:27:39', '2023-12-08 12:27:39'),
(2106, 'Lime Chiffon Top AVAILABLE IN PLUS SIZES', 'LAKYN-002', 14, 1, 'Lime Chiffon Top. Brighten up your day with this vibrant lime top! Grab a pair of skinny jeans and shoes to complete the look! It has a key hole tie at the back with a scoop neckline at the front! Great value for only £4.99! Available in plus sizes. Ex-Branded.(Labels may be cut off)\nMaterial: \n100% Polyester\nModel is wearing a size UK 8.\nApproximate measurements for a size UK 8:\nChest: 44cm\nTotal length(Shoulder to hem): 72cm', '2023-12-08 12:27:39', '2023-12-08 12:27:39');
