(2109, 'Bird Print Shift Dress', 'Y011527-002', 0, 0, 'Bird Print Shift Dress. Look classy and elegant with this shift dress! To complete look, team up with a gorgeous pair of shoes and a lovely handbag for the finishing touch! It has a zip fastening at the back, a round neckline with bat-wing sleeves and it has a underlayer. Great value for only £5.99!\nMaterial: \n100% Polyester\nApproximate measurements for a size Small:\nChest: 44cm\nTotal length(Shoulder to hem): 83cm', '2023-12-08 12:27:47', '2023-12-08 12:27:47'),
(2110, 'Shirt Dress with Neck Tie Detail', 'JO10992-003', 0, 0, 'Shirt Dress with Neck Tie Detail. Understated but undeniably sophisticated. This simple black dress boasts ribbon detailing around the waist and a tie-able bow neck that allows for an area of skin to be revealed. Makes a bold statement. Buy it while you can!\nMaterial: \n100% Viscose \nLining:\n100% Polyester \nModel is wearing a size Small (UK 8-10):\nChest: 40cm\nTotal length (shoulder to hem): 82cm', '2023-12-08 12:27:48', '2023-12-08 12:27:48'),
(2111, 'Blue Shirt Dress with Neck Tie Detail', 'NELLIE-003', 0, 0, 'Shirt Dress with Neck Tie Detail. Understated but undeniably sophisticated. This simple black dress boasts ribbon detailing around the waist and a tie-able bow neck that allows for an area of skin to be revealed. Makes a bold statement. Buy it while you can!\nMaterial: \n100% Viscose \nLining:\n100% Polyester \nModel is wearing a size Small (UK 8-10):\nChest: 40cm', '2023-12-08 12:27:50', '2023-12-08 12:27:50'),
(2112, 'Cropped Light Denim Jeans', 'KIMMY-002', 28, 1, 'Cropped Light Denim Jeans. These gorgeous denim jeans are perfect for the spring season! Team up with a top and sandals to complete the look! It has a button and zip fastening, five pockets with a fold up hem.  Great value for only £4.99!\nRecommend to order one size smaller!\nMaterial: \n100% Polyester\nModel is wearing a size UK 6.\nApproximate measurements for a size UK 6:\nWaist 36cm\nLength from waist to ankle 58cm', '2023-12-08 12:27:52', '2023-12-08 12:27:52'),
(2113, 'Detailed Cut-out Bodycon Dress', 'JO10844-003', 0, 0, 'Make an impression this spring with this bold colorful design! Bodycon to show off the best of you, with a cut-out panel in the back. \nMaterial:\n92% Polyester \n8% Elastane \nModel is wearing a size Small (UK 8-10):\nChest: 36cm\nTotal length (shoulder to hem): 95cm', '2023-12-08 12:27:54', '2023-12-08 12:27:54'),
(2114, 'Multi Colour Leggings AVAILABLE IN PLUS SIZES', 'AOIFE-002', 0, 0, 'Multi Colour Leggings. Look colourful this season and stand out from the crowd in these multi colour leggings. It has an elasticated waist for the perfect fitting! Wear with pumps and a shirt to complete your look! Available in plus sizes! ex-Branded.(Labels may be cut out)\nMaterial:\n88% Polyester\n12% Elastane\nModel is wearing a size UK 8.\nApprox measurements for a size UK 8:\nWaist on one side 27cm stretching to 36cm\nLength from waistband to ankle: 92cm', '2023-12-08 12:27:56', '2023-12-08 12:27:56'),
(2115, 'Smart Wide-Leg Trouser', 'TIANA-003', 0, 0, 'Smart Wide-Leg Trouser. A summer staple for the brave, these white trousers have a high waist and zipper with button detail. False pockets on front and back. Go on, be brave! \nMaterial:\n97% Cotton\n3% Elastane\nModel is a wearing a size UK 8:\nWaist: 40cm\nLength: 105cm \nWe recommend you order a size smaller than usual', '2023-12-08 12:28:00', '2023-12-08 12:28:00'),
(2116, 'Black and White Tartan Peplum Dress with Bow Detail', 'NELL-003', 0, 0, 'Black and White Tartan Peplum Dress with Bow Detail  This sleeveless peplum dress with its plunging neckline provides a flattering cut for any shape, with a low back and a large bow detail it really is stunning. The material is stretchy for a perfect fit. Edgy yet feminine, stunning for a night out! \nMaterial: \n95% Polyester \n5% Elastane \nModel is 5\' 7\" and wearing a size UK 8:\nChest: across one side 36cm\nTotal length (shoulder to hem): 95cm', '2023-12-08 12:28:02', '2023-12-08 12:28:02'),
(2117, 'Patterned Peplum Dress with Large Bow Detail', 'BETH -003', 0, 0, 'Patterned Peplum Dress with Large Bow Detail. This sleeveless peplum dress with its plunging neckline provides a flattering cut for any shape, with a low back and a large bow detail it really is stunning. The material is stretchy for a perfect fit. Edgy yet feminine, stunning for a night out! \nMaterial: \n95% Polyester \n5% Elastane \nModel is 5\' 7\" and wearing a size UK 8:\nChest: 36cm\nTotal length (shoulder to hem): 95cm', '2023-12-08 12:28:04', '2023-12-08 12:28:04'),
(2118, 'Stretchy White Jeans', 'TONYA-003', 0, 0, 'Stretchy White Jeans. Just in for spring, these white denim jeans will breathe fresh air into your outfits. Straight legged and stretchy to guarantee comfort, with three front and two back pockets. Get them now and remember, fortune favors the brave! We recommend you buy this product one size smaller than you usually wear. \nMaterial:\n65% Cotton\n32% Polyester\n3% Elastane \nModel is wearing a size UK 8:\nWaist: 39cm\nLength (waist to hem): 101cm', '2023-12-08 12:28:06', '2023-12-08 12:28:06'),
(2119, 'Patterned Chiffon Dress with Lace Panel', 'L01-003', 0, 0, 'Patterned Chiffon Dress with Lace Panel. This light and airy dress is perfect for a spring day. Special touches set it apart; fully lined, with a longer length in the back and a cut-out panel in the front covered with lace applique. Would look great with wedge heels! Get it now \nMaterial:\n100% Polyester \nModel is wearing a size UK S (8-10):\nChest: 40cm\nLength at front: 82cm\nLength at back: 120cm', '2023-12-08 12:28:07', '2023-12-08 12:28:07'),
(2120, 'Sophisticated Chiffon Dip Hem Blouse', 'EVIE-003', 0, 0, 'Sophisticated Chiffon Dip Hem Blouse. This is a must have blouse, great all year round with layers or on its own in the summer. Key features are a wide V-neck and 3/4 length sleeves with bow ties. \nMaterial:\n100% Polyester \nModel is wearing a size UK 8:\nChest: 47cm \nLength of front (shoulder to hem): 65cm\nLength of back (shoulder to hem): 72cm', '2023-12-08 12:28:10', '2023-12-08 12:28:10'),
(2121, 'Chiffon Tree Print Pencil Skirt', 'ETHEL-003', 0, 0, 'Chiffon Tree Print Pencil Skirt. A classy little number, this skirt boasts a beautiful tree print across the bottom is sure to make you stand out! It\'s fully-lined and wearable in any season. Pair this mid-length style with boots or pumps and monochrome accessories\nMaterial:\n100% Polyester \nModel is wearing a size UK 8:\nWaist: 33cm\nLength (waist to hem): 68cm', '2023-12-08 12:28:13', '2023-12-08 12:28:13'),
(2122, 'Sheer Summer Blouse', 'TRISTA-003', 0, 0, 'Sheer Summer Blouse. A sleeveless chiffon blouse featuring contrasting colours and gold buttons with a Peter Pan collar. Pocket detail on the left breast. Get it while you can!\nMaterial: \n100% Polyester\nModel is wearing a size UK 8:\nChest: 50cm \nLength (from shoulder to hem): 75cm', '2023-12-08 12:28:15', '2023-12-08 12:28:15'),
(2123, 'Cute 3/4 Length Pinstripe Jeans', 'ERIS-003', 0, 0, 'Cute 3/4 Length Pinstripe Jeans. These 3/4 jeans are so sweet. In for spring, they feature a faded blue and white pinstripe, turned up bottoms and 5 pockets (3 front, 2 back) and are slightly stretchy for a comfortable fit. The right back pocket features a diamante triangle detail. Wear to a picnic with strappy sandals, or on a day out at the beach \nMaterial:\n58% Cotton\n40% Polyester \n2% Elastane \nModel is wearing a size Small (UK 8-10):\nWaist across one side: 34cm \nLength (waist to hem): 70cm', '2023-12-08 12:28:18', '2023-12-08 12:28:18'),
(2124, 'Chiffon Cami Top', 'BROONWYN-003', 21, 1, 'Chiffon Cami Top. This adorable strappy top is very light and perfect for layering. Would look great with blue jeans or denim shorts. A simple piece like this goes with anything! Make it a staple of your wardrobe. Ex-branded (labels may be cut out)\nMaterial:\n100% Polyester \nModel is wearing a size UK 8:\nChest: 40cm\nLength (shoulder to hem): 58cm', '2023-12-08 12:28:19', '2023-12-08 12:28:19'),
(2125, 'Elegant Black Evening Dress With Diamante Detail', 'HM1723-004', 0, 0, 'Elegant Black Evening Dress With Diamante Detail. This gorgeous dress is great for a wedding, prom and any other special occasion! It has a V-neckline, padding on the chest and a cut out back with a zip fastening. Hurry up and grab this dress for only £6.99! \nMaterial:\n94% Viscose\n6% Elastane\nModel is wearing a size Small.\nApprox measurements for a size Small:\nChest across one side 33cm\nLength from shoulder to hem 145cm', '2023-12-08 12:28:22', '2023-12-08 12:28:22'),
(2126, 'Blue Swing Dress with Necklace', 'ROSITA-003', 0, 0, 'Blue Swing Dress with Necklace. Nice for a summer night out, this light and airy mid-length shift dress features a dazzling removable necklace that hooks on. This sleeveless swing design dress has a detachable necklace. It has a button fastening at the back. The material is crepe like and hangs beautifully. This dress is ex-branded and therefore, the labels may be cut out.\nMaterial:\n96% Polyester \n4% Elastane \nModel is wearing a size UK 8:\nChest: on one side 42cm \nLength (shoulder to hem): 91cm', '2023-12-08 12:28:25', '2023-12-08 12:28:25'),
(2127, 'Lacy Sleeveless Top', 'CALYPSO-003', 18, 1, 'Lacy Sleeveless Top. This sleeveless top features a lace panel around the back and shoulders and 5 buttons. Very soft and light it would look great with a denim mini skirt or floral maxi. \nMaterial:\n68% Cotton\n25% Nylon\n6% Viscose \n1% Polyester\nModel is wearing a size UK 8:\nApprox measurements for a size UK 8:\nChest: 44cm\nLength (shoulder to hem): 67cm', '2023-12-08 12:28:28', '2023-12-08 12:28:28'),
(2128, 'Elegant Maxi Dress With Beaded Detail', 'HM1724-001', 0, 0, 'Elegant Maxi Dress With Beaded Detail. This elegant maxi dress with beaded detail is a classic piece, available in red, blue and black! Key features include a floor length design, sheer and zipped back with front beaded detail to add the perfect finishing touch. Pair with strappy sandals and a clutch to complete your glamorous outfit! \nMaterial:\n94% Viscose\n6% Elastane\nModel is wearing a size small.\nApprox measurements for a Size Small:\nChest across one side 35cm\nLength from shoulder to hem 149cm', '2023-12-08 12:28:33', '2023-12-08 12:28:33'),
(2129, 'Navy Floral Trousers', 'EG15228-001', 0, 0, 'Navy Floral Trousers. These gorgeous trousers are navy blue with bright flowers. There is stitching on the trousers indicating false side pockets, a false fly and false back pockets to look like jeans. There is a wide waistband and the material is stretchy to give a perfect fit. Team up with a little top for that spring or summer look. They are lightweight and ideal for packing in your suitcase for your holiday. \nModel is 5\'7\" and wears a size S/M\nMaterial:\n95% Polyamide\n5% Spandex\nApprox measurements for a size S/M:\nWaist on one side 33cm stretching to 41cm\nLength from top of waistband to ankle 92cm\nWaistband 4cm', '2023-12-08 12:28:36', '2023-12-08 12:28:36'),
(2130, 'Light Cream Floral Trousers', 'EG15227-001', 0, 0, 'Light Cream Floral Trousers. These gorgeous trousers are light cream with bright flowers. There is stitching on the trousers indicating false side pockets, a false fly and false back pockets to look like jeans. There is a wide waistband and the material is stretchy to give a perfect fit. Team up with a little top for that spring or summer look. They are lightweight and ideal for packing in your suitcase for your holiday. \nModel is 5\'7\" and wears a size S/M\nMaterial:\n95% Polyamide\n5% Spandex\nApprox measurements for a size S/M:\nWaist on one side 33cm stretching to 41cm\nLength from top of waistband to ankle 93cm\nWaistband 4cm', '2023-12-08 12:28:37', '2023-12-08 12:28:37'),
(2131, 'Stretchy Black Skinny Trousers', 'NICHOLA-001', 0, 0, 'Stretchy Black Skinny Trousers. These quality soft touch trousers are a must for any wardrobe. They have a fly zip and a silver coloured button with a clear jewel in the middle. There are two side pockets on the front and back pockets with small silver coloured studs with clear jewels in the centre. They are stretchy for a perfect fit.  These trousers would look fabulous with a summer top or little jumper.\nModel is 5\' 7\" and is wearing a size M/L\nMaterial:\n20% Cotton, 65 Polyamide\n15% Elastane\n`\nApprox measurements for a size M/L:\nWaist on one side 35cm stretching to 44cm\nLength from top of waistband to ankle 96cm', '2023-12-08 12:28:38', '2023-12-08 12:28:38'),
(2132, 'Stretchy Jeans with Diamante Detail Back Pockets', '14971-001', 0, 0, 'Stretchy Jeans with Diamante Detail Back Pockets. These quality jeans have a large metal button and zip fly. They have two front side pockets and tow back pockets with diamante design. The material has a slight stretch for a comfy fit. Team these jeans with a pair of our fabulous boots, a little top or a jumper to complete your look. \nModel is 5\' 7\" and is wearing a size Small.\nMaterial:\n95% Cotton\n5% Polyester\nApprox measurements for a size Small:\nWaist across one side 37cm\nLength of inside leg 78cm', '2023-12-08 12:28:39', '2023-12-08 12:28:39'),
(2133, 'White Swing Dress with Necklace', 'CIKITA-001', 0, 0, 'White Swing Dress with Necklace. Nice for a summer night out, this light and airy mid-length shift dress features a dazzling removable necklace that hooks on. This sleeveless swing design dress has a detachable necklace. It has a button fastening at the back. The material is crepe like and hangs beautifully. This dress is ex-branded, therefore the labels may be cut.\nMaterial:\n96% Polyester \n4% Elastane \nModel is wearing a size UK 8:\nChest: on one side 42cm \nLength (shoulder to hem): 91cm', '2023-12-08 12:28:41', '2023-12-08 12:28:41'),
(2134, 'Stretchy Cross Over Front Stunning Jumpsuit', 'GIOVANNA-001', 0, 0, 'Stretchy Cross Over Front Stunning Jumpsuit. This fabulous jumpsuit has textured material and is stretchy for a perfect fit. It has short sleeves with turned up edges. Available in a fuschia pink and pale peach. Please note that the belt is not included. Team up with one of our many belts and pair of high heels or ankle boots to complete your outfit.\nModel is 5\'7\" and wears a UK size 8.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a UK size 8:\nChest across one side 37cm\nLength from shoulder to ankle 139cm\nInside Leg 74cm', '2023-12-08 12:28:44', '2023-12-08 12:28:44'),
(2135, 'Skater Dress with Cut Away Sides and Lace Top', 'CA1504-001', 0, 0, 'Skater Dress with Cut Away Sides and Lace Top. This pretty dress has a high round neck and is sleeveless. The sides above the waist are cut out and the top is lacey which is lined at the front. There is a concealed zip at the back that leaves an open split at the top to the neckline. The skirt of the dress has a wide waistband, is textured material and is slightly stretchy for a comfy fit and making the skirt fall beautifully. Take a look at our evening bags to complete this outfit. \nModel is 5\'7\" and wears a size Small.\nMaterial:\n94% Polyester\n6% Elastane\nApprox measurements for a size Small:\nChest across one side 41cm\nLength from shoulder to hem 88cm', '2023-12-08 12:28:47', '2023-12-08 12:28:47'),
(2136, 'Floral Scuba Mini Skirt', 'KESHA-001', 1, 1, 'Floral Stretchy Mini Skirt. This gorgeous skirt has a black background with bright coloured flowers all over. The material is stretchy for a perfect fit. The waistband is elasticated and concealed. Great for your spring / summer wardrobe. Team up with a little cami or blouse to complete your outfit. \nModel is 5\'7\" and wears a UK size 8.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a UK size 8:\nWaist on one side 31cm stretching to 37cm\nLength from waistband to hem 43cm', '2023-12-08 12:28:49', '2023-12-08 12:28:49'),
(2137, 'Floral Leggings with Gold Pattern Detail', 'PENELOPE-001', 23, 1, 'Floral Leggings with Gold Detail. The fabulous floral leggings have flowers all over. There is a tiny dot gold swirl pattern in the shape of flowers all over too.  They are stretchy for a perfect fit. The waist is elasticated with plenty of give. Lightweight and great for this spring/summer. Throw into your suitcase for your holidays.\nModel is 5\' 7\"\nMaterial:\n86% Polyamide\n15% Elastane\nApprox measurements for one size\nWaist on one side 33cm, stretching to 45cm\nLength from waist to ankle 93cm', '2023-12-08 12:28:50', '2023-12-08 12:28:50'),
(2138, 'Coral Stretch Skinny Jeans', 'ANNEMARIE-001', 18, 1, 'Coral Stretch Skinny Jeans. These stunning coral jeans are lightweight and stretchy for a perfect fit. They have a gold coloured metal button and zip fastening. There are two front side pockets and two back ones with small studs in the corners. Great for your holidays or for travelling in as they are very comfortable.\nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n98% Cotton\n2% Elastane\nApprox measurements for a UK size 8:\nWaist across one side 35cm stretching to 42cm\nLength from waist to ankle 99cm\nInside Leg 79cm', '2023-12-08 12:28:51', '2023-12-08 12:28:51'),
(2139, 'Turquoise Floral Scuba Mini Skirt', 'LAYLA-001', 0, 0, 'Turquoise Floral Stretchy Mini Skirt. This gorgeous skirt has a turquoise background with bright coloured flowers all over. The material is stretchy for a perfect fit. The waistband is elasticated and concealed. Great for your spring / summer wardrobe. Team up with a little cami or blouse to complete your outfit. \nModel is 5\'7\" and wears a UK size 8.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a UK size 8:\nWaist on one side 31cm stretching to 37cm\nLength from waistband to hem 43cm', '2023-12-08 12:28:53', '2023-12-08 12:28:53'),
(2140, 'Lace Panel Bodycon Dress', 'AMARIS-001', 12, 1, 'Lace Panel Bodycon Dress. This stunning dress has a high round neck and is sleeveless. It has lace side panels on the front and larger panels on the back. It has a long concealed zip in the centre of the back. It has a subtle racer back style. Very stylish. Available in a fuschia pink and cream.\nModel is 5\' 7\" and wears a size Small.\nMaterial:\n95% Polyester\n5% Spandex\nApprox measurements for a size Small:\nChest across one side 38cm\nLength from shoulder to hem 80cm', '2023-12-08 12:28:55', '2023-12-08 12:28:55'),
(2141, 'Baroque Print Stretchy Harem Trousers', 'NAYEI-001', 0, 0, 'Baroque Print Stretchy Harem Pants. These lovely pants have black and white baroque pattern all over. There are two front pockets. The elasticated waist is wide and gathered for a comfy fit. The ankles have a wide gathered and elasticated bottom too. The material is soft, lightweight and stretchy. Fabulous for the beach, lounging indoors or a night out. Extremely comfortable. \nModel is 5\' 7\" \nMaterial:\n85% Polyamide\n15% Elastane\nApprox measurements for one size:\nWaist across one side 33cm stretching to 50cm\nLength from waist to ankle 113cm but can be ballooned up with elasticated ankle to fit any leg lengths.', '2023-12-08 12:28:57', '2023-12-08 12:28:57'),
(2142, 'Patent Strappy Heeled Sandals', '99948-002', 16, 1, 'Patent Strappy Heeled Sandals. These gorgeous shoe is available in beige, black and coral. This strappy sandal features an ankle strap fastening with a 10.5cm Perspex block heel. Don\'t miss out!\nMain Material:\nFaux Leather\nHeel Height: 10.5cm\nApproximate measurments for Size UK4:\nInner Sole:24cm', '2023-12-08 12:28:58', '2023-12-08 12:28:58'),
