(2185, 'Faux Leather Handbag With Detachable Strap', 'D60067-002', 0, 0, 'Faux Leather Handbag With Detachable Strap.This bag has a detachable and adjustable shoulder strap plus a double fixed grab handle. It has a zip fastener, completed with outer and inner compartments to store all your valuables! Available in five colours!\nMaterial:\nFaux Leather\nApproximate measurements:\nHeight: 24cm\nWidth: 32cm\nDepth: 11cm', '2023-12-08 12:30:40', '2023-12-08 12:30:40'),
(2186, 'Soft Suedette Lace Up Pumps 5 Colours', '50417-001', 2, 1, 'Soft Suedette Lace Up Pumps. These cute lace up flat pumps are very soft, they feel between a suedette and velvet. The laces are colour co-ordinated. The soles have a patterned grip and the insides are padded for extra comfort. The toes are rounded. Available in 5 super colours ready for your summer outfits. Team up with a pair of our jeans, shorts or a skirt. Great for work or just everyday wear.\nMaterial:\nSuedette', '2023-12-08 12:30:44', '2023-12-08 12:30:44'),
(2187, 'Black Thong Sandal with Metal Heel', 'C8241-001', 0, 0, 'Black Thong Sandal with Metal Heel. These thong sandals have gold coloured studs on the front straps. The block heel is covered in gold coloured metal. The sole is textured for gripping and the inside is padded for a comfy fit. Ideal for your holiday suitcase or for that stroll along the promenade.  \nMaterial:\nSynthetic Leather\nApprox Measurements:\nHeel height just over 2cm', '2023-12-08 12:30:51', '2023-12-08 12:30:51'),
(2188, 'Faux Snakeskin Pumps with Chain Detail', '50452-001', 0, 0, 'Faux Snakeskin Pumps with Chain Detail. These pumps have a pointed toe. There is a bar across the front with a gold coloured metal chain attached. The soles are patterned for gripping. The inside is padded for extra comfort. There is a very small heel. Available in 4 super colours, a great addition to your spring wardrobe. \nMaterial:\nSynthetic Leather\nApprox measurements:\nHeel height 0.75cm', '2023-12-08 12:30:53', '2023-12-08 12:30:53'),
(2189, 'Patent Court Shoe with T-Bar Detail', '99684-001', 14, 1, 'Patent Court Shoe with T-Bar Detail. These stiletto heeled court shoes have a small T-bar on the front. The heel is squared off as it comes down. The inside is padded for extra comfort and the sole is textured for gripping. Fabulous shoes for this spring/summer. Available in white and a gorgeous pale jade blue. Team up with a cute dress or short skirt to show these lovey shoes off.\nMaterial:\nPatent, Synthetic Leather\nApprox measurements:\nHeel height 9.5cm', '2023-12-08 12:30:59', '2023-12-08 12:30:59'),
(2190, 'Suedette Ballerina Pumps with Patent Detail', '50356-001', 8, 1, 'Suedette Ballerina Pumps with Patent Detail. These cute soft pumps have a rounded toe and a patent detail on the front. The material is in between a suedette and a velvet. The inside is padded for comfort. The soles are patterned for gripping. Great for this spring/summer. Work or office shoes, holiday or evening wear. Available in 3 colours. \nMaterial:\nSuedette\nApprox measurements:\nHeel height 1cm', '2023-12-08 12:31:02', '2023-12-08 12:31:02'),
(2191, 'Sparkly Stiletto Peep Toe Platform Shoe', 'Z6771-001', 22, 1, 'Sparkly Stiletto Peep Toe Platform Shoe. These canvas sparkly shoes are great for a prom, summer ball, wedding, party or a night out. They are padded inside for extra comfort and textured on the sole for gripping. Available in black and silver. \nMaterial:\nCanvas\nApprox measurements:\nHeel height 12.5cm\nPlatform 2.5cm', '2023-12-08 12:31:03', '2023-12-08 12:31:03');
