(2195, 'Black Mini Doctor Style Handbag', 'D60004-002', 0, 0, 'Black Mini Doctor Style Handbag. This gorgeous classy doctor style handbag is perfect for work or school! It has double faux leather handles, detachable shoulder strap, zip fastener, completed with outer and inner compartments to store all your valuables! Perfect to brighten up your outfit! \nMaterial:\nFaux Leather\nApproximate measurements:\nHeight: 19cm\nWidth: 30cm\nDepth: 14cm', '2023-12-08 12:31:15', '2023-12-08 12:31:15'),
