(2198, 'Shiny Faux Leather Handbag', 'D60051-002', 0, 0, 'Shiny Faux Leather Handbag. This bag is perfect for your daily activities, as it is spacious enough to carry on all what your will need during long working day! Key features include, twin handles, magnetic fastener. Please note this bag is unlined.  Hurry up and grab this practical, but stylish handbag now!\nMaterial:\nFaux Leather\nApproximate measurements:\nHeight: 26cm\nWidth: 48cm\nDepth: 12cm', '2023-12-08 12:31:18', '2023-12-08 12:31:18'),
(2199, 'Faux Leather Shopper Handbag', 'D60025-002', 0, 0, 'Faux Leather Shopper Handbag. This bag is a must have! Key features include double faux leather handles, detachable shoulder strap, magnetic fastener, completed with outer and inner compartments to store all your valuables! Available in five colors! Great value for only £6.99!\nMaterial:\nFaux Leather\nApproximate measurements:\nHeight: 26cm\nWidth: 37cm\nDepth: 10cm', '2023-12-08 12:31:20', '2023-12-08 12:31:20'),
