(2203, 'Fuschia Bodycon Dress With Keyhole Back Ex-Branded', 'CORDELIA-002', 0, 0, 'Fuschia Bodycon Dress With Keyhole Back. Show your silhouette in this pretty bodycon dress! Stylish and sophisticated, this lovely dress gives a fresh approach to your classy look! Work this attractive dress with a gorgeous pair of high heels and a clutch to complete the ultimate look! Key features include elasticated material, round neckline, a keyhole back with a split down the back of the hem. Don\'t delay and update your classy look now for only £5.99! Ex Branded. (Labels may be cut off)\nMaterial:\n95% Polyester\n5% Elastane\nApproximate measurements for the size 8:\nChest: 32cm\nTotal length (Shoulder to hem): 105cm', '2023-12-08 12:31:28', '2023-12-08 12:31:28'),
(2204, 'Flower Print Skater Dress', 'MADELINE-002', 0, 0, 'Flower Print Skater Dress. Special offer for you! Be the first to order this amazing affordable dress only on less than ten pounds website! Chic and exclusive, this dress is perfect for any day-to-night outfit! It works beautifully with leather jacket or cropped blazer, so be sure with this dress you will definitely look trendy at any occasion! Key features include elasticated material, short sleeves with a v-neckline. Don\'t delay and order this lovely dress now!\nMaterial:\n95% Polyester\n5% Elastane\nApproximate measurements for the size UK 8:\nChest: 36cm\nTotal length (Shoulder to hem) : 88cm', '2023-12-08 12:31:30', '2023-12-08 12:31:30'),
(2205, 'High Neck Sleeveless Crop Top Ex-Branded', 'JOQUELINE-002', 8, 1, 'High Neck Sleeveless Crop Top. Refresh your wardrobe with this gorgeous crop top! Team up with skinny jeans, sandals and a shoulder bag to complete the look! It has a high neckline  with double button fastening at the back. Great value for only £4.99! Ex-Branded (Labels may be cut off)\nMaterial:\n95% Polyester \n5% Elastane\nModel is wearing a size UK 8.\nApprox measurements for a size UK 8:\nChest across one side 35cm\nLength from shoulder to hem 37cm', '2023-12-08 12:31:32', '2023-12-08 12:31:32'),
(2206, 'Large Size Peep Toe Shoe with Bow Detail', 'DM1211-15-001', 0, 0, 'Large Size Peep Toe Shoe with Bow Detail. These lovely peep toe shoes have a large bow with pleat detail on the front. The heel is kitten style. Great shoes for work, day wear or an evening out. Great holiday shoes. \nMaterial:\nSynthetic Leather\nApprox measurements:\nHeel height 6cm', '2023-12-08 12:31:35', '2023-12-08 12:31:35'),
(2207, 'Large Size Patent Sandal', 'WDM94930-1-001', 0, 0, 'Large Size Patent Sandal. These patent shoes have a small diamante design on the front. The inside is padded for extra comfort. The heel is wood effect and block style. Available in balck and brilliant red.\nMaterial:\nPatent Synthetic Leather\nApprox measurements:\nHeel height 6.5cm', '2023-12-08 12:31:37', '2023-12-08 12:31:37'),
(2208, 'Large Size Pumps with Metal and Diamante Bow Detail', 'DM1668-20-001', 2, 1, 'Large Size Pumps with Metal and Diamante Bow Detail. These pretty flat pumps have a faux leather bow on the front with a gold coloured metal bow on top and diamantes in the centre. The inside is padded for extra comfort. The sole is textured for gripping. Fabulous every day or the office. \nMaterial:\nSynthetic Leather\nApprox measurements:\nHeel height 0.75cm', '2023-12-08 12:31:40', '2023-12-08 12:31:40'),
(2209, 'Large Size Elegant Sandal with Jewel and Diamante Detail', 'DM3123-1-001', 41, 1, 'Large Size Elegant Sandal with Jewel and Diamante Detail. These gorgeous sandals have three straps and a jewel and diamnate design on the front. They are patent. Available in black, metallic pink and metallic blue. Fabulous party sandals.\nMaterial:\nPatent Synthetic Leather\nApprox measurements:\nHeel height 7cm', '2023-12-08 12:31:42', '2023-12-08 12:31:42'),
(2210, 'Large Size Ankle Strap Sparkly Sandal', 'DM39-8-001', 4, 1, 'Large Size Ankle Strap Sparkly Sandal. These super flat sandals have an ankle strap with fancy buckle detail and a heel suport with a zip at the back for easy access.  The front toe strap is covered in tiny contrasting sparkly stones.They have a very small heel and a textured sole for gripping. Great to wear with a dress, skirt or jeans. Fabulous holiday shoes. The black is a solid colour but the gold, white and pink have a metallic shimmer to the colour.\nMaterial:\nSynthetic Leather\nApprox measurements:\nHeel height just under 1cm', '2023-12-08 12:31:45', '2023-12-08 12:31:45'),
(2211, 'Large Size Polished Pumps with Metal Detail', 'DM68-9-001', 7, 1, 'Large Size Polished Pumps with Metal Detail. These low wedge soled pumps have a gold coloured metail detail on the front. The synthetic leather is polished to a shine. Fabulous work or office shoes. \nMaterial:\nSynthetic Leather\nApprox measurements:\nHeel height 1.5cm', '2023-12-08 12:31:50', '2023-12-08 12:31:50'),
(2212, 'Red Playsuit With Gold Coloured Buckle Ex-Branded', 'SASKIA-002', 0, 0, 'Red Playsuit With Gold Buckle. This gorgeous playsuit is totally sophisticated! Perfect for an evening out to the town with the girls! Team up with killer heels to complete the look! It has a round neckline, with a zip fastening going down the back. Hurry up ladies and don\'t miss out on this beautiful playsuit for only £5.99! Ex-Branded (Labels may be cut off)\nMaterial:\n95% Polyester\n5% Elastane\nModel is wearing a size UK 8.\nApproximate measurements for Size UK 8:\nChest: 29cm\nTotal length (Shoulder to hem) : 70cm', '2023-12-08 12:31:56', '2023-12-08 12:31:56'),
