(2214, 'Chiffon Style Tunic with Neck Tie Ex-Branded', 'LANEY-001', 0, 0, 'Chiffon Style Tunic with Neck Tie. This gorgeous grey tunic is ideal for the office or for a day out. There are concealed buttons on the front down to the tail panel. There is a tie at the neck. This tunic is ex-branded and will therefore have the labels cut.\nModel is 5\'7\" and wears a UK size 10\nMaterial:\n100% Polyester\nApprox measurements for a UK size 10:\nChest across one side 46cm\nLength from shoulder to hem 79cm', '2023-12-08 12:31:59', '2023-12-08 12:31:59'),
(2215, 'Cylinder Style Handbag.', 'D60187-002', 0, 0, 'Cylinder Style Handbag. This bag has a detachable and adjustable shoulder strap plus double grab handle.It has a zip fastener with There is a zipped compartment and a large open pocket inside. Available in three colours!\nMaterial:\nFaux Leather\nApprox measurements:\nLength: 32cm\nHeight: 18cm\nWidth: 17cm', '2023-12-08 12:32:01', '2023-12-08 12:32:01'),
(2216, 'Off Shoulder Ribbed Dress', 'OLIVIA-002', 0, 0, 'Off shoulder Ribbed Dress. Stock up on some basic beauties this season with our ribbed grey dress. With seriously fierce off the shoulder bardot neckline and standout bodycon style this dress is a must-have. Team with chunky ankle boots and handbag for an effortless day look. \nModel is wearing a size S/M.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a size S/M:\nChest across one side 27cm\nLength from shoulder to hem 83cm', '2023-12-08 12:32:02', '2023-12-08 12:32:02'),
(2217, 'Snakeskin Print Dress', 'SUSANNA-002', 0, 0, 'Snakeskin Print Dress. This gorgeous mint snakeskin dress has a round neckline with long sleeves and a zip fastening at the back. Complete the look with one of our fabulous pairs of sandals and a handbag all for under £10\'s! Great value for only £5.99!\nModel is wearing a size S/M.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a size S/M:\nChest across one side 43cm\nLength from shoulder to hem: Front 87cm - Back 103cm', '2023-12-08 12:32:04', '2023-12-08 12:32:04'),
(2218, 'Bandeau Beach Dress', 'MARGOT-002', 22, 1, 'Bandeau Beach Dress. This dress doesn\'t come any fabulous then this! Perfect for a day at the beach or park! It has a halter neck tie that can be used or tucked in with padding on the chest and flower pattern at the bottom! Hurry up ladies and don\'t miss out on this gorgeous maxi dress for only £5.99!\nMaterial:\n100% Polyester\nModel is wearing a size Small.\nApproximate measurements for a size Small:\nChest: 36cm\nTotal length (Shoulder to hem): 131cm', '2023-12-08 12:32:05', '2023-12-08 12:32:05'),
(2219, 'Ripped Effect Leggings with Lace Detail', 'G910-001', 6, 1, 'Ripped Effect Leggings with Lace Detail. These very stretchy leggings have open rolled holes on the front with lace behind them in contrasting colours. The waist is elasticated and very stretchy. Team up with a nice tunic or jumper to complete your outfit.\nModel is 5\'7\" \nMaterial:\n85% Polyamide\n15% Elastane\nApprox measurements for One Size:\nWaist across one side 29cm stretching to 48cm\nLength from waist to ankle 89cm', '2023-12-08 12:32:06', '2023-12-08 12:32:06'),
(2220, 'Grey Striped Cropped Top', 'REDA-001', 21, 1, 'Grey Striped Cropped Top. This cute lightweight cropped top has a crew neck and long sleeves. This top is mainly grey with a thinner white horizontal stripe. Fabulous with a pair of leggings or jeans. \nModel is 5\' 7\" and wears a size S/M.\nMaterial:\nMixed Fibres\nApprox measurements for a size S/M:\nChest across one side 40cm\nLength from shoulder to hem 37cm', '2023-12-08 12:32:10', '2023-12-08 12:32:10'),
(2221, 'Soft Lightweight Knitted Cowl Neck Dress', 'GRAMMY-001', 0, 0, 'Soft Lightweight Knitted Cowl Neck Dress. This dress is sleeveless and has a cowl neck. It is soft to touch and lightweight, so ideal for your holiday suitcase. Super dress to wear to the office too. This dress could also be worn with a belt for a different look. \nModel is 5\' 7\" and wears a size Small.\nMaterial:\n95% Polyester\n5% Elastane \nApprox measurements for a size Small:\nChest across one side 40cm\nLength from shoulder to hem 78cm', '2023-12-08 12:32:12', '2023-12-08 12:32:12'),
(2222, 'Burgundy Shirt with Smock Detail on the Shoulder Ex-Branded', 'CHRISTAL-001', 0, 0, 'Burgundy Shirt with Smock Detail on the Shoulder Ex-Branded. This grandad collar shirt has 5 buttons at the front. There is a smock gathering just under the shoulders and a small metal decoration across the shoulder. The sleeves can be rolled up and secured with a tab and button or left down. The shirt bottom is rounded at the sides. The material has a slight crinkle effect to it. This shirt is ex-branded and will therefore have the labels cut out.\nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n100% Viscose\nApprox measurements for a UK size 8:\nChest across one side 45cm\nLength from shoulder to hem 68cm', '2023-12-08 12:32:13', '2023-12-08 12:32:13'),
(2223, 'Black Shirt with Smock Detail on the Shoulder Ex-Branded', 'KAMALA-001', 0, 0, 'Black Shirt with Smock Detail on the Shoulder Ex-Branded. This grandad collar shirt has 5 buttons at the front. There is a smock gathering just under the shoulders and a small metal decoration across the shoulder. The sleeves can be rolled up and secured with a tab and button or left down. The shirt bottom is rounded at the sides. This shirt is ex-branded and will therefore have the labels cut out.\nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n100% Viscose\nApprox measurements for a UK size 8:\nChest across one side 45cm\nLength from shoulder to hem 68cm', '2023-12-08 12:32:15', '2023-12-08 12:32:15'),
(2224, 'Green Shirt with Smock Detail on the Shoulder Ex-Branded', 'MARISA-001', 0, 0, 'Green Shirt with Smock Detail on the Shoulder Ex-Branded. This grandad collar shirt has 5 buttons at the front. There is a smock gathering just under the shoulders and a small metal decoration across the shoulder. The sleeves can be rolled up and secured with a tab and button or left down. The shirt bottom is rounded at the sides. The material has a slight crinkle effect to it. This shirt is ex-branded and will therefore have the labels cut out.\nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n100% Viscose\nApprox measurements for a UK size 8:\nChest across one side 45cm\nLength from shoulder to hem 68cm', '2023-12-08 12:32:17', '2023-12-08 12:32:17'),
(2225, 'Stunning Fitted Dress with Back Detail Ex-Branded', 'MAIREAD-001', 0, 0, 'Stunning Fitted Dress with Crossover Back Detail Ex-Branded. This gorgeous stone coloured dress is fitted with a waistband. The sleeves are a short batwing design. The back has a cross over detail with two buttons at the top and an open triangle from the waistband towards the neck. The skirt part has a central concealed zip. There is back split in the skirt too.  Fabulous office dress, ideal for meetings and conferences. Great for a night out too. This dress is ex-branded and will therefore have the labels cut. There is limited stock on this dress so please order now and not be disappointed.\nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n100% Polyester\nApprox measurements for a UK size 8:\nChest across one side 38cm but more into the sleeves. \nWaist on one side 35cm\nLength from shoulder to hem 105cm', '2023-12-08 12:32:19', '2023-12-08 12:32:19'),
(2226, 'Asymmetric Stretchy Playsuit Ex-Branded 3 Colours', 'SAMMIE-001', 0, 0, 'Asymmetric Stretchy Playsuit Ex-Branded 3 Colours. This stunning playsuit has an overlay front. The material has a texture that is crepe like and is stretchy for a perfect fit. It has a round neck and short sleeves. There is a long concealed zip in the back and a belt with a metal front and poppas at the back. Team up with  a pair of our new spring / summer range sandals. This playsuit is ex-branded and will therefore have the labels cut. This playsuit is limited stock. Please order early to not be disappointed.\nModel is 5\' 7\" and is wearing a UK size 8.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a UK size 8:\nChest across one side 38cm\nLength from shoulder to front crossed over hem 81cm', '2023-12-08 12:32:21', '2023-12-08 12:32:21'),
(2227, 'Swing Chiffon Camisole with Frill Ex-Branded Available in Plus Sizes', 'KRIS-001', 1, 1, 'Swing Chiffon Camisole with Frill. This cute red chiffon camisole is swing style with a frill across the bust area back and front. It is ex branded and will therefore have the labels cut. Team up with a pair of shorts for the summer or jeans for everyday wear. \nModel is 5\' 7\" and weras a UK size 8.\nMaterial:\n100% Polyester\nApprox measurements for a UK size 8:\nChest across one side 42cm\nLength from shoulder to hem 70cm', '2023-12-08 12:32:24', '2023-12-08 12:32:24'),
