(2276, 'Cropped White Jeans', 'SELA-002', 12, 1, 'Cropped White Jeans. These cropped white jeans are perfect for the summer! It has two front pockets and two back pockets along with a button and zip fastening. It is slightly stretchy for a comfortable fit. Team up with a top, strappy sandals and a lovely handbag all for under £10\'s! \nRecommend to order one size smaller!\nModel is wearing a size UK 6.\nMaterial:\n66% Cotton\n32% Polyester \n2% Spandex \nApprox measurements for a size UK 6.\nWaist: 35cm \nLength (waist to hem): 71cm', '2023-12-08 12:33:48', '2023-12-08 12:33:48'),
(2277, 'Button Detail Baggy Top', 'CECI-002', 0, 0, 'Button Detail Baggy Top. This top is perfect for that every day casual look! It has a button fastening at the front with a round slightly elasticated neckline. It also has slightly elasticated hem and has short sleeves. Grab this comfy yet stylish top today for only £4.99! Available in four colours!\nModel is wearing a size Small.\nMaterial:\n100% Cotton\nApprox measurements for a size UK 8:\nChest: 48cm\nLength (shoulder to hem): 64cm', '2023-12-08 12:33:50', '2023-12-08 12:33:50'),
(2278, 'Black Turtle Neck Bodysuit', 'GRACIJA-002', 0, 0, 'Black Turtle Neck Bodysuit. For a sleek finish to your look, invest in this black turtle neck bodysuit. This transitional piece features a turtle neck, a button fastening at the back with short sleeves for a new season update and is perfect for bringing together a minimalist look. Team with a faux leather skirt and barely there heels to rock the look! Ex-Branded(Labels may be cut out)\nModel is wearing a size UK 8.\nMaterial:\n95% Polyester\n5 Elastane\nApprox measurements for a size UK 8:\nChest: 32\nLength: 64', '2023-12-08 12:33:55', '2023-12-08 12:33:55'),
(2279, 'Blue Printed Bodycon Dress', 'ZYLE-002', 0, 0, 'Blue Printed Bodycon Dress. Mix up your dress collection with this head turning bodycon dress! It has slightly elasticated material for the perfect fit along with a round neckline and short sleeves! Ex-Branded(Labels may be cut off.)\nModel is wearing a UK size 8.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a UK size 8:\nChest across one side 34cm\nLength from shoulder to hem 111cm', '2023-12-08 12:33:56', '2023-12-08 12:33:56'),
(2280, 'Pretty Yellow Swing Dress Ex Branded', 'ARMANE-002', 0, 0, 'Pretty Yellow Swing Dress. Brighten up your day with this pretty swing dress! It totally brings out the summer look! Simply team up with sandals and a handbag to complete the look! It has a round neckline and 3/4 sleeves. Hurry up ladies and grab this dress for only £5.99! Ex-Branded(Labels may be cut off.)\nModel is wearing a size UK 8.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a UK size 8:\nChest across one side 45cm\nLength from shoulder to hem 81cm', '2023-12-08 12:33:57', '2023-12-08 12:33:57');
