(2281, 'Eye Detail Chiffon Blouse AVAILABLE IN PLUS SIZES', 'GLAZA-002', 0, 0, 'Eye Detail Chiffon Blouse. This eye catching blouse is perfect for any occasion! Simply team up with skinny jeans and a pair of sandals to complete the look! It has long sleeves with a round neckline and a key hole button fastening at the back. Great value for only £4.99! Ex-Branded(Labels may be cut off)\nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n100% Polyester\nApprox measurements for a UK size 8:\nChest across one side 49cm\nLength from shoulder to hem 59cm', '2023-12-08 12:33:59', '2023-12-08 12:33:59'),
(2282, 'Paisley Print Jumpsuit', '4001-002', 2, 1, 'Paisley Print Jumpsuit. Add a gloriously retro touch to your new season looks in this jazzy jumpsuit! It has slightly elasticated material with a scoop neckline! Team up with sandals and a handbag to complete the look! Available in three colours! Don\'t miss out on this beautiful jumpsuit for only £5.99!\nModel is wearing a size Small.\nMaterial: \n95% Polyester\n5% Spandex  \nApproximate measurements for a size UK 8:\nChest: 36cm\nTotal Length (Shoulder to hem): 135cm', '2023-12-08 12:34:01', '2023-12-08 12:34:01'),
(2283, 'Crop Top With Crossover Back', 'ADNA-002', 7, 1, 'Crop Top With Crossover Back. Refresh your wardrobe with this gorgeous spring crop top! Simply team up with skinny jeans and sandals to complete the look! It has a crossover back with short cap sleeves and a round neckline.\nModel is wearing a size S/M.\nMaterial : \n95% Polyester\n5% Elastane\nApproximate measurements for a size S/M:\nChest: 35cm\nTotal length (Shoulder to hem): 38cm', '2023-12-08 12:34:04', '2023-12-08 12:34:04'),
(2284, 'Navy Collar Shift Dress AVAILABLE IN PLUS SIZES', 'GILDA-002', 0, 0, 'Navy Collar Shift Dress. The beautifully interesting print on this collared shift dress is so perfect for the ultimate spring look! It has flower print detail with a collar neckline and a key hole double button fastening at the back! Grab this shift dress today for only £4.99! Ex-Branded(Labels may be cut off)\nModel is wearing a size UK 8.\nMaterial : \n100% Polyester\nApproximate measurements for a size UK 8:\nChest: 43cm\nTotal length (Shoulder to hem): 88cm', '2023-12-08 12:34:06', '2023-12-08 12:34:06'),
(2285, 'Patent Shoe with Open Toe Detail', '99672-001', 40, 1, 'Patent Shoe with Open Toe Detail. These gorgeous shoes have an open toe with a V shape. The open front has a gold coloured metal pointed toe detail. One side of the shoe is open. The heel is stiletto style. The inside sole is padded for extra comfort and the bottom sole is ridged for gripping. These are very stylish shoes and could be worn at work or an evening out. Available in black.\nMaterial:\nPatent synthetic material.\nApprox measurements:\nHeel height 10cm', '2023-12-08 12:34:08', '2023-12-08 12:34:08'),
(2286, 'Faux Suede Stiletto Court Shoe', '99656-001', 11, 1, 'Faux Suede Stiletto Court Shoe. These shoes are faux suede with a cream patent toe and around the heel design. Available in a gorgeous petrol blue and soft cream. Both colours have cream patent. The toes are pointed and the inside sole is padded for extra comfort. The heel is stiletto and the sole is slightly ridged for gripping. Fabulous office shoes or for that special night out. Cream is limited stock so order quickly to not be disappointed.\nMaterial:\nFaux suede and patent\nApprox measurements:\nHeel height 11.5cm', '2023-12-08 12:34:10', '2023-12-08 12:34:10'),
(2287, 'Faux Suede Wedge Shoe with Stirrup Detail', '99127-001', 0, 0, 'Faux Suede Wedge Shoe with Stirrup Detail. These wedge faux suede shoes have rounded toes with a gold coloured metal tip on the sole. There is a strap and side buckle on the top. They have a gold coloured stirrup with two hanging chains and a love heart on the heel. Available in fuschia pink and mocha brown. The sole is ridged for gripping. Super to wear with jeans or a dress. \nMaterial:\nFaux Suede\nApprox measurements:\nHeel height 10cm\nPlatform 1.5cm', '2023-12-08 12:34:13', '2023-12-08 12:34:13'),
(2288, 'Black Basket Weave Design Handbag', 'D60151A-001', 0, 0, 'Black Faux Leather Basket Weave Design Handbag. This large shoulder bag has two grab handles and a detachable, adjustable shoulder strap. It has a main large middle zipped compartment with inside pockets and a zipped compartment inside.  There are two magnetic poppa compartments either side of the middle section for extra items. Fabulous bag for work or for shopping. \nMaterial:\nFaux Leather\nApprox measurements:\nWidth 35cm\nHeight 24cm\nDepth 20cm', '2023-12-08 12:34:16', '2023-12-08 12:34:16'),
(2289, 'Grab Bag with Front Pocket Detail', 'D60099-001', 23, 1, 'Faux Leather Grab Bag with Front Pocket Detail. This textured bag has two grab handles with metal stud detail. There is a front pocket with a magnetic flap and two false side zips. There is a zipped pocket on the back of the bag too. The main part of the bag has a zip fastening at the top and a zip pocket and some open pockets inside too. Available in black and beige. \nMaterial:\nFaux Leather\nApprox measurements:\nWidth 38cm\nHeight 33cm\nDepth 14cm', '2023-12-08 12:34:17', '2023-12-08 12:34:17'),
(2290, 'Drawstring Design Handbag', 'D60191COL-001', 0, 0, 'Drawstring Design Handbag. This handbag has two grab handles and a detachable, adjustable shoulder strap. The top closes by drawstring and has internal open pockets and a zipped pocket too. The sides are open to tuck things inside. Available in blue, red and pale beige. \nMaterial:\nFaux Leather\nApprox measurements:\nWidth 36cm\nHeight 32cm\nWidth 16cm', '2023-12-08 12:34:18', '2023-12-08 12:34:18'),
(2291, 'Basket Weave Design Shiny Handbag', 'D60066-001', 0, 0, 'Basket Weave Design Shiny Handbag. This handbag has two grab handles that can have a buckle and can be adjusted to suit. There is a basket weave design on the front and a zipped pocket on the plain back. The top is zipped  for security and there is a zipped large pocket inside with a smaller side one and extra open pockets for your phone etc.Fantastic bag for the office, shopping or college. \nMaterial:\nFaux Leather\nApprox measurements:\nWidth 38cm\nHeight 27cm\nDepth 13cm', '2023-12-08 12:34:20', '2023-12-08 12:34:20'),
(2292, 'Coral Basket Weave Design Handbag', 'D60151Z-001', 0, 0, 'Coral Faux Leather Basket Weave Design Handbag. This large shoulder bag has two grab handles and a detachable, adjustable shoulder strap. It has a main large middle zipped compartment with inside pockets and a zipped compartment inside.  There are two magnetic poppa compartments either side of the middle section for extra items. Fabulous bag for work or for shopping. \nMaterial:\nFaux Leather\nApprox measurements:\nWidth 35cm\nHeight 24cm\nDepth 20cm', '2023-12-08 12:34:22', '2023-12-08 12:34:22'),
(2293, 'Summer Chiffon Pleated Maxi Skirt', '1209A-002', 0, 0, 'Summer Chiffon Pleated Maxi Skirt. This maxi skirt is a holiday essential! It is available in seven colours! Key features include a floor length design, elasticated waist completed with studded detail to add the perfect finishing touch! Simply team up with a crop top and sandals to complete the look!\nModel is wearing a size Small.\nMaterial:\n65% Polyester\n35% Cotton\nApproximate measurements for a size Small:\nWaist: 33cm\nTotal length(Shoulder to hem): 97cm', '2023-12-08 12:34:24', '2023-12-08 12:34:24'),
