(2298, 'Magazine Photo Print Clutch Bag', 'AB189-002', 15, 1, 'Magazine Photo Print Clutch Bag. This gorgeous clutch bag has magazine cover photos all over. It has a metal edging and a magnetic clasp. It has an inside pocket and a detachable chain shoulder strap. This is a stunning clutch bag. Available in three colours! Order yours quickly as very limited stock on this item.\nMaterial:\nFaux Leather\nApprox measurements:\nWidth 24cm\nHeight 11cm\nDepth 5cm', '2023-12-08 12:34:41', '2023-12-08 12:34:41'),
(2299, 'Blue Patterned Cotton Western Style Jacket', 'EDEN-001', 15, 1, 'Blue Patterned Cotton Western Style Jacket. This pretty jacket has silver coloured stud buttons on the front  opening, pockets and cuffs. There is a tab at the back to adjust the waistband too. This jacket has a slight stretch for a comfy fit. This jacket has a loose fit. \nMaterial:\n98% Cotton\n2% Spandex\nModel wears a size Small\nApprox measurements for a size Small\nChest across one side 45cm\nLength from shoulder to waist 50cm', '2023-12-08 12:34:43', '2023-12-08 12:34:43'),
