(2364, 'Tropical Print Maxi Dress Available In Plus Sizes!', 'CASSIE-002', 0, 0, 'Tropical Print Maxi Dress. This gorgeous maxi dress is simply perfect for holiday! It has a low v-neckline completed with a tie belt. Slightly stretchy for the perfect fit! Team up with sandals and a denim jacket to complete the look! Available in plus sizes! Ex-Branded(Labels may be cut off) \nWe would kindly recommend to order one size smaller. \nModel is 5\'7 and wearing a size UK 6.\nMaterial:\n95% Viscose\n5% Elastane\nApprox measurements for a UK size 6:\nChest across one side 32cm\nLength from shoulder to hem 135cm', '2023-12-08 12:37:09', '2023-12-08 12:37:09'),
(2365, 'Oversized Pleated Chiffon Top', 'ELDRED-002', 0, 0, 'Oversized Pleated Chiffon Top. This gorgeous pleated chiffon top is perfect for a special evening out with your loved one! Simply team up with leggings and ballerina pumps to complete the look! It features a open v-neckline, long sleeves with double button fastening on the cuffs, completed with a tie belt. Great value for only £4.99!\nModel is 5\'7 and wearing one size.\nMaterial:\n100% Polyester\nApprox measurements for one size:\nChest: 42cm\nTotal length (shoulder to hem): 66cm under laying 52cm', '2023-12-08 12:37:12', '2023-12-08 12:37:12'),
(2366, 'Cropped Jeans With Zip Detail', 'AMBRIEL-002', 69, 1, 'Cropped Jeans With Zip Detail. These gorgeous cropped jeans are perfect to start off the summer look! Simply team with a cami top and sandals! It features three zip false pockets at the front, two back pockets, two front pockets completed with a zip and button fastening. Available in three colours! Great value ladies for only £4.99! Don\'t miss out today! Colour may rub off during wearing. We kindly advise not to combined light coloured garments or surfaces and to wash it separately before wearing.\nModel is 5\' 7\" and is wearing a size UK 6.\nMaterial:\n98% Cotton\n2% Elastane\nApprox measurements for a size UK 6:\nWaist across one side 35cm\nTotal length( Waist to hem) 84cm', '2023-12-08 12:37:13', '2023-12-08 12:37:13');
