(2367, 'Faux Leather Pumps With Golden Chain And Cap Toe Detail', '13505-001', 49, 1, 'Faux Leather Pumps With Golden Chain And Cap Toe Detail. Prove that practical shoes can look really stylish with this stunning faux leather pumps! Note that the hottest trend in shoes today is the cap toe and in combination with metal chain detail these cute pumps will make your look chic and dramatic! Just mix these pumps with a pair of tight jeans or leggings and a chiffon top and you will achieve ultimate day to night outfit!\nMaterial:\nFaux leather', '2023-12-08 12:37:14', '2023-12-08 12:37:14'),
(2368, 'Classic Denim Jacket', 'ISSAC-002', 0, 0, 'Classic Denim Jacket. Denim jackets are a timeless piece, perfect for the summer season! Team up with a maxi dress and sandals to complete the look! It has a collar with button fastening and a button fastening on the cuffs completed with two small pockets on the chest. Great value ladies for only £4.99!\nModel is 5\'7 and wearing a size Small.\nMaterial:\n100% Cotton\nApproximate measurements for size Small:\nChest: 41cm\nTotal length(Shoulder to hem): 53cm', '2023-12-08 12:37:21', '2023-12-08 12:37:21'),
(2369, 'Knit And Fur Detailed Faux Suede Boots - Last 2 Pairs!', 'SY305-001', 0, 0, 'Knit And Fur Detailed Faux Suede Boots\nVery gorgeous lace up boots\nFeatures knit detail at the top and fur on the front\nHeel has the wooden look\nMain Material:\nFaux Suede\nHeel Height:10cm', '2023-12-08 12:37:22', '2023-12-08 12:37:22'),
