(2371, 'Tribal Print Playsuit', 'AUBREY-002', 82, 1, 'Tribal Print Playsuit. This pretty tribal playsuit is perfect for those hot sunny days! Team up with sandals and a handbag! It features diamante button fastening, an elasticated waistband completed with two pockets. Available now in four colours! Great value for only £4.99!\nModel is 5\'7 and wearing a size M/L.\nMaterial:\n65% Polyester\n35% Cotton\nApproximate measurements for a size M/L:\nChest: 43cm\nTotal length (Shoulder to hem) : 80cm', '2023-12-08 12:37:24', '2023-12-08 12:37:24'),
(2372, 'Tropical Print Playsuit', 'AALYAH-002', 44, 1, 'Tropical Print Playsuit. This gorgeous playsuit has a zip fastening at the front with an elasticated waistband completed with two pockets. It\'s the ultimate holiday look! Team up with gladiator sandals and handbag to complete the look! Available now in three colours! Ladies do not miss out today for only £4.99!\nModel is 5\'7 and wearing a size M/L.\nMaterial:\n65% Polyester\n35% Cotton\nApproximate measurements for a size ML:\nChest: 43cm\nTotal length (Shoulder to hem) : 77cm', '2023-12-08 12:37:27', '2023-12-08 12:37:27'),
