(2374, 'Oversized Animal Print Top', 'BIRDIE-002', 0, 0, 'Oversized Animal Print Top. Bring out your wild side with this gorgeous animal print top! It features all the wildlife animals! It has a round neckline and is sleeveless. Team up with white skinny jeans and pumps to complete the look! Great value for only £4.99!\nModel is 5\'7 and wearing one size.\nMaterial:\n100% Polyester\nApprox measurements for the one size:\nChest 75cm\nLength from shoulder to front hem 69cm', '2023-12-08 12:37:31', '2023-12-08 12:37:31'),
