(2381, 'Blue Chiffon Blouse Available In Plus Sizes', 'JORDYN-002', 4, 1, 'Black Chiffon Blouse .Refresh your wardrobe with this gorgeous chiffon blouse! It has a collar around the neckline, two pockets on the chest with button fastening all the way down the front! Team up with a smart pair of skinny jeans, pumps and a cardigan for the ultimate look! Great value for only £4.99! Ex-Branded(Labels may be cut off)\nModel is wearing a size UK 8.\nMaterial : \n100% Polyester\nApproximate measurements for a size UK 8:\nChest : 43cm \nTotal length (Shoulder to hem): Front 65cm Back 70cm', '2023-12-08 12:37:43', '2023-12-08 12:37:43'),
