(2387, 'Denim Hot Pant Shorts Ex-Branded', 'EMILE-001', 59, 1, 'Denim Hot Pant Shorts. These cute denim shorts have two front pockets and two back pockets. They have belt loops. There is a metal button and zip fly. The legs have a small fringe. The button design will vary on the shorts. These shorts are ex-branded and will therefore have the labels cut. Team up with one of our cropped tops to complete your outfit ready for the summer. Throw in your suitcase for you holiday. \nModel is 5\' 7\" and wears a UK size 6.\nMaterial: \n82% Cotton\n17% Polyester\n1% Elastane\nApprox measurements for a UK size 6:\nWaist on one side 37cm\nLength from waist to bottom of leg 22cm', '2023-12-08 12:37:52', '2023-12-08 12:37:52'),
(2388, 'Light Denim Hot Pant Shorts Ex-Branded', 'EMORY-001', 65, 1, 'Light Denim Hot Pant Shorts Ex-Branded. These cute denim shorts have two front pockets and two back pockets. They have belt loops. There is a metal button and zip fly. The legs have a small fringe. These shorts are ex-branded and will therefore have the labels cut. Team up with one of our cropped tops to complete your outfit ready for the summer. Throw in your suitcase for you holiday. \nModel is 5\' 7\" and wears a UK size 6.\nMaterial: \n82% Cotton\n17% Polyester\n1% Elastane\nApprox measurements for a UK size 6:\nWaist on one side 37cm\nLength from waist to bottom of leg 22cm', '2023-12-08 12:37:54', '2023-12-08 12:37:54'),
(2389, 'White Denim Skinny Jeans', 'SERAPHINA-001', 0, 0, 'White Denim Skinny Jeans. These gorgeous white summer jeans have a metal button and zip fly. Two front pockets and two back pockets. Great for your holidays. Team up with a little top and high sandals to complete your outfit. \nModel is 5\' 7\" and wears a UK size 8\nMaterial:\n98% Cotton\n2% Elastane\nApprox measurements for UK size 8:\nWaist on one side 40cm\nLength from waist to ankle 100cm\nInside leg measurement 80cm', '2023-12-08 12:37:56', '2023-12-08 12:37:56'),
(2390, 'Light Denim Skinny Jeans with Crinkle Detail', 'MELINA-001', 80, 1, 'Light Denim Jeans with Crinkle Detail\nKey features:\n- Creased Effect To The Front\n- Single Button Closure And Zip Fastening\n- Two Front And Back Traditional Pockets\nMaterial: \n- 98% Cotton\n- 2% Elastane\nMeasurements:\nModel is 5\' 7\" and wears a size UK8\n- Waist across one side approx. 35.5cm-(UK8), 37.5cm-(UK10), 40.5cm-(UK12), 42.5cm-(UK14), 43.5cm-(UK16)\n- Inner Leg Approx. 80cm\n- Length from waist to hem 104.5cm', '2023-12-08 12:37:58', '2023-12-08 12:37:58'),
(2391, 'White Lacey Open Back Midi Dress Ex-Branded', 'PARTHENIA-001', 0, 0, 'White Lacey Open Back Midi Dress. This sleeveless dress is fully lined. It has an open back with a hook and eye fastening at the back of the neck. The material has a slight stretch for a comfy fit. Fabulous for a prom or a special night out. This dress is ex-branded and will, therefore, have the labels cut.\nModel wears a UK size 8.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a UK size 8:\nChest across one side 32cm\nLength from shoulder to hem 122cm', '2023-12-08 12:38:00', '2023-12-08 12:38:00'),
(2392, 'Dipped Hem Black Blouse', 'IDRM5802-001', 0, 0, 'Dipped Hem Black Blouse. This smart blouse has a long exaggerated dipped hem at the back. The front looks like a shirt style blouse with a collar and buttons up the front, long sleeves and cuffs. Fabulous with leggings or jeans. Lightweight and ideal for your suitcase. This blouse has a loose fit and could be used as an overshirt too. \nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n100% Polyester\nApprox measurements for a UK size 8:\nChest on one side 47cm\nLength from the shoulder to the hem at the front 63cm\nFrom the back 114cm', '2023-12-08 12:38:01', '2023-12-08 12:38:01'),
(2393, 'Coral High Necked Swing Dress', 'NOAM-001', 5, 1, 'Coral High Necked Swing Dress. This checked dress is stunning in coral and cream check. The neck is high and the dress is sleeveless. A 1960\'s style swing dress. Great for a night out, for work or for your holidays. Team up with a little clutch bag and a pair of sandals to complete your outfit. \nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a UK size 8:\nChest across one side 42cm\nLength from shoulder to hem 83cm', '2023-12-08 12:38:03', '2023-12-08 12:38:03'),
(2394, 'Scuba Floral Open Back Bodycon Midi Dress Ex-Branded', 'LAMELA-001', 0, 0, 'Scuba Floral Open Back Bodycon Midi Dress Ex-Branded. This floral sleeveless dress has a square neckline and is stretchy for a perfect fit. It has an open back with a hook and eye fastening at the back of the neck. There is a small back split in the dress. Excellent quality dress. Fabulous for a prom or a special night out. This dress is ex-branded and will, therefore, have the labels cut.\nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a UK size 8:\nChest across one side 35cm\nLength from shoulder to hem 105cm', '2023-12-08 12:38:04', '2023-12-08 12:38:04'),
(2395, 'Scuba Floral Bodycon Dress', 'MARAH-001', 1, 1, 'Bodycon Floral Sleeveless Dress. This pretty scuba floral dress has blues, purples, yellows and greens in the design. The neck is round and the dress is sleeveless. The material is stretchy for a perfect fit. Great for your summer holiday as it won\'t need ironing when you arrive! Team up with a pair of our sandals and a clutch bag to complete your outfit.\nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a UK size 8:\nChest across one side 37cm\nLength from shoulder to hem 85cm', '2023-12-08 12:38:06', '2023-12-08 12:38:06'),
(2396, 'Cream Lace Cotton Shirt', 'ZAHLIA-002', 0, 0, 'Light Denim Shirt With Lace Detail. Update your wardrobe with this gorgeous shirt! Perfect for a day at the mall with friends! Simply team up with skinny jeans, pumps and a handbag! Key features include button fastening down the front and on the cuffs, and two pockets on the chest completed with lace detail on the sleeves and back. Grab this gorgeous shirt for just under £5.99. Ex-Branded(Labels may be cut off)\nWe recommend to order one size smaller.\nModel is 5\'7 and is wearing a size UK 6.\nMaterial:\n100% Cotton\nApproximate measurements for a size UK 6:\nChest: 41cm\nTotal length(Shoulder to hem) : 72cm', '2023-12-08 12:38:08', '2023-12-08 12:38:08'),
(2397, 'Spiked Block Heel Platform Shoe', 'ES12629-001', 2, 1, 'Spiked Block Heel Shoe.\nMain Material:\nFaux Suede\nHeel Height: 13cm', '2023-12-08 12:38:11', '2023-12-08 12:38:11'),
(2398, 'White Cropped Jeggings', 'LETTIE-002', 23, 1, 'White Cropped Jeggings. Update your wardrobe this season with these gorgeous jeggings! It has elasticated waist for the perfect fitting, completed with two back pockets! Team up with a top and sandals to complete the comfy casual summer look! Great value for only 4.99!\nMaterials:\n65% Cotton\n25% Polyester\n10% Elastane\nApproximate measurements for a size Small:\nWaist: 27cm Stretching to 41cm\nTotal Length: 71cm', '2023-12-08 12:38:15', '2023-12-08 12:38:15'),
(2399, 'Mesh Insert Black Playsuit', 'GRAZKE-002', 11, 1, 'Mesh Insert Black Playsuit. Updated with signature new season styling, this playsuit is the perfect to kick start to your party wardrobe. Team up with a pair of killer heels, an oversized clutch bag and a knock-out necklace! It has a mesh insert to waist, scoop round neckline completed with spaghetti straps with cross over back! Ex-Branded(Labels may be cut off)\nModel is wearing a 5\'7 and wearing a size UK 8.\nMaterial:\n95% Polyester\n5% Elastane\nApproximate measurements for Size UK 8:\nChest: 32cm\nTotal length (Shoulder to hem) : 74cm', '2023-12-08 12:38:16', '2023-12-08 12:38:16'),
(2400, 'Cream Lightweight Shirt', 'LUCE-002', 10, 1, 'Cream Lightweight Shirt. Refresh your wardrobe with this gorgeous shirt. Its lightweight so it would be perfect for those sunny days out! It has button fastening with short hold up sleeves! Just team up with cropped skinny jeans and ballerinas to complete the ultimate lush look! Great value for only £4.99!\nModel is wearing a size UK 8.\nMaterial:\n10% Viscose\nModel is wearing a size UK 8:\nChest: 47cm\nTotal length (shoulder to hem): Front 56cm Back 63', '2023-12-08 12:38:18', '2023-12-08 12:38:18'),
(2401, 'Red Shirt with Smock Detail on the Shoulder', 'CEALY-002', 0, 0, 'Red Shirt with Smock Detail on the Shoulder. This grandad collar shirt has 5 buttons at the front. There is a smock gathering just under the shoulders and a small pocket on the left side of the chest. The sleeves can be rolled up and secured with a tab and button or left down. This shirt is ex-branded and will therefore have the labels cut out.\nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n100% Viscose\nApprox measurements for a UK size 8:\nChest across one side 45cm\nLength from shoulder to hem 71cm', '2023-12-08 12:38:20', '2023-12-08 12:38:20'),
(2402, 'Gorgeous Chiffon Top', 'MILCAH-002', 6, 1, 'Gorgeous Chiffon Top. Ladies, this top is a must have! It has a three button fastening with a open cross over effect at the back! Its super flattering! It always has a polka dot detail and a round neckline! Just team up with white skinny jeans and sandals for the ultimate starstruck look! Great value for only £4.99! Don\'t miss out today!\nModel is 5\'7 and wearing a size UK 8.\nMaterial:\n100% Polyester\nApprox measurements for a size UK 8:\nChest: 43cm\nTotal length (shoulder to hem): 50cm', '2023-12-08 12:38:22', '2023-12-08 12:38:22'),
(2403, 'Black Swing Dress With Long Sleeves', 'ROSCHANA', 0, 0, 'Black Swing Dress With Long Sleeves. Ladies, this gorgeous black dress can be worn for any occasion! From your every day look to your night out on the dance floor! Simply team up with peep toe heels and a oversized clutch to complete the look! Great value for only £5.99! Don\'t miss out and be the first to grab your\'s today!\nModel is 5\' 7\" and wears a size S/M.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a S/M:\nChest across one side 42cm\nLength from shoulder to hem 82cm', '2023-12-08 12:38:24', '2023-12-08 12:38:24'),
(2404, 'Blue Paisley Chiffon Top', 'ITPM5879-002', 38, 1, 'Blue Paisley Chiffon Top. Refresh your wardrobe with this gorgeous top! It has a paisley pattern with a round neckline, completed with two side slits! Team with white skinny jeans, sandals and a handbag all for under £10\'s! Great value for only £4.99!\nModel is 5\'7 and wearing a size UK 8.\nMaterial:\n100% Polyester\nApproximate measurements for a size UK 8:\nChest: 48cm\nTotal length (Underarm to hem): 68cm', '2023-12-08 12:38:26', '2023-12-08 12:38:26'),
