(2454, 'Fully Lined Lace Detail Fitted FishTail Maxi Dress in White', 'DEMET-001', 0, 0, 'Fully Lined Lace Detail Fitted FishTail Maxi Dress in White. This stunning dress has netting above the bust and on the back with a button fastening at the back of the neck and a peephole. There is a concealed zip at the back. The bust area is padded so that it can be worn without a bra. The dress is fitted and flares out at the bottom. Slightly stretchy for a perfect fit.  The lace has a shimmer to it. Perfect for a Summer Ball, Prom or wedding. \nModel is 5\' 7\" and wears a size Small.\nMaterial:\n100% Polyester\nApprox measurements for size Small:\nChest across one side 40cm\nLength from shoulder to hem 148cm', '2023-12-08 12:40:24', '2023-12-08 12:40:24'),
