(2457, 'Lace and Chiffon Party Dress', 'HM1670', 0, 0, 'Lace and Chiffon Party Dress. This pretty dress has a lace detail top and gathered chiffon skirt. The dress is fully lined. The bust is padded so that you don\'t need to wear a bra and has a sweetheart neckline. There are sequins and beads around the waist in the shape of flowers. There is a concealed zip at the back and detachable, adjustable straps. The back is elasticated for a comfy fit.  Fabulous with a pair of high sandals. \nModel is 5\' 7\" and wears a size Small.\nMaterial:\n100% Polyester\nApprox measurements for size Small:\nChest across one side 34cm\nLength from bust to hem 72cm', '2023-12-08 12:40:28', '2023-12-08 12:40:28'),
(2458, 'Peach Stretch Skinny Jeans', 'FLAVIE-001', 0, 0, 'Peach Stretch Skinny Jeans. These jeans have a button and zip fly. Two front pockets and two back ones. The material is stretchy for a perfect fit. Good quality skinny jeans. Pick one of our tops or camisoles to complete your outfit. Fabulous bright colour for the summer. Please note that the label says a UK size bigger than they actually are. The EU size is correct. \nModel is 5\' 7\" and wears a UK size 6.\nMaterial:\n71% Cotton\n27% Polyester\n2% Elastane\nApprox measurements for a UK size 6:\nWaist 33cm\nLength from waist to ankle 96cm, inside leg 78cm', '2023-12-08 12:40:31', '2023-12-08 12:40:31'),
(2459, 'Red Stretch Skinny Jeans', 'HELEDD-001', 7, 1, 'Red Stretch Skinny Jeans. These jeans have a button and zip fly. Two front pockets and two back ones. The material is stretchy for a perfect fit. Good quality skinny jeans. Pick one of our tops or camisoles to complete your outfit. Fabulous bright colour for the summer. Please note that the label says a UK size bigger than they actually are. The EU size is correct. \nModel is 5\' 7\" and wears a UK size 6.\nMaterial:\n71% Cotton\n27% Polyester\n2% Elastane\nApprox measurements for a UK size 6:\nWaist 33cm\nLength from waist to ankle 96cm, inside leg 78cm', '2023-12-08 12:40:33', '2023-12-08 12:40:33'),
(2460, 'Blue Stretch Skinny Jeans', 'CILLA-001', 0, 0, 'Blue Stretch Skinny Jeans. These jeans have a button and zip fly. Two front pockets and two back ones. The material is stretchy for a perfect fit. Good quality skinny jeans. Pick one of our tops or camisoles to complete your outfit. Fabulous bright colour for the summer. Please note that the label says a UK size bigger than they actually are. The EU size is correct. \nModel is 5\' 7\" and wears a UK size 6.\nMaterial:\n71% Cotton\n27% Polyester\n2% Elastane\nApprox measurements for a UK size 6:\nWaist 33cm\nLength from waist to ankle 96cm, inside leg 78cm', '2023-12-08 12:40:35', '2023-12-08 12:40:35'),
(2461, 'Mint Stretch Skinny Jeans', 'ISADORA-001', 0, 0, 'Mint Stretch Skinny Jeans. These jeans have a button and zip fly. Two front pockets and two back ones. The material is stretchy for a perfect fit. Good quality skinny jeans. Pick one of our tops or camisoles to complete your outfit. Fabulous bright colour for the summer. Please note that the label says a UK size bigger than they actually are. The EU size is correct. \nModel is 5\' 7\" and wears a UK size 6.\nMaterial:\n71% Cotton\n27% Polyester\n2% Elastane\nApprox measurements for a UK size 6:\nWaist 33cm\nLength from waist to ankle 96cm, inside leg 78cm', '2023-12-08 12:40:37', '2023-12-08 12:40:37'),
(2462, 'Black Toe Post Sandals with Cleated Sole', '50953-002', 71, 1, 'Black Toe Post Sandals with Cleated Sole. These gorgeous sandals are perfect for summer! They have a padded sole for extra comfort and an adjustable strap for the perfect fit! Ladies, grabs yours today for only £4.99! They will be simply perfect for those long holiday walks with your loved ones! \nMaterial:\nFaux Leather\nApprox Measurements:\nHeel height 2.5cm', '2023-12-08 12:40:39', '2023-12-08 12:40:39'),
(2463, 'Flower Toe Post Sandals', '50199-002', 65, 1, 'Flower Toe Post Sandals. Ladies, these sandals are a must have! They are super cute! They have a flower toe post with adjustable straps and cork style contoured footbed for extra comfort and style! Available in four colours! Grab yours today for only £4.99!\nMaterial:\nFaux Leather\nApprox Measurements:\nHeel height 2.5cm', '2023-12-08 12:40:41', '2023-12-08 12:40:41'),
(2464, 'Lip Toe Post Sandals', '50814-002', 40, 1, 'Lip Toe Post Sandals. These sandals totally bring out the wow factor! They have a lip attached to the T-Bar strap with a adjustable ankle strap! The sole has cushion for extra comfort! Great value for only £4.99!\nMaterial:\nFaux Leather\nApprox Measurements:\nHeel height is just over 1cm', '2023-12-08 12:40:46', '2023-12-08 12:40:46'),
(2465, 'Stripy Ballerina Shoes with Cleated Sole', '15082-002', 6, 1, 'Stripy Ballerina Shoes. Ladies, don\'t miss out on these gorgeous stripy ballerinas! They have a pointy toe with a bow and a rubber cleated sole for grip. Great value for only £4.99! \nMaterial:\nFaux Leather\nApprox measurements:\nHeel height 0.8cm', '2023-12-08 12:40:48', '2023-12-08 12:40:48'),
(2466, 'Stripe Canvas Pumps', '51116-002', 105, 1, 'Stripe Canvas Pumps. Every girl should own a pair of stripe pumps! They are simply perfect for all day wear and they will never go out of fashion! These gorgeous pumps have a slight elastication on the front with a round toe. The sole has a rubber grip! \nApprox measurements:\nHeel height 0.4cm', '2023-12-08 12:40:50', '2023-12-08 12:40:50'),
(2467, 'Patent Loafers with Love Knot Detail', 'FM15111-001', 41, 1, 'Patent Flat Loafers with Love Knot Detail. These faux leather patent loafers have a love knot gold coloured metal design on the front. The sole is gripped. The inside sole is padded for extra comfort. Stylish loafer available in Fuchsia and Light Beige.\nMaterial:\nFaux Leather Patent', '2023-12-08 12:40:52', '2023-12-08 12:40:52'),
(2468, 'Cleated Sole Chunky Heel Patent Sandals', '50094-001', 0, 0, 'Cleated Sole Chunky Heel Patent Sandals. These faux leather patent sandals have a chunky heel and platform. They have two wide straps over the front and a heel band with buckle fastening. The sole is padded for extra comfort. \nMaterial:\nFaux Leather\nApprox meaurements:\nHeel 6.5cm\nPlatform 3cm', '2023-12-08 12:40:55', '2023-12-08 12:40:55'),
(2469, 'Navy Lace Up Platform Plimsoll', '14749-001', 6, 1, 'Navy Lace Up Platform Plimsoll. The navy canvas plimsolls are lace up and have a white platform sole. Excellent quality. Wear with a pair of jeans or shorts to complete your outfit. \nMaterial:\nCanvas\nApprox measurements:\nWidth of platform 3cm', '2023-12-08 12:40:57', '2023-12-08 12:40:57'),
(2470, 'Elegant Chiffon Maxi Dress', 'PHILIPA-002', 0, 0, 'Elegant Chiffon Maxi Dress. This floor sweeping maxi dress is a stunning red carpet knockout, perfect for special occasions! It has diamante detail around the neckline and tie belt also with diamante detail completed with a button fastening at the back. To complete the look simply team up with a pair of gorgeous sandal heels and a clutch bag! Hurry up ladies and don\'t miss out on this dress for only £5.99!\nModel is wearing a size S/M.\nMaterial: \n100% Polyester\nApproximate measurements:\nChest: 50cm\nTotal length (shoulder to hem): 140cm', '2023-12-08 12:40:59', '2023-12-08 12:40:59'),
(2471, 'Pretty Peplum Blazer', 'LS2232-002', 0, 0, 'Pretty Peplum Blazer. The ultimate wardrobe essential, this premium fit peplum blazer will carry you through every occasion in style! It peplum detail back hem and one button fastening. Great value for only £5.99!\nModel is wearing a size Small.\nMaterial:\n100% Polyester\nApprox measurements for a size Small:\nChest on one side 38cm\nLength from shoulder to 51cm', '2023-12-08 12:41:02', '2023-12-08 12:41:02'),
(2472, 'Scuba Midi Skirt Available In Plus Sizes', 'EVONEE-002', 35, 1, 'Scuba Midi Skirt. This scuba skirt has a concealed waistband which is elasticated for extra comfort. The material is stretchy for a comfy fit. This skirt would be great with one of our cropped tops or a little blouse. The skirt will not crease and is, therefore, ideal for your holiday suitcase. Great value for only £4.99!\nModel wears a UK size 8.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a UK size 8:\nWaist on one side 31cm\nLength from waistband to hem 65cm', '2023-12-08 12:41:05', '2023-12-08 12:41:05'),
(2473, 'Beige Checked Slip Over Chiffon Style Ex-Branded Blouse', 'UDELL-001', 0, 0, 'Beige Checked Slip Over Chiffon Style Blouse. The blouse has a black check running through it. The cuffs, neckline and back of shoulders are plain black. The slip over style has an open V-neck with a slight gathering at the bottom. The bottom of the blouse is rounded, going up slightly at the sides. This is a loose fitting blouse. Fabulous to wear to work or just with your jeans. This blouse is ex-branded and will, therefore, have the brand name cut from the label. \nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n100% Polyester\nApprox measurements for a UK size 8:\nChest across one side 46cm\nLength from shoulder to hem 62cm', '2023-12-08 12:41:08', '2023-12-08 12:41:08'),
(2474, 'Check Detail A-Line Sleeveless Dress', 'YG09-001', 45, 1, 'Check Detail A-Line Sleeveless Dress. This gorgeous dress is fully lined. It has a round neck and is sleeveless. There is a concealed back zip. Lightweight so ideal for your holiday suitcase. Keep cool and look very smart. Team up with a pair of our summer sandals to complete your outfit. \nModel is 5\' 7\" and wears a size Small.\nMaterial:\n100% Polyester\nApprox measurements for a size Small:\nChest across one side 44cm\nLength from shoulder to hem 87cm', '2023-12-08 12:41:10', '2023-12-08 12:41:10'),
(2475, 'Layered Swing Heart Detail Camisole Top Ex-Branded', 'YANNI-001', 0, 0, 'Layered Swing Heart Detail Camisole Top Ex-Branded. This cute camisole top is a must for your summer wardrobe. It has a tiny heart pattern all over the top layer. The second layer is plain black and hangs below the top layer. The camisole dips slightly in the front. Super little top to either dress up or down. Great to throw in your suitcase, it won\'t need ironing and is very light. \nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n100% Polyester\nApprox measurements for a UK size 8:\nChest across one side 40cm\nLength from shoulder to hem 61cm', '2023-12-08 12:41:12', '2023-12-08 12:41:12'),
(2476, 'Crepe Feel Sleeveless Swing Blouse Available in Plus Sizes', 'VASHTI-001', 13, 1, 'Crepe Feel Swing Blouse Available in Plus Sizes. This blouse has a collar and front button fastening. It is sleeveless but has a small cap detail on the shoulder. The back is dipped. This blouse is loose fitting. Great blouse for work or a night out. \nModel is 5\' 7\" and wears a UK size 10.\nMaterial:\n97% Polyester\n3% Elastane\nApprox measurements for a UK size 8:\nChest across one side 49cm\nLength from shoulder to hem 60cm at the front, 68cm at the back.', '2023-12-08 12:41:14', '2023-12-08 12:41:14'),
(2477, 'Soft Floral Blouse with Neck Tie - Available in Plus Sizes', 'XANDRA-001', 7, 1, 'Soft Floral Blouse with Neck Tie - Available in Plus Sizes. This pretty soft touch blouse has front button fastening and a neck tie. The sleeves have a small frill at the shoulder. This blouse is loose fitting to keep you cool. Great for those hot summer days and for your holiday suitcase. Wear with a pair of our shorts or jeans to complete your look. \nModel is 5\' 7\" and wears a UK size 10.\nMaterial:\n100% Viscose\nApprox measurements for a UK size 10:\nChest across one side 48cm\nLength from shoulder to hem 66cm', '2023-12-08 12:41:16', '2023-12-08 12:41:16'),
(2478, 'Baggy Racerback Tunic Dress with Photograph Detail', '13014-001', 45, 1, 'Baggy Racerback Tunic Dress with Photograph Detail. This long stretchy top is big and baggy. The edges are rough cut with a large photograph on the front. Big, long armholes. Great to wear over a tight cami or boob tube. Could wear with shorts or leggings too. Cool summer wear. Lightweight for your suitcase. Ideal beach cover up. Great for your Zumba class!\nModel is 5\' 7\" and wears a size S/M.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a size S/M:\nChest across one side 46cm\nLength from shoulder to hem 89cm', '2023-12-08 12:41:18', '2023-12-08 12:41:18'),
(2479, 'Monochrome Dress with Lace Back Detail', 'R073-001', 0, 0, 'Monochrome Dress with Lace Back Detail. This stunning dress will be a bonus to anyone\'s wardrobe! The front has a monochrome design. The back is white with a detail zip. The shoulders at the back are lace and there is an opening from the zip to the button at the top. There is a chiffon panel at the hem This dress has a round neck, is sleeveless and fully lined. Great value dress. Limited Stock, order now to avoid disappointment.\nModel is 5\'7\" and wears a size Small.\nMaterial:\n100% Polyester\nApprox measurements for a size Small:\nChest across one side 43cm\nLength from shoulder to hem 88cm', '2023-12-08 12:41:19', '2023-12-08 12:41:19'),
(2480, 'Royal Blue Lace Detail Playsuit', 'HM1786', 0, 0, 'Royal Blue Lace Detail Playsuit. The playsuit has a sweetheart neckline. Above the bust is lace. The back has lace down to the waist and through to the long sleeves. There is a zip at the back and the main body is lined for comfort. Super for a party or clubbing. Throw in your suitcase for your summer holiday!\nModel is 5\' 7\" and wears a size Small.\nMaterial:\n100% Polyester\nApprox measurements for a size Small:\nChest across one side 40cm\nLength from shoulder to crotch 74cm', '2023-12-08 12:41:21', '2023-12-08 12:41:21'),
(2481, 'Floral Soft T-Shirt Dress Ex-Branded', 'MAEV-001', 0, 0, 'Floral Soft T-Shirt Dress. This dress is soft and slightly stretchy for a comfortable fit. It has a round neck and long sleeves. The hem is curved for a flattering look. The flowers are in shades of grey. The base colour is light pink. Super little dress to throw in your suitcase, lightweight too. This dress is ex-branded and will therefore have cut labels. \nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a UK size 8:\nChest across one side 38cm\nLength from shoulder to hem 84cm', '2023-12-08 12:41:22', '2023-12-08 12:41:22'),
(2482, 'Lace Playsuit with Deep V-Back Detail - Limited Stock!', 'HM1794-001', 0, 0, 'Lace Playsuit with Deep V-Back Detail. Stunning white lace playsuit. The main body is fully lined. The front has a wide rounded neckline. There is a deep V at the back and a zip. Long unlined sleeves. The lace has some shimmer in places. Really gorgeous playsuit. Team up with a pair of our sandals and a clutch bag to complete your outfit. \nModel is 5\' 7\" and wears a size Small.\nMaterial:\n100% Polyester\nApprox measurements for a size Small:\nChest across one side 39cm \nLength from shoulder to crotch 72cm', '2023-12-08 12:41:24', '2023-12-08 12:41:24'),
(2483, 'Deep Coral Scuba Midi Skirt - Available in Plus Sizes', 'PHEDRA-001', 1, 1, 'Deep Coral Scuba Midi Skirt. This scuba midi skirt has a concealed elasticated waist for extra comfort. The material is stretchy for a perfect fit. Gorgeous deep coral colour to mix and match with your bright summer wardrobe. Take on holiday, it won\'t need ironing! Limited stock so order early!\nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n95% polyester\n5% Elastane\nApprox measurements for a UK size 8:\nWaist across one side 32cm stretching to 37cm\nLength from waist to hem 65cm', '2023-12-08 12:41:25', '2023-12-08 12:41:25'),
(2484, 'Floral Scuba Midi Skirt - Available in Plus Sizes', 'MAIRWEN-001', 37, 1, 'Floral Scuba Midi Skirt. This scuba midi skirt has a concealed elasticated waist for extra comfort. The material is stretchy for a perfect fit. Gorgeous deep turquoise and blue colours to mix and match with your bright summer wardrobe. Take on holiday, it won\'t need ironing! Limited stock so order early!\nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n95% polyester\n5% Elastane\nApprox measurements for a UK size 8:\nWaist across one side 32cm stretching to 36cm\nLength from waist to hem 65cm', '2023-12-08 12:41:27', '2023-12-08 12:41:27'),
(2485, 'Ex-Branded Summer Floral Leggings', 'THELA-001', 1, 1, 'Ex-Branded Summer Floral Leggings. Elasticated waist for extra comfort. Team up with a cropped top or cami to complete your outfit. Ideal for traveling in as super comfortable and soft. These pretty floral leggings are ex-branded and may therefore have the labels cut.\nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a UK size 8:\nWaist across one side 32cm stretching to 38cm\nLength from waist to ankle 102cm', '2023-12-08 12:41:29', '2023-12-08 12:41:29'),
(2486, 'Floral Trousers with Wet Look Detail', 'ADDIE-001', 41, 1, 'Floral Stretchy Trousers with Wet Look Detail. These bright coloured floral trousers have a loose wide elasticated waistband in a wet look material. The sides have the same material and the trim on the two side pockets as well. Soft material with a slight sheen. There is a stretch to the material for a comfy fit. Bright floral colours including red, orange, green and purple. Great to travel in and very light for your summer suitcase.\nModel is 5\' 7\" and wears a size S/M.\nMaterial:\n95% Polyamide\n5% Spandex\nApprox measurements for a size S/M:\nWaist across one side 32cm stretching to 45cm\nLength from waistband to ankle 96cm', '2023-12-08 12:41:31', '2023-12-08 12:41:31'),
(2487, 'High Neck Sleeveless Swing Dress', 'NELLA-001', 13, 1, 'High Neck Sleeveless Swing Dress. This textured material swing dress has a high neck and is loose fitting. It is sleeveless and the arm holes are oversized. The material is stretchy for a comfy fit. Super dress for your summer holiday. Cool and easy to care for. Team up with a little clutch bag and sandals to complete your outfit. \nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n95% polyester\n5% Elastane\nApprox measurements for a UK size 8:\nChest across one side 48cm\nLength from shoulder to hem 81cm', '2023-12-08 12:41:32', '2023-12-08 12:41:32'),
(2488, 'Stretchy Summer Flared Trousers', 'CAMERONA-001', 23, 1, 'Stretchy Summer Flared Trousers. These lightweight patterned trousers are a welcome addition to any wardrobe. Stretchy for a comfy fit with a wide elasticated waistband. Slightly flared at the bottom. Throw in your suitcase for your holiday or wear on the journey to be comfortable. Great as lounge wear or as a cover up pair of beach trousers. Super value!\nModel is 5\' 7\" and wears a size Medium.\nMaterial:\n90% Polyester\n10% Spandex\nApprox measurements for a size Medium:\nWaist on one side 39cm stretching to 49cm\nLength from waist to ankle 101cm', '2023-12-08 12:41:34', '2023-12-08 12:41:34'),
(2489, 'Stretchy Summer Flared Animal Print Trousers', 'AL-001', 46, 1, 'Stretchy Summer Flared Animal Print Trousers. These lightweight animal printed trousers are a welcome addition to any wardrobe. Stretchy for a comfy fit with a wide elasticated waistband. They are slightly see through and flared at the bottom. Throw in your suitcase for your holiday or wear on the journey to be comfortable. Great as lounge wear or as a cover up pair of beach trousers. Super value!\nModel is 5\' 7\" and wears a size Medium.\nMaterial:\n90% Polyester\n10% Spandex\nApprox measurements for a size Medium:\nWaist on one side 37cm stretching to 51cm\nLength from waist to ankle 103cm', '2023-12-08 12:41:35', '2023-12-08 12:41:35'),
(2490, 'Abstract Print Trousers with Wet Look Detail', 'CANDIDA-001', 26, 1, 'Abstract Print Stretchy Trousers with Wet Look Detail. These abstract print  trousers have a loose wide elasticated waistband in a wet look material. The sides have the same material and the trim on the two side pockets as well. Soft material with a slight sheen. There is a stretch to the material for a comfy fit. The abstract print has black, white and pink in the design. Great to travel in and very light for your summer suitcase.\nModel is 5\' 7\" and wears a size S/M.\nMaterial:\n95% Polyamide\n5% Spandex\nApprox measurements for a size S/M:\nWaist across one side 33cm stretching to 46cm\nLength from waistband to ankle 94cm', '2023-12-08 12:41:37', '2023-12-08 12:41:37'),
(2491, 'Scuba Midi Skirt - Available in Plus Sizes', 'PHYLLIDA-001', 96, 1, 'Scuba Midi Skirt. This scuba midi skirt has a concealed elasticated waist for extra comfort. The material is stretchy for a perfect fit. Gorgeous royal blue and bright red colours to mix and match with your bright summer wardrobe. Take on holiday, it won\'t need ironing! Limited stock so order early!\nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n95% polyester\n5% Elastane\nApprox measurements for a UK size 8:\nWaist across one side 31cm stretching to 36cm\nLength from waist to hem 63cm', '2023-12-08 12:41:38', '2023-12-08 12:41:38'),
(2492, 'Gorgeous Floral Scuba Midi Skirt - Available in Plus Sizes', 'MARCELLA-001', 48, 1, 'Floral Scuba Midi Skirt. This scuba midi skirt has a concealed elasticated waist for extra comfort. The material is stretchy for a perfect fit. Gorgeous deep red and grey colours to mix and match with your bright summer wardrobe. Take on holiday, it won\'t need ironing! Limited stock so order early!\nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n95% polyester\n5% Elastane\nApprox measurements for a UK size 8:\nWaist across one side 32cm stretching to 36cm\nLength from waist to hem 66cm', '2023-12-08 12:41:41', '2023-12-08 12:41:41'),
(2493, 'Monochrome Denim Sleeveless Jacket', 'PHAMIE-001', 29, 1, 'Monochrome Denim Sleeveless Jacket. This sleeveless vest jacket has frayed arm holes. There is a collar and front zip in a biker style jacket. Two poppas at the bottom of the zip. Two poppas on the side tabs too. Great with jeans, trousers or a skirt. An extra layer in the cooler evenings. \nModel is 5\' 7\" and wears a size S/M.\nMaterial:\n100% Cotton\nApprox measurements for a size S/M:\nChest across one side 42cm\nLength from shoulder to waist 47cm', '2023-12-08 12:41:43', '2023-12-08 12:41:43'),
(2494, 'Dipped Hem Sheer Vest Top', 'HM1443-001', 75, 1, 'Dipped Hem Sheer Vest Top. This sheer top would be great over a boob tube or your bikini on the beach. It is loose fitting, has a round neck and is sleeveless. The back hem is dipped and it is very lightweight. Ideal for throwing in your holiday suitcase. \nAvailable in black and bright coral. Limited stock in this vest top so do not delay ordering.\nModel is 5\' 7\" and wears a size Small.\nMaterial:\n100% Polyester\nApprox measurements for a size Small:\nChest across one side 44cm\nLength from shoulder to hem at the front 53cm, at the back 63cm', '2023-12-08 12:41:45', '2023-12-08 12:41:45'),
