(2538, 'Tank Top with Embroidered Tribal Eagle Design', 'HM1461-001', 82, 1, 'Tank Top with Embroidered Tribal Eagle Design. This cute top has a round neck and loose arm holes. There is a tribal embroidered eagle on the front in black. Available in white, grey, neon pink and neon yellow. Super holiday t-shirt, fabulous to wear with your shorts this summer.\nModel is 5\' 7\" and wears a size Small.\nMaterial\n95% Polyester\n5% Spandex\nApprox measurements for a size Small:\nChest across one side 40cm\nLength from shoulder to hem 59cm', '2023-12-08 12:43:07', '2023-12-08 12:43:07'),
(2539, 'Racer Back T-Shirt with Skull Design', 'A2314-001', 50, 1, 'Racer Back T-Shirt with Skull Design. This t-shirt has a round neck and racer back design. There is a skull print on the front wearing a top hat, moustache and bow tie. There is a red love heart on the side of the hat. Soft material. Super little top for your summer holiday, take a few in your suitcase, lightweight.\nModel is 5\' 7\" and wears a S/M.\nMaterial:\n94% Rayon\n6% Spandex\nApprox measurements for a size S/M:\nChest across one side 40cm\nLength from shoulder to hem 65cm', '2023-12-08 12:43:11', '2023-12-08 12:43:11'),
(2540, 'Dark Grey Chiffon Sleeveless Blouse Ex-Branded Limited Stock', 'GOLDIE-001', 0, 0, 'Dark Grey Chiffon Sleeveless Blouse. This sheer blouse is sleeveless, has a collar and gold coloured buttons all the way up the front. There is one breast pocket. Super for wearing with jeans to dress down or a skirt or trousers for work. This blouse has a loose fit. This item is ex-branded and will therefore have the labels cut. \nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n100% Polyester\nApprox measurements for a UK size 8:\nChest across one side 44cm', '2023-12-08 12:43:13', '2023-12-08 12:43:13'),
(2541, 'Chiffon Sheer Blouse Ex-Branded Available in Plus Sizes', 'HILLARY-001', 3, 1, 'Chiffon Sheer Blouse Ex-Branded Available in Plus Sizes. This blosue is sleeveless and has gold coloured buttons all the way up the front. It has one breast pocket. Super for dressing down with jeans or wearing with a skrt for the office. This blouse has a loose fit. Very limited stock in both colours. This item is ex-branded and will therefore have the labels cut.\nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n100% Polyester\nApprox measurements for a UK size 8:\nChest across one side 42cm\nLength from shoulder to hem 63cm', '2023-12-08 12:43:15', '2023-12-08 12:43:15');
