(2542, 'Leah Pleat Midi Skirt', '19280-004', 65, 1, 'Leah Pleat Midi Skirt. This gorgeous sun pleated styled skirt, is pleated all the way round, with an elasticated waist for a perfect fit. This skirt has is suitable for the sunny days and an evening out. it has minor stripes of  white complimenting the waist band. This can be dressed up or down!\nModel is  5\' 7\" and wears a UK size 8\nMaterial:\n100% Polyester \nApprox measurements:\nWaist across one side: 34cm\nLength from waist to Hem: 80cm', '2023-12-08 12:43:20', '2023-12-08 12:43:20'),
(2543, 'Alice Sheer shirt', 'ALICE-004', 0, 0, 'Alice Sheer shirt.This elegant shirt has quarter length sleeves.Transparent evening tops are everywhere this season. Shake it up in sheer shirts. style up your work attire and be in trend. Add attitude in an A line skirt and slinky strappy heels for an  evening night out.\nModel is 5\' 7\" and wears a UK size 6\nMaterial:\n100% Polyester \nApprox Measurement:\nAcross the chest :46cm\nTotal length (shoulder to hem) :70cm', '2023-12-08 12:43:21', '2023-12-08 12:43:21'),
(2544, 'Multi Print Palazzo Trousers', 'ESMEE-004', 21, 1, 'Multi Print Palazzo Trousers.  This is for wide leg lovers, quirky culottes make a comeback . Feel free in this and  kick back in quilted joggers and textured track pants for a sports luxe vibe. This has beautiful prints that can be mixed and matched with funky sandals this summer.\nModel is 5\' 7\" and wears a UK size M\nMaterial: \n90% Polyester \n10% Spandex\nApprox Measurements:\nWaist on one side 37cm stretching to 53cm\nLength from top of waist to hem 100cm', '2023-12-08 12:43:23', '2023-12-08 12:43:23'),
(2545, 'Alexis 3/4 Sleeve Sheer Shirt', 'CALLIE-004', 0, 0, 'Alexis 3/4 Sleeve Sheer Shirt .This elegant shirt has has buttons down the front  and on the 3/4 length sleeves.Transparent evening tops are everywhere this season. Shake it up in sheer shirts. style up your work attire and be in trend. Add attitude in an A line skirt and slinky strappy heels for an  evening night out. Get the look now this for less than £5.\nModel is 5\' 7\" and wears a UK size 6\nMaterial:\n100% Polyester \nApprox Measurement:\nAcross the chest :44cm\nTotal length (shoulder to hem) :72cm', '2023-12-08 12:43:25', '2023-12-08 12:43:25'),
(2546, 'Quilted Jacket with Faux Leather Shoulder Pads', 'A2454-001', 0, 0, 'Quilted Jacket with Faux Leather Shoulder Pads. Coats and jackets are a serious statement this season. Whether you’re taking on timeless with a trench, keeping it quirky in a kimono, or being bad ass in a bomber jacket. This has a bold silver zip, poppers and a soft feel. Mix and match with some jeans and a pair of platform boots for the ultimate in girly grunge look.\nModel is 5\' 7\" and wears a size Small\nMaterial: \n100% Polyester\nApprox Measurements for a size Small:\nChest on one side 43cm\nLength from shoulder to hem 53cm', '2023-12-08 12:43:27', '2023-12-08 12:43:27'),
(2547, 'High Rise Black Denim Skirt  Ex-branded', 'IESHA-004', 0, 0, 'High Rise Black Denim Skirt. This black denim skirt styled in this season\'s high rise trend, with three buttons in front for an edgy 70\'s vibe. This item is ex-branded and will therefore have the labels cut. There are two comfy pockets at the front and two at the back. The material is stretchy for a comfy fit. Throw on some strappy sandals for a hippy summer look or some platforms.\nModel is a 5\' 7\" and wears a UK size 8\nMaterial:\n78% cotton\n20.5% Polyester \n1.5% Elastane  \nApprox Measurement:\nWaist across one side 36cm\nLength from waist to hem 45cm', '2023-12-08 12:43:29', '2023-12-08 12:43:29'),
(2548, 'Jersey Washed Cropped Jeans', 'ALICIA-004', 0, 0, 'Jersey Washed Cropped Jeans, Jeans are a simple staple that can be styled statement.  This item is ex-branded therefore you will find the label is cut out inside. This Cropped pair has silver studs on the front and back pockets. The bottom has a fold. This light pair of jeans can is a great summer look. Throw on a basic tee by day, or style yourself sophisticated in  a cami top and strappy heels for a knock-out summer night out .\nModel is 5\' 7\" and a wears a UK size 6\nMaterial:\n78% Cotton\n20.5% Polyester \n1.5% Elastane \nApprox measurement:\nWaist across one side 36cm stretching to 41cm\nLength from waist to hem 68cm', '2023-12-08 12:43:31', '2023-12-08 12:43:31'),
(2549, 'Tropical Print Sheer Top', 'MAGGIE-001', 35, 1, 'Tropical Print  Sheer Top.  This item is ex-branded therefore you will find the label is cut out inside. This has a scoop neckline and 3/4 elasticated sleeves for a snug feel. This style looks effortless for every day wear , toughened up with short or jeans . Upgrade for nights out with a figure-skimming fit and thigh high split and take this trendy piece dance floor.\nModel is 5\' 7\" and wears a UK size S\nMaterial:\n100% Polyester\nApprox Measurement:\nAcross Chest on one side 52cm\nLength from Shoulder to hem 71cm', '2023-12-08 12:43:33', '2023-12-08 12:43:33'),
(2550, 'Beaded Neckline Detail Maxi Dress', 'ILSA-004', 0, 0, 'Adriana Beaded Maxi Dress. This beautiful maxi has a beaded v-neck scoop neckline.This is elegant, feminine and with just the right amount of sparkle, below the bust the long, floaty dress sweeps the floor. Fully lined with an elasticated waistline to ensure the perfect fit for your figure, you\'ll want to wear this dress again and again! Why not team it up with a some heeled sandals and a clutch bag for an evening to remember.\nModel is 5\' 7\" and wears a UK size S/M\nMaterial:\n100% Polyester \nApprox measurements:\nChest across one side 33cm\nLength from shoulder to hem 144cm', '2023-12-08 12:43:35', '2023-12-08 12:43:35'),
(2551, 'Cropped Dark Denim Jeans', 'LORETTA-004', 0, 0, 'Cropped Dark Denim Jeans.  This a ex-branded item therefor the label will be cut out. These gorgeous denim jeans are perfect for the spring season! Team up with a top and sandals to complete the look! It has a button and zip fastening, two silver studded pockets with a fold up hem. \nMaterial: \n78% cotton \n20.5% polyester \n1.5% Elastane \nModel is 5\' 7\" and  wears a size UK8\nApproximate measurements :\nWaist across one side 39cm\nLength from waist to hem 67cm', '2023-12-08 12:43:41', '2023-12-08 12:43:41'),
(2552, 'Sheer Blouse With Ruffle Neckline', 'LOLLY-004', 2, 1, 'Sheer Blouse With Ruffle Neckline.This blouse has wide floaty sleeves and has an adjustable tie front to be styled to your preference. This Light weight blouse is super for dressing down with jeans or wearing with a skirt for the office. This blouse has a loose fit. Available in hard to find sizes. This item is ex-branded and will therefore have the labels cut.\nModel wear a UK size 10\nMaterial:\n100% Polyester \nApprox measurements:\nChest across one side 46cm\nLength from shoulder to hem 68cm', '2023-12-08 12:43:43', '2023-12-08 12:43:43'),
(2553, 'Light Pink Chiffon Fully Lined Dress', 'ORALEE-004', 24, 1, 'Light Pink Chiffon Fully Lined Dress.This pretty dress has a small V at the front and is sleeveless. This dress come with a faux leather belt with side loops that is adjustable to your preference. This gorgeous piece is fully lined. Fabulous for a night out or to wear to work! Mix and Match it with sandals or a pair of our comfortable pumps.\nModel is 5\' 7\" and wears a UK size 6.\nMaterial:\n100% Polyester\nLining is 100% Polyester\nApprox measurements for a UK size 6:\nChest across one side 42cm\nLength from shoulder to hem 86cm', '2023-12-08 12:43:46', '2023-12-08 12:43:46'),
(2554, 'Floral Print Sleeveless Blouse', 'ALISA-004', 0, 0, 'Floral Print Short Sleeve Blouse. This  stylish blouse has a collar and front button fastening from top to bottom. This light weight piece has short sleeve that can be seen as sleeveless . The back is slightly dipped. This blouse is loose fitting. Great blouse for work or a night out. Throw on a pair of jeans and heels to complete your look.  \nModel is 5\' 7\" and wears a UK size 10.\nMaterial:\n100% Viscose \nApprox measurements for a UK size 8:\nChest across one side 50cm\nLength from shoulder to hem 63cm at the front, 68cm at the back.', '2023-12-08 12:43:48', '2023-12-08 12:43:48'),
(2555, 'Frilly Flower Print Blouse', 'HOLLY-004', 10, 1, 'Frilly Flower Print Blouse. This elegant blouse has a scoop neckline with three pleats on the front  and has buttons on the back from top to bottom. It is sleeveless but has pretty pleated frill detail on the shoulder. This blouse is loose fitting. The beautiful vibrant colour can be match with a pair of vibrant pumps or heels to complete the look and team it up with a pair of our white jeans for the casual vibe! \nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n100%Viscose\nApprox measurements for a UK size 8:\nChest across one side 43\nLength from shoulder to hem 65cm', '2023-12-08 12:43:50', '2023-12-08 12:43:50'),
(2556, 'Fringe Detail Open Back Top', 'GLENDA-004', 22, 1, 'Fringe Detail Open Back Top. Make your top pop this season with this sheer open back top. This popular trendy piece is dipped at the back. The fringes fall from the hem of the top all around. This has a crew neckline and is short sleeved. Stay in trend this summer with this show stopper, finish the look by mixing a pair of our denim shorts and ankle boots! perfect for summer activities.\n Model is 5\' 7\" and wears a UK size S.\nMaterial:\n95% Polyester\n5% Elastane\nApprox measurements for a UK size 8:\nChest across one side 45cm\nLength from shoulder to hem 50cm at the front, 78cm at the back.', '2023-12-08 12:43:52', '2023-12-08 12:43:52'),
(2557, 'Tropical Bodycon Maxi Dress', 'LORREN-004', 1, 1, 'Tropical Bodycon Maxi Dress. This gorgeous maxi dress is simply perfect for holiday! Its tropical blend of prints is definitely  trending this summer. It has a crew neckline. Slightly stretchy for the perfect fit! Team up with sandals and a denim jacket to complete the look! Available in plus sizes!\nModel wears a UK S.\nMaterial: \n95% Polyester \n5% Spandex\nApprox measurements: \nChest across one side 37cm \nLength from shoulder to hem 141cm', '2023-12-08 12:43:55', '2023-12-08 12:43:55'),
(2558, 'Stretchy Acid Washed Skinny Jeans Ex-Branded', 'GRISELDA-001', 0, 0, 'Stretchy Acid Washed Skinny Jeans. These skinny jeans have two front pockets and two back ones. Zip fly and metal button fastening. The shade may vary slightly between light and dark denim. Team up with one of our cropped tops or t-shirts to complete your outfit. These jeans are ex-branded and will therefore have the labels cut.\nModel is 5\' 7\" and wears a UK size 6.\nMaterial:\n72% Cotton\n26% Polyester\n2% Elastane\nApprox measurements for UK size 6:\nWaist across one side 36cm\nLength from waist to ankle 97cm, inside leg 78cm', '2023-12-08 12:43:58', '2023-12-08 12:43:58'),
(2559, 'Seer Sucker Summer Shirt Available In Plus Sizes', 'PRIMULA-001', 77, 1, 'Seer Sucker Summer Shirt. This gorgeous shirt is simply perfect for summer! Team up with skinny jeans and ballerinas to complete the look! It has button fastening at the front completed with a open collar! Great value.\nModel is wearing a size UK 8/10.\nMaterial : \n100% Cotton\nApproximate measurements for a size UK 8/10:\nChest : 46cm \nTotal length (Shoulder to hem): 63cm', '2023-12-08 12:43:59', '2023-12-08 12:43:59'),
(2560, 'Black and White Floral Shopper / Beach Bag', '14008WH-001', 0, 0, 'Black and White Floral Shopper / Beach Bag. This bag is great for shopping and would also make a great beach or travel bag. There is a large inside zipped compartment and a small side zipped pocket. The top of the bag has a zip fastening for added security. The handles are thin and black, they go down the sides of the bag to the base. There are four studs on the flat bottom of the bag. \nMaterial:\nFaux Leather\nApprox meaurements:\nWidth 40cm\nHeight 28cm\nDepth 14cm', '2023-12-08 12:44:05', '2023-12-08 12:44:05'),
(2561, 'Floral Patent Handbag with Metal Handle Detail', 'MY485GR-001', 0, 0, 'Floral Patent Bag with Metal Handle Detail. This bag has a floral design on the front and back with a sparkle throughout. The sides are a plain contrasting grey. There is a detachable, adjustable shoulder strap. The top has a full zip for extra security. There is a zipped pocket in side and two open pockets too. The grab handles are metal and hinged to lay open when needed. There are four studs on the flat bottom.\nMaterial:\nFaux Leather\nApprox measurements:\nWidth 33cm\nHeight 23cm\nDepth 13cm', '2023-12-08 12:44:06', '2023-12-08 12:44:06'),
(2562, 'Patent Floral Grab Handbag with Metal Slide Opening', '352AP3-001', 0, 0, 'Patent Floral Grab Handbag with Metal Slide Opening. This unusual bag has a metal run around the opening with two pull tags that slide up the bag to close and down to open. It has two grab handles and a detachable, adjustable shoulder strap. There is a zipped inside pocket and an open one too. There are four studs on the flat bottom. \nMaterial:\nFaux Leather\nApprox measurements:\nWidth 30cm\nHeight 23cm\nDepth 12cm', '2023-12-08 12:44:07', '2023-12-08 12:44:07'),
(2563, '2 in 1 Floral Shopper Bag Plus Handbag with Detachable Shoulder Strap', '9012-001', 0, 0, '2 in 1 Floral Shopper Bag Plus Handbag with Detachable Shoulder Strap. Fantastic value. 2 bags for the price of 1. The shopper has two long handles. The pouch handbag has a full zip across the top. A zip pocket with a metal tag on the outside of the bag. There is a zipped compartment inside the bag plus a zipped side pocket and an open one as well. The pouch handbag has a detachable, adjustable shoulder strap. The pouch handbag fits inside the shopper or it can be worn separately. \nMaterial:\nFaux Leather\nApprox meaurements of shopper:\nWidth 40cm\nHeight 28cm\nWidth 13cm\nApprox measurements of pouch bag:\nWidth 34cm\nHeight 21cm\nDepth 11cm', '2023-12-08 12:44:07', '2023-12-08 12:44:07'),
(2564, 'Off the Shoulder Striped Bodycon Dress Ex-Branded Limited Stock', 'SIRI-001', 0, 0, 'Off the Shoulder Striped Bodycon Dress Ex-Branded. The dress is black and white striped and is textured. It is off the shoulder and has short sleeves.The material is slightly stretchy for a perfect fit. Wear with a pair of our heels and a classy handbag to complete your outfit. This dress is ex-branded and will therefore have the labels cut.\nModel is 5\'7\" and wears a UK size 6\nMaterial:\n100% Polyester\nApprox measurements for a UK size 6:\nChest across one side 36cm\nLength from front of neck to hem 78cm', '2023-12-08 12:44:09', '2023-12-08 12:44:09'),
(2565, 'Loose-Fitting Butterfly Chiffon Gypsy Blouse Ex-Branded', 'PEPPI-001', 0, 0, 'Loose Fitting Butterfly Chiffon Gypsy Blouse. This top has a gathered neckline with a peephole in the front. Could be worn off one shoulder. This blouse has short flared sleeves and will be very cool. It has green and purple butterflies all over. This blouse is loose fitting and depending on how you want it to look, you may want to order one size down. Please see the measurements for the size UK8 to compare. This blouse is ex-branded and will therefore have the labels cut.\nModel is 5\'7\" and wears a UK size 8\nMaterial:\n100% Polyester\nApprox measurements for a UK size 8:\nChest across one side 48cm\nLength from shoulder to hem 63cm', '2023-12-08 12:44:11', '2023-12-08 12:44:11'),
(2566, 'Chiffon Overlay Dipped Hem Blouse in Four Colours', 'HALLE-001', 21, 1, 'Chiffon Overlay Blouse in Four Colours. This overlay blouse has a round neck and drop shoulder sleeves. The under shirt has buttons at the front. This blouse is loose fitting and has a dipped hem. Great with jeans or a pair of trousers for the office. Loose and cool. Available in four super colours.\nModel is 5\' 7\" and wears a S/L\nMaterial:\n100% Polyester\nApprox measurements for a size S/M:\nChest across one side 46cm\nLength from shoulder to hem 74cm at the front, 80cm at the back', '2023-12-08 12:44:13', '2023-12-08 12:44:13'),
(2567, 'Dipped Hem Blouse Ex-Branded', 'PETERINA-001', 2, 1, 'Dipped Hem Blouse. This royal blue blouse has a round neck and short sleeves. It has a dipped hem and would be great for the office or an evening out. Team up with a pair of jeans or trousers to complete your outfit. This blouse is ex-branded and will therefore have the labels cut.\nModel is 5\' 7\" and wears a size UK 8\nMaterial:\n100% Polyester\nApprox measurements for a size UK 10:\nChest across one side 44cm\nLength from shoulder to hem 63cm at the front, 77cm at the back', '2023-12-08 12:44:15', '2023-12-08 12:44:15'),
(2568, 'Pleated Neck Back Buttoned Top', 'CAROL-001', 9, 1, 'Pleated Neck Back Buttoned Top. This cute little top had a round neck with pleats at the front. It is sleeveless with frills on the armholes. There are buttons all the way down the back. Super top to wear with a pair of our shorts and feel cool this summer. Floral pattern in blue, turquoise and mocha.\nModel is 5\' 7\" and wears a UK size 8\nMaterial:\n100% Viscose\nApprox measurements for a UK size 8:\nChest across one side 40cm\nLength from shoulder to hem 64cm', '2023-12-08 12:44:17', '2023-12-08 12:44:17'),
(2569, 'White Cross Over Bust Pencil Dress with Pleats', 'LORINDA-001', 8, 1, 'Cross Over Bust Pleated Detail Shift Dress. This textured white dress has a cross over at the bust, a wide waistband at the front with pleats underneath. It has a V-neck and is sleeveless. This dress is stretchy for a perfect fit. It is panelled and fitted at the back.\nModel is 5\' 7\" and wears a UK size 8\nMaterial:\n100% Polyester\nApprox measurements for a UK size 8:\nChest across one side 36cm\nLength from shoulder to hem 91cm', '2023-12-08 12:44:19', '2023-12-08 12:44:19'),
(2570, 'Flower Print Sleeveless Top', 'MAURA-004', 17, 1, 'Flower Print Sleeveless Top. Show some skin in this beautiful  floral top. It has silk look material with a multi colored floral design. It has a  low scoop neckline and fits loosely. Wear with skinny jeans and gladiator sandals to complete your outfit. You can also mix and match with some heels for a night out.\nModel wears a UK Size 8\nMaterial: \n100% Polyester \nApprox Measurements:\nChest across one side 45cm\nFrom shoulder to hem 65cm', '2023-12-08 12:44:21', '2023-12-08 12:44:21'),
(2571, 'Black Chiffon Sleeveless Dress', 'ROMEY-004', 21, 1, 'Black Chiffon Sleeveless Dress. This dress has a round neckline and is sleeveless. This dress has an elasticated waistline for a comfortable fit. This pretty dress is fully lined and lightweight . Fabulous for a night out or to wear to work.\nThis dress is ex-branded and will therefore have the labels cut.\nModel is 5\' 7\" and wears a UK Size 8.\nMaterial: \n96% Polyester\n4%  Elastane \nApprox measurements for UK size 8:\nChest across one side 45cm\nFrom shoulder to hem 89cm', '2023-12-08 12:44:23', '2023-12-08 12:44:23'),
(2572, 'Polka Dot Dress', 'PATSY-004', 0, 0, 'Polka Dot Dress. This elegant polka dot dress has a crossover gathered waist. This dress has a round neckline and a concealed zip at the back. The arms are 3/4 length. This dress can be worn for an evening out or styled down for a work day.\nModel wears a UK Size 8.\nMaterial:\n100% Polyester\nApprox measurements:\nChest across one side 38cm\nLength from shoulder to hem 96cm', '2023-12-08 12:44:25', '2023-12-08 12:44:25'),
(2573, 'Long Sleeve Flower Print Sheer Blouse', 'PETRA-004', 0, 0, 'Long sleeve Flower Print Sheer Blouse. This Vibrant blouse has a multi coloured floral print all over it. It has a peter pan collar and a opening at the back of the neck with one button. This sheer blouse is light in weight and has a loose fit. It can be mixed and matched with a pair of Skinny jeans or pumps for a casual look.\nModel is 5\' 7\" and wears a UK Size 8.\nMaterial:\n100% Polyester\nApprox Measurements for a UK Size 8:\nChest across one side 50cm\nLength from shoulder to hem 64cm', '2023-12-08 12:44:27', '2023-12-08 12:44:27'),
(2574, 'Black Cross Over Bust Pencil Dress with Pleats', 'HEATHER-005', 0, 0, 'Black Cross Over Bust Pencil Dress with Pleats. This textured dress has a cross over at the bust, a wide waistband at the front with pleats underneath. It has a V-neck and is sleeveless. This dress is stretchy for a perfect fit. It is panelled and fitted at the back. Slightly Sheer.\nModel is 5\'7\" and wears a UK size 8\nMaterial:\n100% Polyester\nApproximate measurements for a UK size 8:\nChest across one side: 34cm\nTotal length (Shoulder to Hem): 90cm', '2023-12-08 12:44:28', '2023-12-08 12:44:28'),
(2575, 'Floral Print Skuba Mini Dress Ex-Branded', 'PARIS-004', 80, 1, 'Floral Print Skuba Mini Dress Ex-Branded. This pretty dress has a scooped neck, it has is stretchy to ensure a perfect fit. This little number is super for a girly night out, throw in some of our killer heels for your perfect outfit. This dress is ex-branded and will therefore have the labels cut.\nModel wears a UK Size 8.\nMaterial:\n92% Polyester \n8% Elastane \nApprox measurements for a UK size 8:\nChest across one side 35m\nFrom shoulder to hem 79cm', '2023-12-08 12:44:30', '2023-12-08 12:44:30'),
(2576, 'High Necked Sleeveless Ribbed Dress Ex-Branded', 'LOLITA-004', 37, 1, 'High Necked Sleeveless Ribbed Dress Ex-Branded  A midi length is a must-have! Get the Sleek Look this summer with our trending sleeveless high necked dress. Be fashion-forward with this stretchy easy fit dress. Super for an evening out. Team up with a pair of our stunning heels and a clutch bag to complete your outfit.\nThis dress is ex-branded, therefore the labels will be cut.\nModel wears a UK Size 8.\nMaterial:\n95% Polyester\n5% Elastane\nApprox Measurements for a UK size 8:\nChest across one side 34cm, Stretches out  to 45cm.\nFrom shoulder to hem 92cm', '2023-12-08 12:44:32', '2023-12-08 12:44:32'),
