(2621, 'Palazzo Trousers', 'POLLY-004', 21, 1, 'Palazzo Trousers. Palazzo Pants are very much in vogue at the moment, they were a great trend back then in 60\'s too. The waist  is elasticated for a comfortable fit. Just put on any loose flowing top in plain colours or with a bold print,  your flip-flops and match a big tote bag and you’re good to go with a casual yet chic look.\nModels is 5\' 7\" and wears  a UK Size 10.\nMaterial:\n95% Polyester \n5% Elastane \nApprox Measurements of a UK Size 10:\nWaist across one side 33cm stretching to 41cm.\nWaist to hem: 101cm', '2023-12-08 12:45:45', '2023-12-08 12:45:45'),
(2622, 'Lip Print Diamante Sleeveless Top', 'GAINOR-004', 1, 1, 'Lip Print Diamante Sleeveless Top. Update your wardrobe with this gorgeous top!  Vibrant lip print on the front with dazzling diamante on top. The hem is slightly dipped. Team up with a pair of skinny jeans and sandals for the ultimate spring look! It is sleeveless with a round neckline. Great value for your money.\nModels is 5\' 7\" wears a one size .\nMaterial: \n35% cotton\n65% Polyester\nApprox Measurements:\nChest across one side : 43cm\nLength from shoulder to hem: 69cm', '2023-12-08 12:45:48', '2023-12-08 12:45:48');
