(2623, 'Dipped Hem Top with Back Detail Ex-Branded', 'CARLA-005', 0, 0, 'Dipped Hem Top with Back Detail  Ex-Branded. This sleeveless top has a round pleated neck at the front with a cut out detail at the back. The material is light which means it\'s perfect for summer days, in the office or evenings out. This item is ex-branded and will therefore have the labels cut.\nModel is 5\' 7\" and wears a UK size 8\nMaterial:\n100% Polyester\nApproximate measurement for UK size 8:\nChest across one side: 42cm\nLength from Shoulder to Hem: 59cm', '2023-12-08 12:45:49', '2023-12-08 12:45:49'),
(2624, 'Tropical Sunset Print Long Sleeved Dress', 'CHELLE-004', 2, 1, 'Sunset Pattern Long Sleeve Dress. Whether you’re a fan of the trend or not, there’s no denying that long sleeved dresses are everywhere this season. This has a colorful tropical sunset print on both sides with plain sleeves, perfect for a summers day.\nModel is 5\' 7\" and wears a UK size M.\nMaterial:\n100% Viscose\nApprox Measurements for a size Medium:\nchest across one side: 46cm\nShoulder to hem: 85cm', '2023-12-08 12:45:51', '2023-12-08 12:45:51'),
(2625, 'Layered Bodycon Dress', 'ISABEL-005', 0, 0, 'Layered Bodycon Dress. This simple sleeveless style mini length dress can be dressed up or down. It has a layered top going round the back to a cross over at the back of the neck. Super evening dress in fuchsia pink.\nModel is 5\' 7\" and wears a UK Size 8.\nMaterial:\n95% Polyester \n5% Elastane\nApprox measurements for a UK Size 8:\nChest across one side: 37cm\nShoulder to hem: 85cm', '2023-12-08 12:45:52', '2023-12-08 12:45:52'),
(2626, 'Yellow Striped T-Shirt Ex-Branded Available in Plus Sizes', 'CATRINA-004', 23, 1, 'Yellow Striped T-shirt. This tee has short sleeves and a keyhole detail on the front. Great to team up with a pair of shorts this summer. \nThis T-Shirt is ex-branded and will therefore have the labels cut.\nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n100% Cotton\nApprox Measurements for a UK size 8:\nChest across one side: 38cm\nLength from shoulder to hem: 63cm', '2023-12-08 12:45:54', '2023-12-08 12:45:54'),
(2627, 'Cream Layered Bodycon Dress', 'CARA-004', 0, 0, 'Cream Layered Bodycon Dress. Match this stunning dress with one of our large clutch bags and a pair of heels. \nKey Features:\n- Round neck\n- Sleeveless\n- Stretchy material for a comfy fit\n- Layered top\nMaterial:\n95% Polyester, 5% Elastane\nMeasurements for a UK size 8:\n- Model is 5\' 7\" and wears a UK size 8\n- Chest across one side approx 36cm\n- Length shoulder to hem approx 85cm', '2023-12-08 12:45:56', '2023-12-08 12:45:56'),
(2628, 'Floral Print Midi Bodycon Dress with Open Back Ex-Branded', 'ROMA-005', 0, 0, 'Floral Print Midi Bodycon Dress with Open Back Detail. Ex-Branded. This is the perfect dress to wear for those summer nights! This dress is a midi length that comes just below the knee. The sweetheart neckline adds an elegant touch whilst the fitted waist  brings out the very best in your figure. The back is open with a fastening at the back of the neck. This material is soft and light as to ensure a comfy fit. This item is ex-branded and will therefore have the labels cut.\nModel is 5\' 7\" and wears a UK size 8\nMaterial:\n95% Polyester\n5% Elastane\nApproximate measurements for UK size 8:\nChest across one side: 29cm\nLength from shoulder to hem: 102cm', '2023-12-08 12:45:58', '2023-12-08 12:45:58'),
(2629, 'Sheer Sleeveless Dipped Hem Shirt', 'ROSCHELLE-004', 21, 1, 'Sheer Sleeveless Dipped Hem Shirt. This shirt is very light-weight and, therefore, ideal for your suitcase. The back is dipped hem and there are two side splits that come to just under the bust. Take your look to a whole new level with this sheer checked sleeveless shirt. It\'s a chic option for around-the-clock wear. rock it up with some leather bottoms, and boots for a rock chic look. \nModel is 5\'7\' and wears a UK size 8.\nMaterial:\n100% Polyester \nApprox measurement for a UK size 8:\nChest across one side: 45cm\nShoulder to hem: 60cm', '2023-12-08 12:46:00', '2023-12-08 12:46:00'),
(2630, 'Flower Print Sleeveless High Neck Top', 'ROSARIO-004', 0, 0, 'Flower Print High Neck Top. This top is sleeveless and has a high neck. The armholes are cut away and slant up towards the neck. This top is stretchy and has a loose fit. \nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n95% Viscose, 5% Elastane\nApprox measurements of a UK size 8:\nChest across one side 40cm\nLength from shoulder to hem 53cm', '2023-12-08 12:46:01', '2023-12-08 12:46:01'),
(2631, 'Heart Print and Diamante Dipped Hem Top', 'CARRIE-004', 0, 0, 'Heart Print Diamanté Sleeveless Top. Update your wardrobe and dazzle today, with this gorgeous top!  Vibrant \'heart with headphones\' print on the front complimented with dazzling diamanté on top. The hem is dipped. Team up with a pair of skinny jeans and sandals for the ultimate look! It is sleeveless with a round neckline and a loose fit.\nModel is 5\' 7\"and  wears one size.\nMaterial: \n35% cotton, 65% Polyester\nApprox Measurements:\nChest across one side : 48cm\nLength from shoulder to hem: 71cm', '2023-12-08 12:46:03', '2023-12-08 12:46:03'),
(2632, 'Butterfly Print Diamante Sleeveless Top', 'MARLENE-004', 44, 1, 'Butterfly Print Diamanté Sleeveless Top. Update your wardrobe and dazzle today, with this gorgeous top!  There are purple flowers with a multi coloured butterfly design on the front complemented with dazzling diamanté. The back is plain black and slightly sheer, the hem is dipped. It is sleeveless with a round neckline. It has a loose fit.\nModel is 5\' 7\" and wears one size.\nMaterial: \n35% cotton\n65% Polyester\nApprox Measurements:\nChest across one side : 48cm\nLength from shoulder to hem: 71cm', '2023-12-08 12:46:04', '2023-12-08 12:46:04'),
(2633, 'Butterfly Design Diamante Top', 'CHEVONEE-004', 51, 1, 'Butterfly Print Diamante Sleeveless Top. Update your wardrobe and dazzle today, with this gorgeous top! There are pink flowers and a multi coloured butterfly design on the front complimented with dazzling diamante on top. The hem is slightly dipped. Team up with a pair of skinny jeans and sandals for the ultimate ook! It is sleeveless with a round neckline. \nModel is 5\' 7\" and wears one size.\nMaterial: \n35% cotton\n65% Polyester\nApprox Measurements:\nChest across one side : 44cm\nLength from shoulder to hem: 70cm', '2023-12-08 12:46:05', '2023-12-08 12:46:05'),
