(2635, 'Horse Print Diamante Dipped Hem Top', 'CHARLOTTE-004', 5, 1, 'Black Flower Print Shift Dress Ex-branded. Stay fashion- forward in this short sleeved mid-length shift dress this summer. Key feature on this dress is the cut-out V at the back giving it that edgy look that\'s in this season. The material is light weight and has a lose fitting, mix and match with a pair of our sandals or dress it up with one of our killer heels. \nModel is 5\'7 and wears UK size 8:\nMaterial:\n100% Viscose\nApprox measurements for a UK size 8:\nChest across one side: 42cm\nLength from shoulder to hem: 94cm', '2023-12-08 12:46:07', '2023-12-08 12:46:07'),
(2636, 'Stylish Teal Blazer Ex-branded Available in Plus Sizes', 'ORIANA-004', 0, 0, 'Stylish Teal Blazer Ex-branded. Look splendid in this bold stylish blazer. This can be mixed and matched with a pair for jeans. Dress is up with a a pair of our killer hills for a girls night out. Get this sleek look now! \n(Ex-branded, labels maybe cut out).\nModel is 5\' 7\" and wears a UK size 8.\nMaterial: \n100% Polyester\nApprox measurements for a UK size 8:\nChest across one side: 40cm\nLength from Shoulder to hem: 66cm', '2023-12-08 12:46:09', '2023-12-08 12:46:09'),
(2637, 'Stylish Cerise Blazer Ex-branded Available in Plus Sizes', 'MARALYN-004', 0, 0, 'Stylish Cerise Blazer Ex-branded. Look splendid in this bold stylish blazer. This can be mix and matched with a pair of jeans, leggings, skirt or dress. Choose a pair of our killer heels and dress the jacket up for a girls night out. Get this sleek look now! \nThis blazer is ex-branded and will therefore have the labels cut.\nModel is 5\' 7\" and wears a UK size 8.\nMaterial: \n100% Polyester\nApprox measurements for a UK size 8:\nChest: 40cm\nShoulder to hem: 66cm', '2023-12-08 12:46:11', '2023-12-08 12:46:11'),
(2638, 'Printed Swing Vest Top', 'ITPM5697-004', 55, 1, 'Printed Swing Vest Top. This top has a loose fit. Swing vests are so in this summer, keep cool in this beautiful printed top now! This has a crew neckline, with a peep-hole and button at the back. Perfect for festival fun, holidays and even a cool casual chic vibe. Look for the shorts that match this top perfectly.\nAdd a pair of jeans and sandals to complete the look. \nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n100% Viscose \nApprox measurements for a UK size 8:\nChest across one side: 45cm\nLength shoulder to hem: 50cm', '2023-12-08 12:46:13', '2023-12-08 12:46:13'),
