(2640, 'Shiny Stretchy Leggings', 'PILLAR-004', 0, 0, 'Shiny Stretchy Leggings. This Nylon version is perfect for the gym or for adding a fun accent to any outfit. Show off your curves in this form fitting legging. The waist is elasticated. Shake it up with a crop top or layered top with pumps. \nModel is 5\' 7\" and wears a UK size 8.\nMaterial:\n80% Nylon\n20% Elastane\nApprox measurements for a UK size 8:\nWaist across one side: 32cm relaxed\nLength from waist to hem: 88cm', '2023-12-08 12:46:16', '2023-12-08 12:46:16'),
