(2645, 'Light Blue Striped T-shirt Ex-branded', 'GEMMA-004', 18, 1, 'Light Blue Striped T-shirt Ex-branded. Fall in love with this tee! it has a comfortable fit, it is striped and has a round neckline with a keyhole design in the front. This top is perfect to wear with skinny jeans and hi-tops for the ultimate casual look! This item is ex-branded and will therefore have the labels cut.\nModel is 5\' 7\" and wears a UK size 10.\nMaterial:\n100% Cotton\nApprox Measurements for a UK size 10:\nChest across one side: 38cm\nLength from shoulder to hem: 62cm', '2023-12-08 12:46:25', '2023-12-08 12:46:25'),
