(2647, 'Vest Style Tunic with Side Slits and Dipped Hem', 'CLEOPATRA-004', 19, 1, 'Vest Style Tunic Dress with Side Slit and Dipped Hem. This tunic has a round neckline. This dress is stretchy for a comfy fit. The side slits also mean you can team this tunic up with denim shorts and trainers to bring out a casual summery look. This lovely piece is perfect to take on holiday and wear over your bikini when needed.\nModel is 5\' 7\" and wears a size S/M\nMaterial:\n95% Viscose\n5% Elastane\nApproximate measurement for a size S/M:\nChest across one side 40cm\nLength from shoulder to hem 106cm', '2023-12-08 12:46:30', '2023-12-08 12:46:30'),
