(2649, 'Blue Tropical Print Cape Top', 'ALISA-005', 0, 0, 'Tropical Print Cape Top. It has a cape design with openings on the sleeves to use having your arms out or put your arms through to the ends for a covered look. This cape style top look is in right now and this vibrant coloured sheer top can be worn in so many ways. It can be worn as an overlay with a vest top, boob tube or cami. You can mix it up with a pair of our skinny jeans or a pair of denim shorts. \nModel is 5\' 7\" and  wears one size.\nMaterial:\n100% Viscose \nApprox measurements:\nChest across one side: 95cm\nLength from shoulder to hem: 75cm', '2023-12-08 12:46:33', '2023-12-08 12:46:33'),
