(2651, 'Long Back Chiffon Sleeveless Top', 'HARMONY-005', 17, 1, 'Dipped Hem Sheer Chiffon Top. This is a brilliant choice this summer, the chiffon material keeps you cool in the warm weather whilst the tropical flower print is perfect for days out in the sun. This simple elegant piece is perfect teamed up with a pair of skinny jeans and sandals. \nModel is 5\' 7\" and wears a size Small\nMaterial:\nFront - 95% Viscose\n            5% Spandex\nBack - 100%Polyester\nApproximate measurement for size Small:\nChest across one side 41cm\nLength from shoulder to Hem: 63cm', '2023-12-08 12:46:34', '2023-12-08 12:46:34'),
(2652, 'V Neck Sleeveless Blouse Ex-Branded', 'CHARITTY-005', 0, 0, 'V Neck Sleeveless Blouse Ex-Branded. This sleeveless blouse is a very versatile piece, great for wearing to the office and even better for days out of the office. The V-neck gives this top an added edge whilst still remaining elegant. This top has a bold black edging around the armholes, neckline and across the shoulders. This top has a loose fit. This item is ex-branded and will therefore have the labels cut.\nModel is 5\' 7\" and wears a UK size 6\nMaterial:\n96% Polyester\n4% Elastane\nApproximate measurements for a UK size 6:\nChest across one side 47cm\nLength from shoulder to hem: 58.5cm', '2023-12-08 12:46:36', '2023-12-08 12:46:36'),
