(2664, 'Lime Dipped Hem Top with Back Detail  Ex-Branded Available in Plus Sizes', 'MARIANA-004', 0, 0, 'Dipped Hem Top with Back Detail  Ex-Branded. This sleeveless top has a round pleated neck at the front with a cut out detail at the back. The material is light which means it\'s perfect for summer days, in the office or evenings out. This item is ex-branded and will therefore have the labels cut.\nModel is 5\' 7\" and wears a UK size 8\nMaterial:\n100% Polyester\nApproximate measurement for UK size 8:\nChest across one side: 42cm\nLength from Shoulder to Hem: 59cm', '2023-12-08 12:46:49', '2023-12-08 12:46:49'),
(2665, 'Stylish Block Colour Shift Dress With Zip Detail', 'CHERRELLE-005', 0, 0, 'Block Colour Shift Dress With Zip Detail. This dress is a modern take on a very classic style. The block colour style is very much on trend this season, and the classic shift dress is perfect to wear on a day in the office. This dress has a stretchy, textured material. There is a concealed zip at the back. It is the perfect piece to wear for a special meeting or for an evening out!\nModel is 5\' 7\" and wears UK size 8\nMaterial:\n100% Polyester\nApproximate measurement for a UK size 8:\nChest across one side: 38cm\nLength from shoulder to hem: 96cm', '2023-12-08 12:46:51', '2023-12-08 12:46:51'),
(2666, 'Layered Camisole Top Ex-branded', 'SORELL-004', 0, 0, 'Layered Camisole Top Ex-branded. This camisole top has a  v-neck, layered sheer material and statement  spaghetti straps. The material is light which means it\'s perfect for summer days in the office or summer nights out. This item is ex-branded and will therefore have the labels cut.\nModel is 5\'7 and wears a UK size 8.\nMaterial: \n100% Polyester \nApprox measurements for a UK size 8:\nChest across one side: 42cm\nLength from shoulder to hem: 64cm', '2023-12-08 12:46:53', '2023-12-08 12:46:53'),
(2667, 'Dipped Hem Blouse Ex-Branded Available in Plus Sizes', 'PEACHES-005', 25, 1, 'Dipped Hem Blouse Ex-Branded. This blouse is sleeveless and has a dipped hem. The neck is round. It has a colourful flower print. This blouse has a loose fit. This item is ex-branded and will therefore have the labels cut.\nModel is 5\' 7\" and wears a UK size 10\nMaterial:\n100% Polyester\nApproximate measurements for a UK size 10:\nChest across one side 47cm\nLength from shoulder to hem 60cm', '2023-12-08 12:46:55', '2023-12-08 12:46:55'),
(2668, 'Black Shopper Handbag with Stitch Detail', 'H5898-001', 0, 0, 'Black Shopper Handbag with Stitch Detail. This handbag has two grab handles and a detachable, adjustable shoulder strap. There is a stitched design on the front of the bag and a zip compartment on the back. The bag has a full top opening zip for extra security. There is an internal zipped pocket and an open one too. \nMaterial:\nSynthetic\nApprox measurements:\nWidth across the front 38cm\nHeight 27cm\nWidth 3cm', '2023-12-08 12:46:57', '2023-12-08 12:46:57'),
(2669, 'Ribbed Bodycon Midi Dress with Side Slit Ex-Branded', 'GLORIA-005', 23, 1, 'Ribbed Bodycon Midi Dress with Side Slit Ex-Branded. This beautiful dress can be worn at any time of the day or night, perfect for clubbing, it also doubles up as a brilliant day dress to wear on a hot summer\'s day. This dress has a round neck and spaghetti straps. There is split on one side. This dress is stretchy for a comfortable fit. This item is ex-branded and will therefore have the labels cut.\nModel is 5\' 7\" and wears a UK size 8\nMaterial:\n95% Polyester\n5%Elastane\nApproximate measurement for a UK size 8\nChest across one side 31cm strecthing to 36cm.\nLength from shoulder to hem 109cm', '2023-12-08 12:46:58', '2023-12-08 12:46:58'),
(2670, 'Floral Print Box Shirt', 'MAXINE-004', 40, 1, 'Floral Print Box Shirt.  This shirt has pink flowers all over and has a soft brushed feel fabric. This shirt has a loose fit. Our new boxy cropped shirt  will make you look great in no time. Team it with a pair of contrasting palazzo pants and statement necklace for a contemporary look.\nModel is 5\'7\" and wears a UK size 8.\nMaterial:\n100% Viscose \nApprox measurements: \nChest across one side: 53cm \nLength from shoulder to hem: 51cm', '2023-12-08 12:47:01', '2023-12-08 12:47:01'),
(2671, 'Cut Out Back Sleeveless Blouse Ex-Branded', 'ROSALD-005', 13, 1, 'Cut Out Back Sleeveless Blouse Ex-Branded. This is a classic chiffon blouse that works with any outfit for any occasion, whether it be a busy Monday morning at work or a fun Saturday at the next best festival, this top is versatile enough to suit any! With it\'s slightly dipped hem and cut out back, this top pulls off the smart yet fun look perfectly. The chiffon material is great for summer days as it is light and soft so sits comfortably on the body. This item is ex-branded and therefore will have the labels cut.\nModel is 5\' 7\" and wears a UK size 6\nMaterial:\n100% Polyester\nApproximate measurements for a UK size 6:\nChest across one side 46cm\nLength from shoulder to hem 51cm', '2023-12-08 12:47:02', '2023-12-08 12:47:02'),
(2672, 'Black Flower Print Shift Dress Ex-Branded', 'GWEN-004', 41, 1, 'Black Flower Print Shift Dress Ex-branded. Stay fashion- forward in this short sleeved mid-length shift dress this summer. Key feature on this dress is the cut-out V at the back giving it that edgy look that\'s in this season. The material is light weight and has a lose fitting, mix and match with a pair of our sandals or dress it up with one of our killer heels. \nModel is 5\'7 and wears UK size 8:\nMaterial:\n100% Viscose\nApprox measurements for a UK size 8:\nChest across one side: 42cm\nLength from shoulder to hem: 94cm', '2023-12-08 12:47:04', '2023-12-08 12:47:04'),
(2673, 'Navy Striped T-shirt Available in Plus Sizes', 'CHARIS-004', 3, 1, 'Navy Striped T-shirt. Fall in love with this tee! it has a comfortable fit, short sleeves and a crew neckline. This top is perfect to wear with skinny jeans and hi-tops for the ultimate casual look! \nModel is 5\'7 and wears a UK size 8.\nMaterial:\n100% Cotton \nApprox measurement for a UK size 8:\nChest across one side: 38cm\nLength from shoulder to hem: 67cm', '2023-12-08 12:47:06', '2023-12-08 12:47:06'),
(2674, 'Yellow Midi Shift Scuba Dress', 'DAPHINE-004', 0, 0, 'Yellow Midi Scuba Shift Dress. Brighten up your professional wardrobe with this outstanding shift dress! Classic and elegant this dress is ideal for ultimate office look, just add a pair of pointy shoes, traditional blazer and plain silky scarf! Key features include a short split at the back. \nModel is 5\'8 and wears a UK size 16.\nMaterial: \n95% Polyester \n5% Elastane \nApprox measurement of a UK size 16:\nChest across one side: 49cm\nLength from shoulder to hem: 109cm', '2023-12-08 12:47:08', '2023-12-08 12:47:08'),
(2675, 'Distressed Boyfriend Jeans With Braces Ex-branded', 'KEELAN-004', 0, 0, 'Distressed Boyfriend Jeans With Braces Ex-branded. Brace yourself! Steal your boyfriend\'s style with these loose fit distressed boyfriend jeans. These have adjustable denim braces attached on both sides and turn-up ankle cuffs. They have a waist button and a zip fly. Team it up with a slim fit white vest and espadrille plimsolls for the summer. These jeans are ex-branded and will therefore have the labels cut. \nModel is 5\' 7\" and wears a UK size 8.\nMaterial: \n99% Cotton \n1% Elastane\nApprox measurements for a UK size 8:\nWaist across one side:41cm\nLength from waist to hem: 80cm', '2023-12-08 12:47:11', '2023-12-08 12:47:11'),
(2676, 'Black Midi Shift Scuba Dress', 'CORY-001', 0, 0, 'Black Midi Shift Dress.Up date your professional wardrobe with this outstanding shift dress! Classic and elegant this dress is ideal for ultimate office look, just add a pair of pointy shoes, traditional blazer and plain silky scarf! Key features include a short split at the back and outlined waist to compliment your curves.\nModel wears a UK size 16.\nMaterial:\n95% Polyester \n5% Elastane \nApprox measurement of a UK size 16:\nChest across one side: 49cm\nShoulder to hem: 109cm', '2023-12-08 12:47:13', '2023-12-08 12:47:13'),
(2677, 'Cream Vest Style Dipped Hem Tunic Dress', 'CLIONA-004', 4, 1, '<p>Cream Vest Style Tunic Dress with Side Slits. Great with a boob tube and jeans or over your bikini.</p>\n<p><strong>Key Features:</strong></p>\n<ul>\n<li>Round neck</li>\n<li>Dipped hem</li>\n<li>Side splits</li>\n</ul>\n<p><strong>Material:</strong></p>\n<ul>\n<li>95% Viscose, 5% Elastane</li>\n</ul>\n<p><strong>Measurements:</strong></p>\n<ul>\n<li>Model is 5\' 7\" and wears a size S/M</li>\n<li>Chest across one side 40cm</li>\n<li>Length from shoulder to hem 106cm</li>\n</ul>', '2023-12-08 12:47:14', '2023-12-08 12:47:14'),
(2678, 'Vest Style Tunic Dress with Side Slits', 'PETA-004', 25, 1, 'Vest Style Tunic Dress with Deep Side Slits. This dress has a round neckline. It is stretchy for a comfy fit. The side slits also mean you can team this dress up with denim shorts and trainers to bring out a casual summer look. \nModel is 5\' 7\" and wears a size S/M\nMaterial:\n95% Viscose\n5% Elastane\nApproximate measurement for size S/M:\nChest across one side 40cm\nLength from shoulder to hem 106cm', '2023-12-08 12:47:16', '2023-12-08 12:47:16'),
