(2683, 'Striped Short Sleeve Scuba Shift Dress', 'LIANA-005', 0, 0, 'Striped Short Sleeve Scuba Shift Dress. This classic knee-length dress is suitable for any occasion. This dress has a round neck and short sleeves, it creates an hourglass figure with it\'s fitted waist whilst the material is stretchy to ensure a comfortable fit. The dress has a concelaed zip making it easy to slip on. It has a slit-hem at the back to give it that added style. Due to it\'s modest length this dress is perfect to wear to work as well as on a night out with friends, just create a different look with a pair of heels or team it up with a blazer for a more formal look.\nModel is 5\'8\' and wears a UK size 16\nMaterial:\n95% Polyester\n5% Elastane\nApproximate measurements for a UK size 16:\nChest across one side 52cm\nLength from shoulder to hem 107cm', '2023-12-08 12:47:24', '2023-12-08 12:47:24'),
(2684, 'Burgundy Midi Shift Scuba Dress', 'DARLINE-004', 0, 0, 'Burgundy Midi Shift Dress. The dress has short split at the back and an outlined waist. It has short sleeves and a concealed zip at the back. Strecthy materia for a perfect fit. \nModel is 5\'8 and wears a UK size 16.\nMaterial: \n95% Polyester \n5% Elastane \nApprox measurement of a UK size 16:\nChest across one side: 50cm\nLength from shoulder to hem: 106cm', '2023-12-08 12:47:27', '2023-12-08 12:47:27'),
